final sourceWords = [
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Aa', 'A term of Hawaiian origin.  Used in reference to a basaltic lava flow that has a fissured, rough, clinkery, or jagged surface. When cool, they are very difficult to walk on.', '/a/aa.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Abandoned Mine Lands', 'Areas where past mining activity has scarred the land surface, streams, or groundwater. These lands might be owned by persons, companies, organizations, or government agencies. Abandoned mine lands are dangerous places. Every year in the United States, accidents at abandoned mines and quarries claim numerous lives.', '/a/abandoned-mine.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ablation (glaciers)', 'The  loss of ice and snow from a glacier through any process, including  melting, sublimation, evaporation, wind erosion, and calving.', '/a/ablation.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ablation (meteorites)', 'The removal of surface material from a meteoroid as it passes through Earths atmosphere. The removal is caused by air molecules impacting the meteoroid, which is probably traveling at a speed of at least 20 kilometers per second. Trails of these ablated particles are often visible from Earth as a bright streak of light sometimes called a shooting star or a meteoroid trail.', '/c/180-iron-meteorite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ablation (sediment and soil)', 'The removal of small-size soil and sediment particles from a land surface by the persistent action of wind. Eventually all of the particles that can be carried by the wind will be removed, leaving a rocky surface known as a desert pavement. The desert pavement surface shown here is on an alluvial fan in the Providence Mountains State Recreational Area of California.', '/a/desert-pavement.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ablation Zone', 'The lower portion of a glacier where, over the course of a year, more ablation than accumulation occurs. ', '/a/accumulation.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Accretionary Wedge', 'A mass of sea floor sediment that accumulates at the boundary between a\r\nconverging oceanic plate and continental plate.   This sediment is being\r\nscraped off the top of the oceanic plate as it is forced under the\r\ncontinental plate.  It accretes at the point of plate collision, and that\r\nis where the name originates.', '/a/accretionary-wedge.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Accumulation Zone', 'The upper portion of a glacier where, over the course of a year, more accumulation occurs than ablation and the mass of glacial ice grows.', '/a/accumulation.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Acidic Rock', 'An igneous rock that has a relatively high silica content.  Examples are granite and rhyolite.  Also see entries for basic,  intermediate, and ultrabasic rocks. The photo is a specimen of pink granite about two inches across.', '/a/granite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Acid Mine Drainage (AMD)', 'Acidic water discharged from a mining operation. The acid is usually produced  by the reaction of sulfide minerals newly  exposed to oxygen during the mining process. The acid waters usually carry  dissolved metals which precipitate downstream as the acid is diluted by other water sources. The acid is neutralized by the dilution and the water is unable to carry the dissolved metal ions. Coal mines and metal mines are the typical sources of acid mine drainage. Today,  active mines are required to have treatment systems that prevent the release of acid waters. Abandoned mines are typically the source of acid discharge and can continue to produce acid discharge for decades without remediation. The photo shows a seep draining mine tailings along Silver Creek, near Park City, Utah.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Acre', 'An acre is a unit of land measure that represents 43,560 square feet or 1/640 of a square mile. A square property that is 208.71 feet long and 208.71 feet wide is approximately one acre.', '/a/acid-mine-drainage.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Acre-Foot', 'The volume of water needed to flood one acre of land to a depth of one foot. Equivalent to 43,560 cubic feet, 1,233 cubic meters, or 325,851 gallons. The acre-foot is one of the most common units of measure used for reservoir capacity. Also used in mineral resource calculations (an acre-foot of coal is a block of coal one acre in area and one foot thick - it weighs approximately 1,800 tons).', '/a/acre.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Acreage', 'An area, measured in acres, that is owned or controlled by one or more owners or lessees.  Gross Acreage is the entire geographic area under control.  Net Acreage is the gross acreage multiplied by the fractional share of any individual owner or lessee.', '/a/acre-foot.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Actinolite (Cats Eye) ', ' Actinolite is green to grayish green mineral of the amphibole group found in metamorphic rocks. It sometimes has a fibrous texture that produces a strong cats eye when cut en cabochon.', '/a/acre.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Active Fault', ' A fault that has slipped in historic time and which is likely to slip again in the future. Strain accumulates on active faults, and some creep slowly over time. The image shows the surface exposure of the Denali fault with approximately 5 meters of offset near the Delta River in Alaska.', '/gemstones/gems/actinolite-cats-eye.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Active Volcano', ' A volcano that has erupted within historic time or one that is currently erupting. The photo is of Pavlof Volcano on the Alaska Peninsula, one of the most active volcanoes in North America.', '/a/active-fault.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Adularescence', ' An optical phenomenon that defines the gem known as moonstone.  Adularescence is a soft glow of light that floats just under the surface of a polished gemstone or under the smooth surface of a gem material.  This floating glow of light will move within the stone as the angle of incident light is changed, as the position of the observers eye is moved, or as the stone is moved under the light.  Adularescence is observed in some semi-translucent to transparent feldspar minerals and is caused by light entering the material and reflecting from molecular interfaces within the stone.  ', '/c2/pavlof-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Aftershocks', 'Small earthquakes that follow the largest shock of an earthquake sequence.\r\n  They can occur for days, weeks, months, or years after the large\r\nearthquake.  The larger the main shock, the more numerous and longer the\r\naftershock sequences.', '/gemstones/gems/moonstone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Agate', ' Agate is a cryptocrystalline quartz that is translucent and patterned with bands, plumes, dendrites, or inclusions that produce a colorful, interesting appearance. It is a popular gem cut into cabochons, beads, and ornamental objects.', '/a/richter-magnitude.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('A-Horizon', 'A soil layer immediately below the surficial organic material. It consists of a mixture of organics and mineral matter. The majority of soil organisms live within this layer, and it may be heavily bioturbated. As water moves from the surface down through this layer, soluble constituents are removed and carried deeper into the ground.', '/gemstones/gems/coyamito.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Alkali', ' In chemistry, an alkali is a strongly basic substance such as sodium hydroxide or sodium carbonate. These substances have the ability to neutralize acids to form salts. In geology, alkali is an adjective used in reference to  silicate minerals or rocks that are rich in  alkali metals such as sodium or potassium. Orthoclase, plagioclase, and microcline would be alkali feldspars. The specimen in the photo is a cleavage fragment of plagioclase.', '/a/soil-profile.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Alluvial Fan', 'A fan-shaped wedge of sediment that typically accumulates on land where a stream emerges from a steep canyon onto a flat area.  In map view it has the shape of an open fan. Alluvial fans typically form in arid or semiarid climates. Shown in the photo is the Badwater Alluvial Fan of Death Valley.', '/a/plagioclase.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Alluvium', ' An unconsolidated accumulation of stream-deposited sediments, including sands, silts, clays, or gravels. Shown in the photo is an outcrop of alluvium.', '/a/alluvial-fan.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Almandine Garnet', ' Almandine garnet, also known as almandite, is an iron-rich, red-to-purple garnet that is geologically very common and typically sells on the more affordable side of the garnet price range. For that reason, it is common in jewelry.', '/a/alluvium.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Alpine Glacier', 'A glacier that occurs in a mountainous region and occupies a valley.  Also known as a valley glacier.', '/gemstones/gems/almandite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Amazonite', 'Amazonite is a trade name given to a light green to bright green variety of microcline feldspar. It has a Mohs hardness of 6 with perfect cleavage. It is often cut into cabochons for use in jewelry. Because it is relatively fragile, it is best used where it will not suffer abrasion or impact. ', '/a/valley-glacier.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Amber', 'Amber is a fossilized resin secreted by ancient trees. It usually has a yellowish to orangish-brown color but can be white, greenish, bluish or even black. It is easily cut and polished into bright, lightweight gems. Amber is an organic gem material.', '/gemstones/gems/amazonite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Amethyst', 'Amethyst is a transparent variety of quartz that ranges from light lilac to deep purple in color. It is one of the most popular faceted gemstones and is sometimes cut en cabochon. It is found in deposits around the world.', '/gemstones/gems/amber.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ametrine', 'Ametrine is a bicolor quartz that is half AMEthyst and half ciTRINE. The color combination is caused by twinning. Mined commercially at only one mine in the world, located in eastern Bolivia. ', '/gemstones/gems/amethyst.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ammolite', 'Ammolite is a trade name used for iridescent ammonite shell material. It produces a bright flash of color that rivals fine opal and labradorite. All of the worlds commercial Ammolite production comes from a small area in Alberta, Canada.', '/c2/ametrine-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ammonite', 'An extinct group of marine invertebrate animals that produced a chambered shell. Their fossilized shells are often cut and used as an ornamental or jewelry stone. Agatized ammonites are a popular organic gemstone.', '/gemstones/gems/ammolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Amphibole', 'Amphiboles are members of a family of dark-colored ferromagnesian silicate minerals that have the generalized chemical composition of A2-3B5(Si,Al)8O22(OH)2 where A = Mg,Fe,Ca,Na and B = Mg,Fe,Li,Mn,Al.  They occur in prismatic crystals that have very good cleavage in two directions, with cleavage planes intersecting at 56 and 124 degrees.  They are rock-forming minerals found in igneous, metamorphic, and sedimentary rocks.  Hornblende, tremolite, actinolite, and glaucophane are examples. ', 'https://geology.com/gemstones/gems/ammonite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Amphibolite', 'Amphibolite is a non-foliated metamorphic rock that forms through recrystallization under conditions of high viscosity and directed pressure. It is usually composed primarily of hornblende and plagioclase, usually with very little quartz.', '/a/amphibole.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Andalusite ', 'Andalusite is a metamorphic mineral that is strongly pleochroic and is underappreciated as a gem. A variety known as chiastolite has grains of graphite concentrated into a cross-shaped feature.', '/a/amphibolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Andesite', 'A fine-grained, extrusive igneous rock composed mainly of plagioclase with other minerals such as hornblende, pyroxene, and biotite.', '/gemstones/gems/andalusite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Angle of Repose', ' The maximum angle that a soil, sediment, or other loose, cohesionless material can be placed or accumulate and be stable from down-slope movement.  The angle of repose varies for different types of materials and different moisture conditions. Image copyright iStockphoto / Barcin.', '/a/andesite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Angular Unconformity', 'An erosional surface that separates rock units of differing dips.  The rocks below the surface were deposited, deformed, and eroded.  The younger rocks above then accumulated upon the erosional surface. Shown in the photo is a section of The Great Unconformity of the Grand Canyon.', '/a/angle-of-repose.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Anion', 'An atom with a negative charge that has been produced by the gain of one or more electrons. In the image, a chlorine atom gained one electron (red) and is now a chloride ion with a negative charge.', '/a/angular-unconformity.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ant Hill Garnet', 'Ant hill garnet is a novelty gem that ants excavate, haul to the surface, and deposit on their ant hill. These red chrome pyrope garnets are often found on ant hills in parts of the southwestern USA.', '/a/anion.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Anthracite', 'The highest rank of coal.  By definition, a coal with a fixed carbon content of over 91% on a dry ash-free basis.  Anthracite coals have a bright luster, break with a conchoidal fracture, a semi-metallic luster and are difficult to ignite.   Frequently referred to by the layman as hard coal.', '/c2/anthill-garnet-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Anticline', 'A fold in rock strata with a convex upward shape. The rocks in the core of an anticline are the oldest. The anticline in the photo is along New Jersey Route 23 near Butler, NJ.', '/a/coal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Apatite', 'Apatite is a phosphate mineral that is mainly used in making fertilizer. It is also  cut as a gem when found in clear crystals with attractive colors. It has a hardness of 5 on the Mohs scale and is brittle. It is a collectors gem rather than a jewelry gem.', '/a/anticline.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Aquamarine', 'Aquamarine is a blue variety of the mineral beryl. It receives its name from its seawater color. It ranges from a very light blue to a richly saturated blue, with the richer color being much more desired.', '/gemstones/gems/apatite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Aquiclude', 'The opposite of an aquifer. An aquiclude or aquitard is a subsurface rock, soil, or sediment unit that does not yield useful quantities of water. It may be porous and capable of containing water, but the transmission rate is so poor that it cannot be considered to be a water source. Clay and shale are typical aquicludes.', '/gemstones/gems/aquamarine.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Aquifer', ' A subsurface rock or sediment unit that is porous and permeable. To be an aquifer it must have these traits to a high enough degree that it stores and transmits useful quantities of water.', '/a/aquiclude.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Aquifer (artesian)', 'An aquifer that is bounded above and below by impermeable rock or sediment layers. The water in the aquifer is also under enough pressure that, when the aquifer is tapped by a well, the water rises up the well bore to a level that is above the top of the aquifer. The water may or may not flow onto the land surface.', '/a/aquiclude.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Aquifer (confined)', 'An aquifer that is bounded above and below by impermeable rock or sediment layers.  There may or may not be enough pressure in the aquifer to make it an artesian aquifer.', '/a/artesian-aquifer.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Aquifer (unconfined)', 'An aquifer that is not overlain by an impermeable rock unit. The water in this aquifer is under atmospheric pressure and is recharged by precipitation that falls on the land surface directly above the aquifer.', '/a/aquiclude.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Arc', 'A chain of volcanoes that forms on a continental plate when an oceanic\r\nplate collides with the continental plate and subducts beneath it.   Also,\r\na chain of volcanoes that forms on an oceanic plate in a similar collision\r\nwith another oceanic plate.  The image shows the Cascades Volcanic Arc of\r\nthe northwestern United States.', '/a/aquiclude.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Arkose', 'A sandstone that contains at least 25% feldspar.  Easily recognized because the feldspar grains are typically pink and angular in shape.', '/a/volcanic-arc.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Arroyo', 'A flat-bottom gully with steep sides that is cut into alluvium. It serves as a channel for an intermittent or ephemeral stream. This term is commonly used in the arid and semiarid areas of the southwestern United States.', '/a/arkose.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Aseismic', 'A fault that has never produced an earthquake that has been detected or\r\nobserved by people.', '/a/arroyo.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ash (volcanic)', 'Rock, mineral, and volcanic glass fragments smaller than 2 millimeters in size that are blown from the vent of an erupting volcano. It is produced by the shattering of rocks during an eruption and by magma being ejected as a fine spray - propelled by volcanic gas escaping from the vent.', '/a/aseismic.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Associated Gas', 'Natural gas that is found in a reservoir with crude oil. The gas may be in a free gas cap above the oil within the reservoir structure because of its lighter density, or, the gas might  be dissolved within the oil and come out of solution when the pressure is reduced. Associated gas is often flared (burned) when oil is produced because a collection and distribution system is not available to transport the gas to  market. Flaring is a waste of a resource, a cause of pollution, and a contribution to global warming. Contrast with unassociated gas.', '/c/180-volcanic-ash.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Asterism', 'An optical phenomenon seen as intersecting lines of light that form a star-like figure just below the surface of a cabochon-cut gem.  The phenomenon is called a star and is seen in gems such as sapphire, ruby, enstatite, diopside, garnet, and spinel.  The star is caused by reflections from a network of tiny parallel rod-shaped inclusions within the stone, known as a silk.  Each orientation of these parallel inclusions within the stone produces a single line on the surface of the stone.  Four- and six-ray stars are most common.', '/a/associated-gas.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Asthenosphere', 'A portion of the upper mantle that is directly below the lithosphere.  A zone of low strength in the upper mantle defines the top of the asthenosphere.  This weak zone allows the plates of the lithosphere to slide across the top of the asthenosphere.', '/gemstones/gems/star-sapphire.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Astrobleme', 'An ancient circular scar on Earths surface produced by the impact of a meteorite or comet.', '/a/asthenosphere.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Atoll', 'A ring-shaped island or group of coral islands that are surrounded by deep ocean water and that enclose a shallow lagoon. The satellite image at left shows Rose Atoll. The island is about 1.5 miles across, and the central lagoon has a maximum depth of about 60 feet. A narrow passage on the northern corner of the island is the only surface connection of the lagoon to the ocean.', '/a/astrobleme.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Atom', 'A basic unit of matter that consists of a central nucleus surrounded by shells of negatively charged electrons. The nucleus consists of positively charged protons and electrically neutral neutrons. Shown in the image is one sodium atom and one chlorine atom.', '/a/atoll.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Aventurescence', 'An optical phenomenon that is seen as a flash of light as a gemstone is moved under a source of incident light.  It is caused when many tiny platelet-shaped inclusions of a reflective mineral such as mica or copper or hematite are aligned with a common orientation within the gem material.  Light entering the stone travels until it encounters one of these platelets and is then reflected.  Because the platelets share a common orientation, they all reflect simultaneously and produce a quick flash of light as the stone is moved under the source of incident light.  Reflections can also be seen if the light source is moved or the eye of the observer is moved.  Aventurescence is the defining phenomenon of the gem material known as aventurine.  It is also seen in sunstone and other materials. ', '/a/atoms.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Aventurine', 'Aventurine is a quartz variety that contains a blizzard of tiny reflective inclusions such as muscovite, hematite, or fuchsite. Light enters the stone, reflects from the grains and produces a flash known as aventurescence.', '/gemstones/sunstone/aventurescent-feldspar.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Azurite', 'A dark blue copper carbonate mineral that is a minor ore of copper. It is also cut as an opaque gemstone and sometimes ground to a powder for use as a pigment.  Often associated with malachite and chrysocolla. It is soft (H: 3.5-4) and cleaves easily. Cut into cabochons for jewelry that will not encounter wear.', '/gemstones/gems/aventurine.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Backarc', 'The tectonic region on the landward side of a volcanic arc.  Image by USGS.', '/a/backarc.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Backwash', 'The seaward rush of water down a beach that occurs with a receding wave.', '/a/backwash.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ball Mill', 'A device used to reduce the particle size of laboratory specimens, dry chemicals, mined ores, and other solid materials. The material to be reduced in particle size is sealed in a durable cylindrical container along with two or more balls made out of mineral material or metal. The cylinder is then placed in a machine that rolls or shakes it vigorously while  the balls inside repeatedly impact the material, reducing it to a powder. Ball mills can be as small as the one shown in the photo  (for grinding laboratory specimens), or they can be cylinders over ten feet tall and twenty feet long that are loaded with many tons of ore from a mine and used to pulverize it to a fine particle size.', '/a/ball-mill.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Banded Iron Ore', 'A rock that consists of alternating layers of jasper and an iron oxide mineral (usually hematite), with the iron oxide in high enough concentration to be of economic value. ', '/a/banded-iron.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bankfull Stage', 'A height of water in a stream that completely fills the natural channel.  If the water rises any higher, it will overtop the banks of the stream and a flood will occur.', '/a/bankfull.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bank Storage', 'Water that seeps into the ground along the banks of a stream during a time of high flow. This loss of water into the ground slightly reduces the height that the stream will attain and then slowly seeps into the stream as the high water level subsides - hence the term bank storage.', '/a/bank-storage.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bar', 'An underwater ridge, usually of sand and/or gravel, that forms from the deposition and reworking of sediments by currents and/or waves.   Bars occur in rivers, river mouths, and in offshore waters. The photo shows a sand bar in a river at low water level.', '/a/bar.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Barchan', 'A sand dune that is crescent-shaped in map view.  Barchan dunes form in areas of limited sand supply.  They move across the desert floor with their gently sloping convex sides facing upwind and their steeply sloping concave sides facing downwind.', '/a/barchan.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Barrier Island', 'A long, narrow island composed of sediment that parallels a shoreline. Shown in the photo are  some of the Chandeleur Islands, barrier islands that stand between the Gulf of Mexico and the Louisiana coastline. During storms, the barrier islands absorb some of the wave energy that would otherwise batter the coastline. Their geometry can be significantly changed during these storms.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Basalt', 'A dark-colored, fine-grained extrusive igneous rock composed mainly  of plagioclase feldspar and pyroxene. Similar in composition to gabbro.  Basalt is thought to be one of the main components of oceanic crust and is the most common rock type of lava flows on land.', '/a/barrier-island.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Base Flow', 'Water that seeps into a stream through a permeable rock or sediment unit that outcrops in the bottom or banks of the stream.', '/a/basalt.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Base Level', 'The lower limit of erosion by a stream.  Sea level is the ultimate base level.  However, lakes, dams, and other locations of low water flow can serve as a temporary base level in upstream areas.', '/a/base-flow.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Basement', 'The igneous and metamorphic rocks that exist below the oldest sedimentary rock cover.  In some areas, such as shields, the basement rocks may be exposed at the surface. The rock at river level in the photo is the Vishnu Schist, basement rock in the Phantom Ranch area of the Grand Canyon.', '/a/base-level.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Basic Rock', 'An igneous rock that has a relatively low silica content.  Examples are gabbro and basalt.  Also see entries for acidic, intermediate, and ultrabasic rocks.', '/a/basement.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Basin', 'In tectonics, a circular, syncline-like depression of strata. In sedimentology, the site of accumulation of a large thickness of sediments. Shown in the photo is the Tarim Basin of China, which is occupied by the Taklimakan Desert, a  large desert in China.', '/a/basalt.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Batholith', 'A very large intrusive igneous rock mass that has been exposed by erosion and that has an exposed surface area of over 100 square kilometers.  A batholith has no known floor. Shown in the photo is El Capitan, a famous granite outcrop in Yosemite National Park. The granites exposed in Yosemite and much of the surrounding area are part of the Sierra Nevada Batholith.', '/a/basin.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bathymetry', 'The measurement of ocean depths and the preparation of maps that display water depth or the topography of the ocean floor. ', '/a/batholith.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bauxite', 'The most important ore of aluminum.  A mixture of aluminum oxides and hydroxides that forms from intense chemical weathering of a soil in tropical environments.', '/a/bathymetry.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bedding', 'The characteristic structure of sedimentary rocks in which layers of different composition, grain size, or arrangement are stacked one on top of another in a sequence with oldest at the bottom and youngest at the top. The photo of bedded rock units in the image was acquired by NASAs Mars Rover Curiosity in the Gale Crater of Mars.', '/a/bauxite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bedding Plane', 'A distinct surface of contact that separates the layers of a sedimentary rock unit.', '/c2/rocks-on-mars-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bed Load', 'The larger, heavier particles that are being transported by a stream.  Instead of being dissolved or suspended, these are being rolled or bounced along, spending at least part of their time in contact with the stream bottom.', '/a/bedding-plane.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bedrock', 'Solid rock present beneath any soil, subsoil, sediment, or other surface cover. In some locations it may be exposed at Earths surface.', '/a/bed-load.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Beryl', 'Beryl is a beryllium aluminum silicate mineral with a chemical composition of Be3Al2Si6O18.  It has historically been used as an ore of beryllium, but is better known as the mineral of several gem varieties based upon color. Green beryl is emerald. Blue is aquamarine. Pink is morganite. Yellow and yellow-green are heliodor. Red is red beryl. Clear is goshenite.', '/a/bedrock.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Beta-Particle', 'A particle emitted   with high energy and velocity from the nucleus of an atom during radioactive decay. It can be equivalent to an electron or a positron.', '/c2/beryl-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('B-Horizon', 'A layer in the soil, below the A-horizon, where materials leached from above accumulate. Typically enriched in iron, clay, aluminum, and organic compounds. ', '/a/beta-particle.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Biochemical Rocks', 'A sedimentary rock that forms from the chemical activities of organisms.  Organic (reef and fossiliferous) limestones and bacterial iron ores are examples. The photo is a specimen of coquina, a variety of limestone composed primarily of shell debris.', '/a/soil-profile.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bioturbated', 'An adjective used in reference to a  sediment or sedimentary rock.  Bioturbated sediments have been disturbed by animals (such as burrowing worms or shell fish) or plant roots.  These have penetrated the sediment and disturbed any or all original sedimentary laminations and structures.  Bioturbated rocks were disturbed in this way while still in the soft sediment phase of their formation.  ', '/a/coquina.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bituminous Coal', 'A rank of coal that falls between anthracite and semi-bituminous.  The most abundant rank of coal.  Frequently referred to by the layman as soft coal. It is most often composed of bright and dull bands. The bright bands generally represent well-preserved woody materials. The dull bands generally represent degraded woody materials and mineral matter.', '/a/bioturbated.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Black Opal', 'The name black opal is used for an opal with a black base color. This opal has blue play-of-color on a black base and is from Lightning Ridge, Australia. There are many types of opal.', '/a/bituminous-coal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Black Smoker', 'A hot spring on the sea floor, usually near mid-ocean ridges,  that\r\ndischarges hot water laden with dissolved metals and dissolved gases.  When\r\nthese hot fluids contact the cold ocean water, the dissolved materials\r\nprecipitate, producing a dark plume of suspended material.  The water\r\ndischarged from these springs is sea water that percolates down into the\r\nearth through fissures in the sea floor.  This water is heated and picks up\r\ndissolved gases and metals as it interacts with the hot rocks and magma at\r\ndepth.  Also known as a hydrothermal vent.', '/gemstones/gems/black-opal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Block', 'Also known as volcanic block. A rock greater than 64 millimeters in diameter that was ejected from a volcano during an explosive eruption. They are typically pieces of the volcanic cone that were torn loose during the eruption rather than a mass of molten ejecta that solidified in flight. The block in the photo was found on Kilauea Volcano, Hawaii.', '/a/hydrothermal-vent.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Block Fault Mountain', 'A linear mountain that is bounded  by normal faults. Also known as fault-block mountain. The photo shows Mount Moran, near Jackson Lake Junction, Wyoming. Mount Moran is part of the Teton Range, a block-faulted mountain range.', '/a/block.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Block Slide', 'A type of mass wasting in which  rock debris detaches and slides down a slope under the influence of gravity. The movement usually occurs over  a planar surface such as a bedding plane, joint surface, or fault plane, with the  moving material remaining  in a large coherent mass. ', '/a/fault-block-mountain.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bloodstone', 'Bloodstone is a dark green variety of jasper that has numerous splashes of red color. These red splashes remind people of blood, and that is how the stone received its name.', '/a/rockslide.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Blowout', 'A sudden, uncontrolled release of pressure from an oil or gas well that is triggered when the drill bit penetrates a pressurized rock unit. This release can blow the drill string and drilling fluid out of the well, followed by a rush of water, oil and natural gas. These were a greater danger in the early days of drilling. Today, blowout preventers and improved drilling and control methods are usually able to prevent them. The photo shows the Ixtoc I blowout that occurred in the Gulf of Mexico in 1979.', '/gemstones/gems/bloodstone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Blowout Dunes', 'Small, shallow, round or trough-shaped depressions in sand or dry soil that are formed by wind erosion.  The material removed by the wind may also be referred to as blowout.', '/a/blowout.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bomb', 'Fragments of lava that are ejected while molten or partially molten from a volcano, some developing aerodynamic shapes while flying through the air, and landing with a size over 64 millimeters in diameter. The image shows basaltic volcanic bombs erupted by Mauna Kea Volcano in Hawaii.', '/a/blowout-dunes.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Boulder', 'A term used for a sedimentary particle that is larger than 256 millimeters in size.  Boulders are the largest particles of sediment that occur in streams and can reach the size of a small house.  The image shows rounded boulders of glacial ice deposited on an outwash plain in Iceland (with an adult human for scale).  Yes, in some locations, ice can be a sedimentary particle!', '/a/bomb.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Boulder Opal', 'Boulder opal is a name used for a rough or cut material that displays precious opal within its surrounding rock matrix. There are many types of opal.', '/a/boulders.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Brackish Water', 'Brackish water contains dissolved sodium chloride in amounts greater than that of fresh water, but less than that of sea water.  (Average sea water contains about 35 g/L of dissolved sodium chloride.)', '/gemstones/gems/boulder-opal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Breccia', ' A clastic sedimentary rock that is composed of large (over two millimeter diameter) angular clasts. The spaces between the clasts can be a matrix of smaller particles or a mineral cement that binds the rock together. The photo shows a piece of chert breccia that is, a breccia in which the clasts are composed mainly of chert.', '/a/brackish-water.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bronzite', 'A bronze to greenish variety of enstatite with a metallic luster that is sometimes cut and polished as a gemstone.', '/a/breccia.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Bumblebee', 'Often called Bumblebee Agate or Jasper, it is instead a rock formed at several volcanic vents in Indonesia. Some specimens reportedly contain arsenic. Although many cutters coat their stones with acrylic or  resin, it is not recommended for use in jewelry or other uses that will place it in extended contact with your skin.', '/gemstones/gems/bronzite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Butte', 'A conspicuous hill with steep sides and a flat top.  The top is usually a cap-rock of resistant material.  This structure is frequently an erosional remnant in an area of flat-lying sedimentary rocks. The photo shows the south face of Fajada Butte, Chaco Culture National Historical Park.', '/gemstones/gems/bumblebee.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cabochon', 'A cabochon is a stone or other material that has been shaped and polished rather than faceted.  Stones that are cut en cabochon will typically have a front side that is domed and polished, while the back side is flat to allow it to be mounted in jewelry. Cabochons (or cabs) are often cut to be oval in shape, but can also be round, square, rectangular, triangular, teardrop-shaped, or a freeform shape. Shown here are two cabochons of bloodstone.', '/gemstones/gems/bloodstone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Calcrete', 'Calcrete is a shallow soil or sediment layer in which the particles are cemented together by calcium carbonate mineral matter.  It is a common feature of arid or semiarid areas throughout the world. Calcrete soils are associated with poor soil drainage, difficult soil conditions for plant growth, and excavation problems at construction sites.  Other names commonly used for calcrete are caliche and hardpan.', '/a/caliche.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Caldera', 'A large, bowl-shaped crater associated with a volcanic vent.  A caldera can form when a volcanic blast or the collapse of a volcanic cone into an emptied magma chamber produces a depression.  Large calderas exist at  Crater Lake and Yellowstone.', '/c2/caldera-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Caliche', 'Caliche is a shallow soil or sediment layer in which the particles are cemented together by calcium carbonate mineral matter.  It is a common feature of arid or semiarid areas throughout the world. Caliche soils are associated with poor soil drainage, difficult soil conditions for plant growth, and excavation problems at construction sites.  Other names commonly used for caliche are calcrete and hardpan.', '/a/caliche.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Capillary Fringe', 'The lower part of the unsaturated zone where some moisture is transmitted up from the water table by capillary action.', '/a/zone-of-saturation.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Carbonate Rock', 'A rock made up primarily of carbonate minerals (minerals containing the CO3 anionic structure). Limestone (made up primarily of calcite - CaCO3),  dolostone (made up primarily of dolomite - CaMg(CO3)2), and marble (metamorphosed limestone or dolomite) are the most commonly encountered carbonate rocks.  The example photo shows a piece of limestone.', '/a/limestone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Carbonic Acid', 'A weak acid (H2CO3) that forms from the reaction of water and carbon dioxide.  Most rain water is a very weak carbonic acid solution formed by the reaction of rain with small amounts of carbon dioxide in the atmosphere.', '/a/carbonic-acid.png');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cataclastic Rock', 'A rock composed of rock fragments formed by crushing and shearing during tectonic movements. The rock fragments can be as small as a powder or as large as several feet across. The original rock types may have been sedimentary, igneous, or metamorphic, but the cataclastics themselves are often metamorphic because of their heat and pressure exposure. Cataclastite, mylonite, and tectonite are examples of cataclastic rocks. See larger photos by USGS.', '/a/cataclastite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cation', 'An atom with a positive  charge that has been produced by the loss of one or more electrons. In the image, a sodium atom  lost the one electron in its outermost shell and is now a sodium ion with a positive charge.', '/a/cation.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cats-Eye', ' Also known as chatoyance. An optical phenomenon in which a band of white light moves just under the surface of a cabochon-cut gemstone. The band is caused by light reflecting from parallel tubes, fibers, or other linear inclusions within the stone.  The band moves back and forth beneath the surface of the stone as the stone is moved under a source of incident light, or as the source of the light is moved, or as the eye of the observer is moved.  This phenomenon is characteristic of chrysoberyl and tigers-eye but is also seen in many other minerals including actinolite, tourmaline, apatite, beryl, sillimanite, and scapolite.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cement', 'A solid precipitate of calcium carbonate, silica, iron oxide, clay minerals, or other materials that forms within the pore spaces of a sediment and binds it into a sedimentary rock. In the photo at left, the orange-brown material is a carbonate cement binding pebbles of chert (CT) and quartz (Q). See larger photo by USGS.', '/c2/cats-eye-chrysoberyl-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cementation', 'The processes through which dissolved substances in pore water precipitate between the grains of a sediment and bind it into a  sedimentary rock.', '/a/carbonate-cement.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Center Pivot Irrigation', ' A circular area that might be between a quarter mile and a mile in diameter that is planted with crops and supplied with water from a well in the center of the circle. The water from the well is distributed by a long beam that stretches across the radius of the circle. The beam is covered with sprinkler heads and supported with wheels and one or more motors that drive the beam around the circle, distributing water over the crops. Also called irrigation circles or crop circles. The photo is a satellite image of center pivot irrigation sites in Finney County, Kansas.', '/a/carbonate-cement.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Chalcedony', 'Chalcedony is a name used for any cryptocrystalline quartz such as agate, jasper, petrified wood, chrysoprase, bloodstone, onyx, sard, and carnelian. Some people reserve the name for a blue, unbanded, translucent material. The photo shows specimens of pink to purple chalcedony cut en cabochon.', '/a/irrigation-circles.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Chalk', 'Chalk is a soft variety of limestone with a fine texture that is usually white or light gray. It forms from the calcareous shell remains of microscopic marine organisms or the calcareous remains of some types of marine algae.', '/gemstones/gems/chalcedony.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Charoite', 'Charoite is a light lavender to deep purple silicate mineral that has swirling, fibrous, or spotted patterns. It is a rare and relatively new gem material, discovered in Russia in 1978.', 'https://geology.com/a/chalk.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Chatoyancy', 'Also known as cats-eye. An optical phenomenon in which a band of white light moves just under the surface of a cabochon-cut gemstone. The band is caused by light reflecting from parallel tubes, fibers, or other linear inclusions within the stone.  The band moves back and forth beneath the surface of the stone as the stone is moved under a source of incident light, or as the source of the light is moved, or as the eye of the observer is moved.  This phenomenon is characteristic of chrysoberyl and tigers-eye but is also seen in many other minerals including actinolite, tourmaline, apatite, beryl, sillimanite, and scapolite.', '/gemstones/gems/charoite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Chemical Sedimentary Rock', 'A rock that forms from the precipitation of mineral material from solution.  An excellent example is halite. Other rocks such as chert, flint, limestone, and iron ore are sometimes deposited by chemical processes and sometimes deposited by biological processes.', '/c2/cats-eye-chrysoberyl-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Chemical Weathering', 'The breaking down of  rock material at or near Earths surface by solution or chemical alteration.  Common alteration processes are oxidation and hydrolysis. The broken, gray igneous rocks in the photo at right have orange weathering rinds caused by alteration of mineral grains exposed to the environment on the rocks surface. See larger photo by USGS.', '/a/halite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Chert', 'A microcrystalline or cryptocrystalline sedimentary rock  composed of  SiO2. Occurs as nodules and concretionary masses and less frequently as a layered deposit. It may form through chemical or biological activity.', '/a/weathering-rinds.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Chinese Writing Stone', 'A very interesting black metamorphosed limestone that contains geometric crystals of andalusite. Chinese writing stone is a trade name for the gem material used because some people think the white andalusite crystal shapes remind them of Chinese writing.', '/a/chert.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Christmas Tree', 'The valves, gauges, and fittings installed at the surface at the top of an oil or gas well.  These measure, control, and direct the flow of formation fluids produced from the well. Image copyright iStockphoto / SGV.', '/gemstones/gems/chinese-writing-stone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Chrysoberyl', 'Chrysoberyl, a gem unrelated to beryl, is an extreme gem. It has a hardness of 8.5, a very high luster, and a high index of refraction. It is sometimes a color-change stone and is best known for its cats-eye.', '/a/christmas-tree.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Chrysoberyl Cats-Eye', 'Chrysoberyl often contains oriented inclusions that produce a sharp line of light across the surface of a cabochon-cut stone in reflected light. This optical phenomenon is known as a cats-eye. Chrysoberyl is thought to have the finest cats-eye of any mineral. ', '/c2/chrysoberyl-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Chrysocolla', 'Chrysocolla is a green to blue-green copper silicate  that forms during the oxidation of copper deposits. It is often cut as a gem. The cabochon on the left is malachite with chrysocolla. The cabochon on the right is blue chrysocolla in white quartz.', '/c2/cats-eye-chrysoberyl-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('C-Horizon', 'The lowest horizon of a soil profile.  It is below the B-horizon and immediately above the bedrock.  It is a rocky zone that consists mostly of partially weathered bedrock and the weathering products of the least-resistant minerals in that bedrock.', '/gemstones/gems/chrysocolla.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cinder Cone', 'A cone-shaped hill that consists of pyroclastic materials ejected from a volcanic vent.  The photo at left shows a cinder cone and landscape covered with red scoria at Mauna Kea, Hawaii.', '/a/soil-profile.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cirque', 'A bowl-shaped depression with very steep sides that forms at the head of a mountain glacier. Forms from cold-climate weathering processes including frost wedging and plucking. ', '/a/scoria.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Citrine', 'Citrine is a transparent variety of quartz that ranges from golden yellow to yellowish orange to golden brown in color. It is usually cut as a faceted stone and is sometimes produced by applying heat treatment to amethyst.', '/a/cirque.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Clast', 'Rock fragment or mineral grain produced by the breakdown of larger rocks.  The image shows gravel-size clasts found on the surface of Mars by Mars Rover Curiosity in 2012.  The largest particle in the photo is about one centimeter in length.', '/gemstones/gems/citrine.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Clastic', 'A type of sedimentary rock (such as shale, siltstone, sandstone, or conglomerate) or sediment (such as mud, silt, sand, or pebbles).  Clastic rocks are accumulations of transported weathering debris that have been lithified.', '/a/gravel.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Clay', 'A clastic mineral particle of any composition that has a grain size smaller than 1/256 mm. The term is also used in reference to a broad category of hydrous silicate minerals in which the silica tetrahedrons are arranged into sheets. Clay minerals are the typical weathering product of feldspar minerals and  make up a major portion of many soils. The photo shows clay sediments that have dried in the sun to produce mud cracks.', '/a/conglomerate.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Coal', 'A brown or black sedimentary rock that forms from accumulated plant debris.  A combustible rock that contains at least 50% (by weight) carbon compounds.', '/a/clay.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Coalbed Methane', 'Natural gas in the form of methane that occurs within some coal seams and is adsorbed onto the solid portion of the coal.\xa0 It presents an explosion hazard to miners if it desorbs and accumulates in the air of the mine. If a coal seam has not been mined in an area, the methane can sometimes be commercially produced by drilling into the seam and pumping out water.\xa0 The removal of water reduces the pressure within the seam and allows the methane to desorb from the coal.\xa0 The gas produced from the coal may contain carbon dioxide and nitrogen in addition to the methane.\xa0 These gases must be processed out to produce a salable product.', '/a/coal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Coal Gasification', 'The process of converting solid coal into a gas, usually by heating or by the introduction of an oxidizing agent such as oxygen.  The gas is then used directly as a fuel,  processed into a chemical, or converted into a liquid fuel. Coal gasification can occur on Earths surface in a processing plant, or it can occur in unmined coal seams deep underground.', '/a/coal-bed-methane.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Coal Liquefaction', 'The process of converting solid coal into a liquid fuel such as  synthetic crude oil or methanol.  There are multiple processes that have been done successfully.  They might involve contacting the coal with a catalyst at high temperatures or first converting the coal into a gas and then converting it into a liquid.  Two of the main liquids produced are synthetic gasoline and diesel fuel.', '/a/coal-gasification.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Coastal Plain', 'An area of low relief along a continental margin that is generally underlain by thick sediments that dip gently  toward the ocean. The sediments were derived from the weathering and erosion of elevated areas of the continent and delivered toward the coast by streams.  This area usually begins at the coast and extends inland to the first occurrence of elevated land.', '/a/coal-liquifaction.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cobble', 'A term used for a sedimentary particle that is between 64 and 256 millimeters in size.  Cobbles are larger than pebbles but smaller than boulders.  Cobbles have typically been rounded by abrasion during sedimentary transport.  The image shows cobbles on the bank of the Salt River below Stewart Mountain Dam in Arizona.', '/a/coastal-plain.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Coherent', 'A rock or other aggregate that is resistant to breaking apart, well cemented.  The photo shows a well-cemented and coherent specimen of conglomerate.', '/a/cobbles.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Colluvium', 'A loose accumulation of soil material and rock fragments deposited by a combination of runoff and mass wasting that is often seen at the base of a slope or outcrop. The image shows an accumulation of vein quartz and silty soil in Frederick County, Maryland.', '/a/conglomerate.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Colored Diamonds', 'Colored diamonds are diamonds with a noticeable bodycolor when viewed in the face-up position. They can be yellow, brown, green, red, orange, pink, blue, or any other color.', '/a/colluvium.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Common Opal', 'Common opal is an opal material that does not exhibit a play-of-color. Most common opal is common in appearance, but some is spectacular in color or pattern. There are many types of opal.', 'https://geology.com/a/ibd-colored-diamonds.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Compaction', 'A compression process that reduces the volume of a sediment as accumulating sediment above adds increasing weight.  This volume loss occurs by: 1) repositioning the grains into a tighter packing 2) deforming the grains into a tighter packing and, 3)  squeezing fluids out of the pore spaces. Compaction is one of the first steps in converting a sediment into a sedimentary rock. Normally, compaction preferentially occurs in fine-grained clay and silt layers of a sediment mass. Their grains are initially deposited in random orientations without grain support. These have the most potential for improved packing and deformation.', '/gemstones/gems/common-opal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Completion', 'The final step in drilling of an oil or gas well.  If the well is a dry hole, the well must be plugged and the drilling site reclaimed in the manner described in the well permit.  If the well is to be a producer then casing, tubing, and production equipment must be installed that will allow the well to yield product into a tank or into a pipeline.  If the well is to be used for injection then, casing, tubing, and connections must be installed that will allow the connection of injection equipment and a supply of injection fluids.', '/a/compaction.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Composite Cone', 'A cone-shaped volcanic mountain composed of alternating layers of pyroclastic materials and lava flows.  Also known as a stratovolcano. Most of the volcanoes in the Cascade Range are stratovolcanoes.', '/a/christmas-tree.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Compound', 'A pure chemical substance made up of at least two different elements. A compound is defined by the elements that it contains, the relative proportions of those elements, and its  atomic structure. ', '/a/composite-cone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Condensate', 'Components of natural gas other than methane that are in the gaseous state under the high temperatures and pressures of the subsurface reservoir, but when they are produced at the lower temperatures and pressures of the surface they condense into a liquid.  These natural gas liquids vary in composition and abundance from one well to another and even from one formation to another in the same well.  They can include hydrocarbons such as pentane, butane, propane, hexane and others.  These liquids are separated from the raw gas and have commercial value.  In some areas they are more valuable than the methane that is produced.  Raw natural gas that contains condensates is known as wet gas.', '/a/compound.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cone of Depression', 'A cone-shaped lowering of the water table around a producing well. As water is pumped, the water level in the well falls, and width of  the cone increases. When pumping stops, the cone shrinks in size because water from adjacent lands flows in to fill it.', '/a/butane.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Confined Aquifer', 'An aquifer that is overlain by an impermeable confining unit and does not have a porous connection to the atmosphere through which it can receive recharge. In the image at left, the well on the left penetrates a confined aquifer. The shale confining unit above that aquifer  blocks its porous connection to the atmosphere. The water level in the well has moved  up above the top of the confined aquifer because that  aquifer is under pressure.  ', '/a/cone-of-depression.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Confusionite', 'Confusionite is a rock, mineral, or other material that a person wants to identify but they are unable to identify confidently.  The person might be a beginner at specimen identification, or the person might have great expertise but the specimen is outside of their range of skills, tools, or knowledge. Some specimens are challenging because they do not exhibit the typical characteristics of their species, often because they are a mixture of materials that produce conflicting results (e.g. sometimes barite will effervesce because it naturally contains calcite or because a previous investigator tested the specimen with a piece of calcite from a Mohs hardness set.) Confusionite is most often encountered in the field or in laboratories and offices where x-ray, chemical, or microscopic analysis equipment is not readily available. Most students encounter confusionite during geology lab exams. Children are experts at discovering specimens of  confusionite because they pick up the unusual specimen instead of the typical.    ', '/a/aquifers.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Conglomerate', 'A clastic sedimentary rock that contains rounded pebble-size particles (greater than two millimeters in diameter). The space between the pebbles is generally filled with smaller particles and/or a chemical cement that binds the rock together.    ', '/c2/difficult-rocks-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Contact Metamorphism', 'Alteration of a rock, mainly by heat and reactive fluids, which occurs adjacent to a dike, sill, magma chamber, or other magma body. Rock in the area of contact metamorphism might not display foliation because directed pressure is usually not involved.  Hornfels is a common rock produced by contact metamorphism.', '/a/conglomerate.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Contour Line', 'A line on a map that traces locations where the value of a variable is constant.  For example, contour lines of elevation trace points of equal elevation across a topographic map.  All points on the ten foot contour line are ten feet above sea level. The sample map at left shows crustal thickness in kilometers for North and South America.', '/a/contact-metamorphism.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Contour Map', 'A map that shows the change in value of a variable over a geographic area through the use of contour lines. The sample map at left shows crustal thickness in kilometers for North and South America.', '/a/contour-map.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Conventional Oil and Gas', 'Crude oil and natural gas that can be produced by drilling a well into a rock unit and the characteristics of that rock unit allow the oil and gas to naturally flow into the well bore. The rock unit has adequate porosity and permeability to allow the oil and gas to move to the well,  and, the oil and gas is not adsorbed to or bound within the grains of the rock.\r\n\r\n\r\nConventional oil and gas are usually produced from highly porous and permeable rocks, such as sandstones, where the anticlines, faults, or stratigraphy form traps that contain the gas.  The oil and gas may have formed a great distance away from the well and migrated into the trap through pore spaces.  Their migration was most likely a result of the oil and gas being lighter than the formation water and they moved upwards through the permeable rock until they encountered an impermeable seal that limited their movement. \r\n\r\nUnconventional oil and gas and conventional oil and gas do not differ in their chemical composition. They differ in the type of rock unit from which they are produced.\r\n\r\nTechniques like hydraulic fracturing, horizontal drilling, steam flooding, injection of water, injection of carbon dioxide, or pressure reduction - techniques that are intended to liberate the oil and gas from the rock or force it to the well - are not needed to produce conventional gas.   Unconventional oil and gas are produced from shale, tight sands, and coal beds, where liberating the oil and gas from the rock and moving it to the well are the challenges. Compare to unconventional oil and gas.', '/a/contour-map.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Convergent Boundary', 'A boundary between two lithospheric plates that are moving towards one another. One plate normally overrides a second plate that is pushed down into the mantle. Structural features in these areas are generally consistent with compression.', '/a/conventional-natural-gas.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Coral', 'Coral is a colonial organism that lives in warm, shallow marine waters and often develops reefs. It is a hard calcium carbonate material that can be cut or carved and polished into beautiful organic gems.', '/a/convergent-boundary.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Core', 'A major subdivision of Earths structure. It is the innermost part of the Earth and consists of a liquid outer core of molten iron, nickel, and other elements. The inner core is a solid composed mainly of iron, nickel, and other elements. The core is about 4200 miles in diameter.', '/gemstones/gems/coral.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Core', 'A cylindrical piece of rock obtained from a subsurface rock unit by drilling with a hollow drill bit, then brought up to the surface for examination. Samples of sediments, ice, and other subsurface materials can also be obtained with this method. This word is also used as a verb and an adjective.\n\r\n  The photo shows several pieces of core, about four inches in diameter, that have been sawn in half for flat-surface examination and stored in cardboard core-storage boxes. Cores like these will be arranged in boxes to represent their vertical sequence in the well, measured,  carefully described, and photographed. The upper left corner of the photo shows some coal that broke into small pieces during drilling and handling. This often occurs with fragile rocks. The top left and bottom right corners of the photo show small signs that  represent the number of feet below the surface where this sample was recovered. The core in these boxes represents the depth interval from 3280 feet below surface to 3296 feet below surface. The yellow tag at top left identifies the project for which the core was drilled, and the colorful piece of cardboard at left is a color reference. Newsprint has been crumpled and stuffed into the box to hold the core in place and prevent additional breakage.', '/a/earth-structure.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Core Box  ', 'A heavyweight corrugated plastic or cardboard box for storing core from a drilled well. The photo here shows a pallet of core boxes, each weighing about fifty pounds. The definition of the word core above shows an open core box with measured core in place. Storage of core requires a large amount of space and equipment to move and shelve pallets of boxes. Throwing core away is a huge loss of information that was very expensive to collect.', '/a/core.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Core Catching Tray  ', 'A plastic or metal tray that is used to catch and support core as it is extruded from the core barrel. The core can be a solid cylinder of rock, a solid cylinder of mud, fragments of broken rock, or a muddy mess. The core catching tray keeps fragments of material  in their proper order as they are extruded.', '/a/core-box.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Coring Bit  ', 'A hollow cylindrical drill bit used for cutting a cylinder of rock, called a core, from a well. The bottom of the bit is made of  metal with embedded diamond abrasives for grinding through rock. As the bit cuts down through the rock, the core is contained within the last section of drill pipe. About every thirty feet, all of the drill pipe and the drill bit are pulled from the well so the core can be lifted to the surface and removed.  Coring is very slow and very expensive work.', '/a/core-catching-tray.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Country Rock', '1) The barren rock that surrounds a mineral deposit. It is a term that is less specific and more geographically extensive than host rock. 2) The rock surrounding an igneous intrusion.', '/a/coring-bit.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Craton', 'The name given to the stable (usually interior) portions of continental lithospheric plates that have not  been deformed or metamorphosed for at least one billion years. Cratons are usually underlain by crystalline basement rock that is sometimes overlain by younger sedimentary rocks. ', '/c2/gold-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Creep', 'An imperceptibly slow, steady, downward movement of soil and rock material on a slope. The shear stress that drives the movement is strong enough to  deform but too weak to cause failure. Creep is often most active during times of the year when moisture and temperatures facilitate movement. Curved tree trunks, tilted posts, leaning walls, cracked masonry, cracked pavement, and surface ripples can be signs of creep.', '/a/craton.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cross-Bedding', 'A sedimentary structure in which a horizontal rock unit is composed of inclined layers. Sand deposited on the downwind side of a sand dune or sand deposited on the downcurrent side of a rivermouth bar will likely produce a horizontal rock unit composed of inclined layers. The tilt of the beds has nothing to do with post-depositional deformation.', '/a/creep.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Crown', 'The undisturbed area upslope from the scarp of a landslide. This area is usually at risk because the slide below has removed support.', '/a/cross-bedding.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Crude Oil', 'A liquid hydrocarbon produced from natural underground reservoirs.  It might also include liquid hydrocarbons produced from tar sands, gilsonite, and oil shale.  Crude oil can be refined into a number of petroleum products which include  heating oil,  gasoline, diesel fuel, jet fuel, lubricants, asphalt, ethane, propane, butane, and many other products. ', '/a/landslide-anatomy.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Crust', 'A major subdivision of Earths structure. It is the outermost portion of the Earth. The oceans are underlain by a crust of mainly basaltic composition that ranges in thickness from about 3 to 6 miles. The continents are underlain by a crust of mainly granitic composition that ranges in thickness from about 20 to 30 miles.', '/a/pumpjack.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Crystal Habit', 'An external shape displayed by an individual crystal or an aggregate of crystals. A few examples of crystal habits are shown in the photo. Clockwise from top left:  prismatic habit geodic habit banded habit pisolitic habit.', '/a/earth-structure.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Crystal Opal', 'Crystal opal is a term used for transparent-to-translucent opal material that has a play-of-color within the stone. There are many types of opal.', 'https://geology.com/a/crystal-habit.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Crystalline', 'A material  with an ordered internal structure of atoms that are in a regular and repeating arrangement through space.  The image shows the ordered arrangement of sulfide and plumbous ions in the mineral galena.', '/gemstones/gems/crystal-opal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cubic Feet Per Second', 'A unit of measure frequently used to quantify the rate of flow of water in a stream. It is equal to a volume of water that would pass through a cross-section that is one foot high and one foot wide flowing at an average velocity of one foot per second. ', '/a/crystalline.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Cultured Pearls', 'Cultured pearls are produced by placing small seeds of shell material within a live mussel. The mussel then coats the seed with successive layers of nacre to form a pearl. They are produced in a variety of shapes, determined in part by the shape of the seed. ', '/a/stream-discharge.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Datum', ' A reference location or elevation which is used as a starting point for subsequent measurements.  Sea level is a datum for elevation measurements.  Datums can also be arbitrary such as the starting point for stream stage measurements or based upon a physical feature such as the base of a rock unit. Shown in the photo is a bench mark. A location of accurately measured elevation, latitude and longitude that is labeled with a carefully placed marker.', '/a/benchmark.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Daughter Isotope', 'When a radioactive isotope spontaneously decays into a new substance along with a release of heat, that new substance is known as the daughter isotope.', '/a/radioactive-decay.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Debris Avalanche', 'The very sudden downslope movement of rock and soil on a steep slope. A debris avalanche differs from a debris flow mainly on the basis of its speed.', '/a/debris-avalanche.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Debris Flow', 'A type of mass movement in which a combination of rocks, soil, organic matter, air and water flow downslope as a slurry. Debris flows differ from mud flows because they are mainly rock material instead of mud. They can be triggered by heavy precipitation, rapid snow melt or vibrations. Fires that remove vegetation often make a slope vulnerable to debris flows. Many debris flows are rapid, moving at over 60 miles per hour. Others are very slow, moving less than a few feet per year, mainly during times of rain or snow melt.', '/a/debris-flow.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Decollment', 'A horizontal to subhorizontal fault or shear zone.  The rocks above the fault have been moved laterally relative to the rocks below the fault.   This often produces a situation where the rocks above the fault have entirely different structures than the rocks below the fault. Decollments usually develop at convergent plate boundaries where compressional forces detach and move large slabs of surface rock. In the Appalachians, basal detachment faults (decollments) have produced situations where the rocks above the fault have been moved miles to the west with a style of folding and faulting that is consistent with compression. The lowest fault in the image is a decollment that underlies the New Jersey Highlands.', '/a/decollment.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Deflation', 'The removal of clay- and silt-size particles from a soil by wind erosion.  The term can also be used in reference to the removal by wind of any unconsolidated material. The surface that remains after all unprotected fine material is removed is known as a desert pavement.', '/a/desert-pavement.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Deformation', 'A change in the original shape of a rock unit in response to stress and\r\nstrain.  It can be brittle deformation that results in faulting or plastic\r\ndeformation that results in folding.  Image by Sir Charles Lyell.', '/a/deformation.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Delay Rental', 'A payment to a mineral rights owner by a lessee if commercial production does not begin according to the terms of the mineral rights contract.  Failure to pay the delay rental will result in termination of the lease.', '/c/180-oil-gas-investments.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Delta', 'A deposit of sediment that forms where a stream enters a standing body of water such as a lake or ocean.  The name is derived from the Greek letter delta because these deposits typically have a triangular shape in map view. At a delta, streams often branch into distributaries that distribute their water and sediment load in multiple directions. Shown in the photo is the Nile Delta, where the Nile River enters Mediterranean Sea. The green vegetation of the well-watered delta contrasts sharply with the light brown sands of adjacent lands.', '/a/delta.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('None', 'Demantoid is a calcium-rich garnet. It has the highest dispersion (ability to separate white light into colors of the spectrum) of any gemstone - higher than diamond. This gives demantoid an exceptional fire.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Dendritic Drainage', 'A stream drainage pattern that resembles the branching of a tree in map view.  Occurs mainly where the rocks below are horizontal and have a uniform resistance to erosion. It can also develop above crystalline igneous rocks that are uniform in their resistance to erosion.', '/gemstones/gems/demantoid.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Density Current', 'A gravity-driven flow of a dense fluid down a slope through a fluid of lower density. They occur on land (pyroclastic flows) or underwater (turbidity currents).  Density currents often occur underwater where the fluids have differences in temperature, salinity, or concentration of suspended particles. The image shows a pyroclastic flow descending down the south flank of Merapi Volcano (Indonesia) in 2006.', '../a/dendritic-drainage.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Deposition', 'The settling from suspension of transported sediments.  Also, the precipitation of chemical sediments from mineral-rich waters. Shown in the photo is the Badwater Alluvial Fan of Death Valley, where sediments are deposited as a stream, flowing down a steep slope, encounters the flat surface of the valley and loses energy, dropping its sediment load.', '/a/pyroclastic-flow.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Desert Pavement', 'A ground cover of granule-size and larger particles that is typically found in arid areas.  This ground cover of coarse particles is a residual deposit - formed when the wind selectively removes the sand-, silt- and clay-sized materials. The  persistent action of wind will eventually remove all of the small particles leaving a rocky surface known as a desert pavement.', '/a/alluvial-fan.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Desert Varnish', 'A thin coating of dark material, often iron or manganese oxides, that forms on the surface of rocks and pebbles exposed at Earths surface in a desert region. If these rocks are picked up and turned over, the bottoms of the rocks often do not have this coating (as shown by one rock in the photo that has been turned over). The rate of development varies from one location to another depending upon conditions.', '/a/desert-pavement.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Desiccation Cracks', ' A network of polygonal shrinkage cracks that open in mud as the water within is slowly evaporated. They can harden, and if buried, can be lithified as a preserved sediment surface that is evidence of submersion followed by subaerial exposure. They can indicate a sedimentary environment of a lake shore, river bank or low-energy beach. Also known as mud cracks.', '/a/desert-varnish.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Detrital', 'A word used in reference to sediments or sedimentary rocks that are composed of particles that were transported and deposited by wind, water or ice.', '/a/mud-cracks.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Development', 'The work done on a mineral property before mineral production begins on a commercial scale.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Development Well', 'A well drilled within the proven area of an oil or gas reservoir to the depth of the productive stratigraphic horizon.  These wells are expected to be productive. Shown in the image are horizontal legs of development wells in the Utica Shale of eastern Ohio.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Developmental Drilling', 'Drilling done to delineate the boundaries of a known mineral deposit or to evaluate the deposit in advance of production.', '/c2/utica-wells-180.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Diagenesis', 'All of the changes which happen to a sediment after deposition, excluding weathering and metamorphism.  Diagenesis includes compaction, cementation, leaching and replacement.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Diamond', 'The most popular gemstone and hardest natural material. A nearly colorless diamond is set in most engagement rings sold in the United States. The custom of giving an engagement diamond is spreading to other countries.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Diatom', 'A one-celled plant that lives in the shallow waters of lakes, streams or oceans.  Many of these secrete a  shell or internal parts composed of silica.  Diatoms can occur in very large numbers and can make significant contributions to sea-floor or lake sediment.', '/gemstones/gems/diamond.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Diatomaceous Earth', 'A white to light colored powder that is produced by crushing the sedimentary rock known as diatomite. Diatomaceous earth has commercial use as a filter medium a cement additive a fill and extender in paint, rubber and plastics an absorbent, a mild abrasive, a drying agent and numerous other uses. Image copyright iStockphoto / MonaMakela.', '/a/diatoms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Diatomite', 'A light-colored, fine-grained siliceous sedimentary rock that forms from a sediment rich in the siliceous remains of diatoms. It is very porous, sometimes porous enough that it can temporarily float on water. Diatomite is usually marine but can be lacustrine. When crushed into a powder it is known as diatomaceous earth or DE which has many industrial uses.', '/a/diatomaceous-earth.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Diatom Ooze', 'A siliceous seafloor sediment that consists of at least 30% diatom remains.', '../a/diatomite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Differentiated Planet', 'A planet that has layers composed of materials with different densities and different properties. As an example, Earth is a differentiated planet because it has a metal-rich core, surrounded by a rocky mantle, and covered by a crust of low-density minerals.', '../a/diatom-ooze.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Dike', 'A subsurface igneous rock body that is tabular in shape and cuts across the bedding or foliation of the older rock through which it has intruded.', '../a/differentiated-planet.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Dinosaur Bone', 'Dinosaur bone is often petrified (fossilized by being infilled and replaced by quartz). The quartz can be very colorful. When the petrification is thorough, the material can be cut and polished into attractive gems.', '/a/dike.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Diopside', 'Diopside is a magnesium, calcium silicate mineral. It often contains traces of chromium that cause a vivid green color. These stones are known as chrome diopside and can serve as an alternative gem for emerald.', '/gemstones/gems/dinosaur-bones.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Diorite', 'A coarse-grained, intrusive igneous rock that contains a mixture of feldspar, pyroxene, hornblende and sometimes quartz.', '/c2/diopside-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Dip', 'The angle that a rock unit, fault or other rock structure makes with a horizontal plane.  Expressed as the angular difference between the horizontal plane and the structure.  The angle is measured in a plane perpendicular to the strike of the rock structure. The rock units in the image dip to the right at 30 degrees.', '/a/diorite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Directional Drilling', 'Drilling wells that are deliberately deviated from the vertical to hit a target that is not directly beneath the well site or to penetrate a greater thickness of rock within a productive zone.', '/a/dip.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Discharge', 'The volume of water in a flowing stream that passes a given location in a unit of time. Frequently expressed in cubic feet per second or cubic meters per second. Calculated by the formula Q = A x V - where Q is the discharge, A is the cross sectional area of the channel and V is the average velocity of the stream. The hydrograph at left shows a peak discharge of a little over 200 cubic feet per second.', '/c2/directional-drilling-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Discharge Area', 'A geographic location where groundwater naturally emerges onto Earths surface or into a body of surface water such as a swamp, river,  lake, sea or ocean.', '/a/hydrograph.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Discontinuity', 'The word discontinuity has multiple meanings in geology. In sedimentary geology, a discontinuity is a break in sedimentation that produces a time gap in the sediment record. In seismic science, a discontinuity is a surface (such as the boundary between rock units) where seismic waves abruptly change velocity. In structural geology, a discontinuity is a surface separating unrelated rock units such as a fault. The photo is an image of The Great Unconformity of the Grand Canyon. It is an erosional surface and a gap in geologic time. It separates horizontal rocks of the younger Tonto Group from the steeply dipping rocks of the much older Grand Canyon Supergroup.', '/a/spring.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Displacement', 'The word used for the relative movement of the two blocks of a fault. It is usually given in units of linear measure such as feet or meters. When observed in outcrop or on Earths surface, the amount of displacement measured is apparent because motion in directions other than parallel to the face of the outcrop or Earths surface cannot be assessed. The apparent displacement on the fault shown in the photo is about ten feet. It is a small fault exposed in an outcrop in San Mateo County, California.', '/a/angular-unconformity.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Dissolved Load', 'Dissolved ions being carried by a stream. There are three basic components to a streams load: 1) bedload that rests on the bottom of the stream, only to be moved during times of high flow 2) suspended load held above the bottom when current velocities are high enough to lift and hold the material in suspension and, 3) dissolved ions carried in solution, represented by the red + and - signs in the image at left.   ', '/a/displacement.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Distribution Pipeline', 'A pipeline that carries natural gas between a main transmission line and a consumer.', '/a/suspended-load.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Divergent Boundary', 'A boundary between two lithospheric plates that are pulling away from one another. These are structural environments of regional extension with normal faulting. The mid ocean ridges are located above convection currents that work to create extensional stress that can produce a divergent boundary.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Divide', 'A ridge or other topographic feature that separates two adjacent drainage basins. It is an imaginary line that separates two different directions of surface water flow.', '/a/divergent-boundary.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Dome', ' An uplift that is round or elliptical in map view with beds dipping away in all directions from a central point.', '../a/divide.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Domestic Operations', 'Domestic operations are activities located in the United States, including the offshore territorial waters, U.S. commonwealth territories, and protectorates.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Dowsing', 'The practice of locating groundwater by walking the surface of a property holding a forked stick, a pair of L-shaped rods, a pendulum or another tool that responds when the person moves above a location that will yield an adequate flow of water to a drilled well. Although many people believe in this practice, including a few geologists, it is almost unanimously rejected by geologists and hydrologists. The  National Ground Water Association has issued a position statement that rejects the practice. Also known as water witching, divining and doodlebugging. \xa0Image copyright iStockphoto / Monika Wisniewska.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Drainage Basin', 'The geographic area that contributes runoff to a stream. It can be outlined on a topographic map by tracing the points of highest elevation (usually ridge crests) between two adjacent stream valleys. Also referred to as a watershed.', '/a/dowsing.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Drainage Divide', 'The boundary between two adjacent drainage basins. Drainage divides are ridge crests (or less obvious locations where slope of the landscape changes direction). Runoff produced on one side of the ridge flows into stream A and runoff on the other side of the ridge flows into stream B. The image shows the continental drainage divides of the United States. ', '/a/drainage-basin.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Drawdown', 'A lowering of the water table around a producing well. The drawdown at any given location will be the vertical change between the original water table  and the level of the water table reduced by pumping.', '/a/drainage-divide.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Drift', 'A general term for all sedimentary materials deposited directly from the ice or melt water of a glacier.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Drilling Arrangement', 'A contractual agreement under which a mineral rights owner or lessee assigns a fractional interest in a property to another party. This assignment might be done for financial support of exploration and development.  It could also be done in exchange for the recipient doing the development work on that property.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Drill Bit', 'A cutting tool attached to the drill pipe and used to bore a well into bedrock. The drill pipe turns the drill bit and tiny particles of diamond embedded in the edges of the drill bit grind their way through the rock. The drill bit is cooled by drilling mud that is pumped down the drill pipe and circulates back up to the surface between the wall of the well and the drill pipe. The circulation of the drilling mud also removes cuttings that would otherwise clog the well bore.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Drill Pipe', 'Seamless steel tubing used in the drilling of oil and gas wells. The drill pipe rotates the bit. Drilling fluid is pumped down the pipe, exits through the bit and flows up the space between the pipe and the wall of the well, delivering cuttings to the surface. Sections of drilling pipe are generally 30 feet in length and couple together will tool joints.', '/a/drill-bit.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Drumlin', 'A low, smoothly rounded, elongate hill. Drumlins are deposits of compacted till that are sculpted beneath the ice of a flowing glacier. The long axis of a drumlin parallels the flow direction of the ice.', '/a/drill-pipe.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Dry Hole', 'A well drilled in hopes of finding oil or natural gas that fails to yield commercial production rates. The image is the map symbol for a dry hole.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Dry-Hole Contribution', 'A payment made to the owner of an unsuccessful well in exchange for a log of the well and evaluation data. The image is the map symbol for a dry hole.', '/a/dry-hole.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Dune', 'A mound or ridge of wind-blown sand. Typically found in deserts or inland from a beach. Most dunes slowly move in a down-wind direction as sand is blown up the windward side of the dune, moves over the crest and tumbles down the leeward side.', '/a/dry-hole.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Dumortierite', 'Dumortierite is a dark blue to dark greenish-blue silicate mineral with a chemical composition of Al7BO3(SiO4)3O3 found in metamorphic rocks. It is typically opaque and when attractive can be used to produce cabochons, beads and tumbled stones.', '/a/dune.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Earthflow', ' A type of landslide or mass wasting. A downslope movement of  soil and rock debris that is confined to a well-defined chute and spreads out over the run-out area in the form of a lobe. The material is mostly fine-grained and moves as a flow instead of as a rotating mass. Most earthflows are have a very high moisture content but dry flows are also possible. ', '/a/earthflow.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Earthquake', 'A trembling of the earth caused by a sudden release of energy stored in subsurface rock units. This release of energy usually occurs when the subsurface rock units break to form a fault or when movement on an existing fault occurs.', '/a/earthquake.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Earth Science', 'Earth Science is the study of the Earth and its neighbors in space. It includes the study of solar system astronomy, geology, oceanography and meteorology. Some people assume that geology and earth science are identical, but that is not true. Geology is a much more limited science and just one part of earth science.', '/c/180-what-is-earth-science.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ebb Current', 'A tidal current that moves towards the ocean after high tide has peaked,\r\ndraining the inter-tidal zone.  These currents  can be very strong at the openings of\r\nbays and between barrier islands, where large amounts of water must flow\r\nthrough a narrow opening in a limited amount of time.  The arrows in the\r\nimage show the directions that water would flow as ebb currents cause a\r\nriver to accelerate and the lowering of sea level drains lagoons behind barrier islands.', '/a/ebb-current.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Effluent Stream', 'A stream that gains water from groundwater flow. These streams are typical of humid climates where water tables are high. The discharge of an effluent stream can be sustained by groundwater flow for long periods of time between runoff-producing rainfall or snowmelt. Effluent streams generally increase in discharge downstream and contain water throughout the year. The opposite is an influent stream.', '/a/effluent-stream.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Effusive Eruption', 'An eruption that is dominated by an outpouring of lava rather than an explosive ejection of material through the air. Most effusive  eruptions produce  basaltic lavas. The photo shows lava flows streaming from the eruption of Mauna Loa Volcano in Hawaii in 1984.', '/a/effusive-eruption.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Elastic Limit', 'The maximum stress that can be applied to a body without resulting in permanent deformation - the rock reverts to its original shape after the stress is removed.  In the case of a fault or a fold,  the elastic limit is exceeded and the deformation becomes a permanent structure of the rock.', '/a/elastic-rebound-theory.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Elastic Rebound Theory', 'A theory that explains the earthquake process.  In this theory, slowly accumulating elastic strain builds within a rock mass over an extended period of time.  When the rock fails this strain is suddenly released through fault movement,  producing an earthquake. In the bottom image the undeformed fenceline at the bottom is before strain accumulation begins. The middle image shows the buildup of strain in the Earth under the fence line. This is plastic deformation. When the Earth (and fence) rupture, the elastic limit was exceeded.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Electron', 'A subatomic particle with a negative charge and  negligible mass that orbits the nucleus of an atom.', '/a/elastic-rebound-theory.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Elevation', 'The vertical distance between mean sea level and a point or object on, above or below Earths surface. In the image of a topographic map, the  brown lines that represent elevations above sea level.', '../a/electrons.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Emerald', 'Emerald is the gemstone name of the mineral beryl when it has a rich green color. It is the most popular gem of  the beryl mineral group. Most emeralds have abundant inclusions and fractures. If the color is green, but not a rich green, the gem is called green beryl. The term emerald is reserved for stones of  excellent green color.', '../a/elevation.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Eolian', 'A term used in reference to the wind.  Eolian materials and structures are created, moved and deposited by the wind. Sand is an eolian material and a sand dune is an eolian structure.', '/gemstones/gems/emerald.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Eon', 'The major divisions of the geologic time scale.  Eons are divided into intervals known as eras. Two eons of the geologic time scale are the Phanerozoic  (570 million years ago to present) and the Cryptozoic (4,600 million years ago until 570 million years ago). The Phanerozoic is divided into three eras, Cenozoic, Mesozoic and Paleozoic.', '../a/dune.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ephemeral Stream', 'A stream that flows for a short interval of time after precipitation or snow melt in the immediate area.  Ephemeral streams carry runoff water.  Their channels are above the water table and they normally receive no contribution from groundwater.', '/a/eon.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Epicenter', 'The point on the Earths surface directly above the focus of an earthquake. It is often - but not always - the location where the strength of the earthquakes shaking is most intensely felt.', '../a/ephemeral-stream.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Epoch', 'A subdivision of geologic time that is longer than an age but shorter than a period.  The Quaternary Period is divided into two  epochs, the Pleistocene and the Holocene. ', '/a/epicenter.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Era', 'A subdivision of geologic time that is longer than a period but shorter than an eon.  Precambrian, Paleozoic, Mesozoic, and Cenozoic are the eras of the time scale from oldest to youngest.', '../a/epoch.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Erosion', 'A general term applied to the wearing away and movement of earth materials by gravity, wind, water and ice. The image shows a dramatic example of coastal erosion along Alaskas Arctic Ocean shoreline.', '../a/era.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Eruption Cloud', 'A cloud of tephra and volcanic gas that have been erupted by a volcano. The eruption cloud in the photo was produced by Alaskas Redoubt Volcano in April of 1980.', '/a/erosion.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Eruption Column', 'A towering, rapidly rising cloud of tephra and volcanic gas escaping the vent of a volcano immediately after an explosive eruption. Differs from an eruption cloud because the material is being propelled upwards by the force of the blast and not being held aloft by rising heat. The image shows the eruption cloud from the Crater Peak vent of Mount Spurr Volcano in Alaska on August 18, 1992.', '/a/eruption-cloud.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Esker', 'A long winding ridge of sorted sands and gravel.  Thought to be formed from sediment deposited by a stream flowing within or beneath a glacier.', '/a/eruption-column.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Eudialyte', 'Eudialyte is a rare mineral found in igneous rocks. It serves as a minor ore of zirconium and as a minor gem mineral. It occurs in yellow, brown and bluish crystals - but bright red specimens are favored as a collectors gem.', '../a/esker.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Eustatic Sea Level Change', 'A rise or fall in sea level that affects the entire Earth.  Thought to be caused by an increase/decrease in the amount of available water or a change in the capacity of ocean basins. At the present time, glacial and polar melting is causing a slow but steady sea level rise which is having an impact on coastal communities.', '/gemstones/gems/eudialyte.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Evaporation', 'The process of liquid water becoming water vapor. Includes vaporization from water surfaces, land surfaces and snow/ice surfaces.', '/15/florida-sea-level-rise.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Evaporite', 'A chemical sediment or sedimentary rock that has formed by precipitation from evaporating waters.   Gypsum, salt, nitrates and borates are examples of evaporite minerals.', '/a/evaporation.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Evapotranspiration', 'All methods of water moving from a liquid to water vapor in nature. Includes both evaporation and transpiration.', '../a/evaporite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Exfoliation', 'A physical weathering process in which concentric layers of rock are removed from an outcrop.', '/a/evapotranspiration.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Expansive Clay (Expansive Soil)', 'A clay or a clay soil that expands when water is added and contracts when it dries out. This volume change can cause severe damage when it occurs under or adjacent to buildings, roadways, or underground utilities.', '../a/exfoliation.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Exploration', 'The work of identifying areas that may contain viable mineral, groundwater or fossil fuel resources. This work can include surface mapping, remote sensing, exploratory drilling, geophysical testing, geochemical testing and other activities. The photo shows drilling into the Potomac Formation to locate sand layers suitable for groundwater flow.', '/a/expansive-soil.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Exploratory Drilling', 'Drilling done to locate mineral deposits in an area where little subsurface data about those minerals is available.  Exploratory wells may not have the ability to produce the minerals if they are discovered. The photo shows drilling into the Potomac Formation to locate sand layers suitable for groundwater flow.', '/a/exploratory-drilling.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Extractive Industries', 'Industries involved in mineral resource exploration, acquisition, assessment, development or production. The photo shows the Coeur Rochester Mine near Lovelock, Nevada. It is one of the largest operating silver mines in the United States.', '/a/exploratory-drilling.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Extrusive', 'Igneous rocks that are erupted from a volcano and crystallize at Earths surface. Basalt is the most common.', '/a/extractive-industries.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Facies', 'a) The characteristics of a rock or sediment unit that reflect its environment of deposition and allow it to be distinguished from rock or sediment deposited in an adjacent environment.', '/a/facies.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fancy Sapphire', 'Fancy sapphire is a name used for a gem corundum that has a body color other than blue (sapphire) or red (ruby).', '/gemstones/gems/fancy-sapphire.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Farm-Out Arrangement', 'A contractual agreement in which a mineral rights owner or lessee assigns a working interest to another party who will become responsible for specific exploration, development or production activities.', '/a/farm-out.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fault', 'A fracture or fracture zone in rock along which movement has occurred. When movement occurs the vibrations that are produced are known as an earthquake.', '/a/fault.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fault-Block Mountain', 'A linear mountain that is bounded on both sides by normal faults. The photo is a view of Mount Moran near Jackson Lake Junction, Wyoming, part of the Teton Range.', '/a/fault-block-mountain.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fault Creep', 'A very slow movement that occurs on faults in response to continuous tectonic deformation.  The deformation might not be accompanied by earthquake activity.  Faults that creep usually have fewer earthquakes than faults that move suddenly.  The photo shows a curb and sidewalk which were becoming offset due to creep along the Hayward Fault in California.  The curb was repaired in 2016.', '/a/fault-creep.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fault Gouge', 'Crushed and smeared rock debris that is found between the two walls of a fault produced by crushing action of fault movement.  The photo shows serpentinite gouge in the Bartlett Springs Fault.', '/a/fault-gouge.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fault Trace', 'The intersection of a fault with Earths surface, often as seen in the field, on an aerial photo or on a satellite image.  A line on a geologic map that represents the intersection of a fault with the Earths surface. The image is an oblique aerial photo of the Banning Fault in the northern portion of the Coachella Valley of California.', '/a/fault-trace.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fault Zone', 'An area of rock that has numerous fractures of similar trend and dip. Rocks usually do not fail with a clean break, instead they fail through the formation of numerous fractures along a zone of failure. As a result, many named faults are actually zones of fractured rock. \r\n      \r\n      The term also has a regulatory use. These fault zones are geographic areas where buildings and land use are subject to regulation because they are thought to be exposed to the hazard of  a nearby fault. These fault zones are usually drawn on maps and published by a government agency for  public viewing.', '/a/fault-zone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Faunal Succession', 'A principle of relative dating that is based upon the observed sequence of organisms in the rock record. The relative age of two rock units can frequently be determined by matching the fossils found in those rocks to their positions in the rock record.', '/a/faunal-succession.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Felsic', 'A term used to describe an igneous rock that has a large percentage of light-colored minerals such as quartz, feldspar, and muscovite.  Also used in reference to the magmas from which these rocks crystallize.  Felsic rocks are generally rich in silicon and aluminum and contain only small amounts of magnesium and iron.  Granite and rhyolite (shown here) are examples of felsic rocks.  (See mafic to contrast.)', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fire', 'Colored flashes of light emitted from a gemstone that result from incident light being separated into its component colors as it passes through the stone.  Each gem material has a characteristic dispersion.  Some have exceptional dispersion and produce a very intense fire.  Although many people believe that diamond has the strongest dispersion of all gems, a few gems such as sphalerite, demantoid garnet (shown in the photo), sphene, and zircon have an even greater dispersion.', '/a/rhyolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fire Opal', 'A translucent-to-transparent opal with a warm background color of yellow, orange or red. It may or may not exhibit a play-of-color. The warm, uniform background color is what defines the stone.', '/gemstones/gems/demantoid.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fissure', 'An open fracture or crack in Earths surface that can result from a wide variety of causes that include: earthquake, volcanic activity, desiccation, subsidence, mass wasting, groundwater withdrawal, oil production, faulting, and other movements. Fissures associated with volcanic activity can produce large outpourings of magma. Others can be the initial step of forming an igneous dike. Some fissures are filled with valuable minerals.', '/gemstones/gems/fire-opal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fissure Eruption', 'A volcanic eruption that produces lava and other products from a fracture in Earths surface.  Fissure eruptions commonly occur where basaltic magmas inflate a subsurface reservoir, producing extension fractures in Earths surface.  Image copyright iStockphoto / GISBA.', '/a/fissure.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fjord', 'A deep, narrow, steep-walled, U-shaped valley that was eroded to a depth below sea level by glaciers and then flooded with sea water after the glacier melted.  Shown here is the Hudson River Valley fjord in New York, as seen from Anthonys Nose Overlook.', '/a/fissure-eruption.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Flood', 'An overflow of water onto lands that are normally above local water levels. Can be caused by stream discharge exceeding the capacity of the stream channel, storm winds and reduced pressure drawing water from a lake or ocean onto the coastline, dam failure, lake level increase, local drainage problems or other reasons.', '/a/fjord.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Flood Basalt', 'A sequence of parallel to subparallel basalt flows that were formed during a geologically brief interval of time and which covered an extensive geographic area.  Thought to have formed from simultaneous or successive fissure eruptions. In the photo are layered flood basalts from the Columbia River.  Public domain image by William Borg.', '/c2/flood-insurance.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Flood Current', 'A tidal current that moves towards land as high tide approaches, covering the inter-tidal zone.  Flood currents can temporarily reverse the flow of rivers that enter the ocean.  They can be very strong at the openings of bays and between barrier islands, where large amounts of water must flow through a narrow opening in a limited amount of time.  The arrows in the image show the directions that water would flow as flood currents enter a river and fill lagoons behind barrier islands.', '/a/flood-basalt.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Flood Plain', 'An area of alluvium-covered, relatively level land along the banks of a stream that is covered with water when the stream leaves its channel during a time of high flow. The astronaut photo shown here, which was taken above the border between Laos and Thailand in August 2015, shows the Mekong River flood plain covered with muddy water.', '/a/flood-current.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Flood Stage', 'A water height that is reached when the discharge of a stream exceeds the capacity of the channel.', '/a/flood-plain.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Flood Tide', 'A tidal current that generally moves landward and occurs during the part of the tide cycle when sea level is rising.  (See neap tide for contrast.)', '/a/flood-stage.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Flowing Well', 'A well that taps an aquifer that is under enough pressure to force water to the surface. Caused when the aquifer has a recharge area at a higher elevation.', '/a/flood-current.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fluid Inclusion', 'A small amount of fluid (liquid and/or gas) trapped within a rock and which is thought to represent the fluid from which the rock crystallized.  The photo shows a fluid-filled inclusion in quartz that also contains a vapor bubble.  The letter L indicates the liquid, and the V indicates the vapor bubble.', '/a/flowing-well.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fluorescence', 'The ability of a material to temporarily absorb a small amount of light and an instant later release a small amount of light of a different wavelength. This change in wavelength causes a temporary color change of the mineral in the eye of a human observer.  The color change of fluorescent materials is most obvious when the materials are illuminated in darkness by ultraviolet light (which is not visible to humans) and the materials release visible light. A more detailed explanation of fluorescence can be found in our article on fluorescent minerals. The photo shows specimens of opal from Virgin Valley, Nevada in normal light and under shortwave ultraviolet light.', '/a/fluid-inclusion.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fluorescent Minerals', 'Fluorescent minerals are minerals that have the ability to be stimulated by ultraviolet light and release a fluorescent glow. About 15% of minerals will fluoresce in wavelengths that are visible by people. Some require illumination by longwave ultraviolet light, some require illumination by shortwave ultraviolet light. Geology.com store has small collections of fluorescent minerals, inexpensive ultraviolet lamps, and UV-blocking safety glasses.', '/a/fluorescent-opal.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fluorite', 'Fluorite is an important industrial mineral composed of calcium and fluorine (CaF2). It is used in a wide variety of chemical, metallurgical and ceramic processes. Specimens with exceptional diaphaneity and color are cut into gems or used to make ornamental objects.', '/c2/fluorescent-minerals-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Focus', 'A point beneath Earths surface where the vibrations of an earthquake are thought to have originated. Also known as a hypocenter.', '/gemstones/gems/fluorite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fold', 'A bend or flexure in a rock unit or series of rock units that has been caused by crustal movements. Folds frequently form near convergent plate boundaries where the rock units are under compression and the folds accommodate crustal shortening. Sketch of folds in outcrop by Sir Charles Lyell.', '/a/focus.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Foliation', 'The planar or layered characteristics of  metamorphic rocks that are evidence of the pressures and/or temperatures to which the rock was exposed.  These can be structural such as cleavage, textural such as mineral grain flattening or elongation, or compositional such as mineral segregation banding. The photo shows a phyllite from Frederick County, Maryland.', '/a/folds.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fools Gold', 'A name often used for pyrite because it is sometimes mistaken for gold by inexperienced people.  Chalcopyrite and tiny flakes of biotite mica are also often mistaken for gold.  Anyone who plans to go panning for gold should learn the easy methods for identifying gold to avoid embarassment and wasting their time.', '/a/foliation.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Foraminifer', 'A group of tiny organisms, protozoans that belong to the subclass Sarcodina, order Foraminifera. They produce  a very thin calcium carbonate test (shell) with one to many chambers. They are usually marine, less than one millimeter in size, and their tests can make up a significant portion of the carbonate sediment in some areas. The image shows foraminifera collected from a sediment-trap moored in the northern Gulf of Mexico by USGS workers.', '/a/fools-gold.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Foraminiferal Ooze', 'A calcareous sea-floor sediment composed primarily of foraminifer tests. The image shows a lab dish containing calcareous ooze dredged from the floor of the Arctic Ocean.', '/a/foraminifer.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Forearc', 'The tectonic region between a subduction zone and its associated volcanic arc.  This is the area underlain by the subducting plate.  Image by USGS.', '/a/foraminiferal-ooze.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Foreign Operations', 'Activities located outside of the United States, its offshore territorial waters, commonwealth territories, and protectorates.', '/a/forearc.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Foreset Beds', 'The distinctly dipping sediment layers deposited on the front of a prograding delta or on the lee side of a sand dune. The photo shows foreset beds in eolian deposits of the Cedar Mesa Sandstone Member of the Cutler Formation in southeast Utah.', '/a/africa.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Foreshocks', 'Small earthquakes that precede the largest earthquake of an earthquake sequence.  Some researchers believe that they may be of value for predicting a major earthquake, but not all large earthquakes are accompanied by foreshocks.', '/a/foreset-beds.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Formation', ' A laterally continuous rock unit with a distinctive set of characteristics that make it possible to recognize and map from one outcrop or well to another.  The basic rock unit of stratigraphy.  The brown cliffs in the photo are an outcrop of the Moenkopi Formation at Capitol Reef National Park.  The Moenkopi is a Triassic-age rock unit that can be traced throughout parts of Arizona, California, Colorado, New Mexico, Nevada, and Utah.', '/a/richter-magnitude.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fossil', 'Remains, imprints or traces of an ancient organism that have been preserved in the rock record.  Bones, shells, casts, tracks and excrement can all become fossils.', '/a/formation.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fossil fuel', 'A carbon-rich rock material or fluid, of organic origin, that can be produced and burned as a fuel.  Coal, oil and natural gas are examples of fossil fuels.', '/c2/green-river-fossils-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fossil Succession', 'A principle of relative dating that is based upon the observed sequence of organisms in the rock record. The relative age of two rock units can frequently be determined by matching the fossils found in those rocks to their positions in the rock record.', '/c/180-oil-gas-investments.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fresh Water or Freshwater ?', 'These words refer to water that is not salt water. To be called fresh water, the amount of dissolved solids in 1 liter of water must be less than 1,000 milligrams.\r\nWhen written as 2 words, the word fresh is an adjective used to describe the noun water. For example, These fish live in fresh water.\r\nWhen written as a single word, freshwater is an adjective used to describe a noun that follows it, as in freshwater fish.', '/a/faunal-succession.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Fumarole', 'A vent that emits hot gases to the atmosphere, usually associated with past or current magmatic activity below. Some are active for a short amount of time before stopping permanently, some are intermittent and some are active for centuries. Common gases include: carbon dioxide, sulfur dioxide, hydrogen chloride, hydrogen sulfide, all of which can be deadly. The photo shows a fumarole on the flank of Kilauea Volcano in Hawaii with yellow crystals of sulfur that have been deposited by sublimation from the escaping gas.', '/a/fresh-water.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gabbro', 'A black, coarse-grained intrusive igneous rock that is the compositional equivalent of basalt.  Composed of calcium-rich feldspars, pyroxene, and possibly olivine, but containing little if any quartz.', '/a180/gabbro.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gage Height', 'A measured height of water above an arbitrary reference datum. Frequently used to describe the height of water in a stream, lake, well, canal, or other water body. Stage and gage height are equivalent words, with stage being more commonly used by the public. Gage height is usually measured at a gaging station.', '/a/gage-height.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gaging Station', 'A facility on a stream, lake, canal, reservoir, or other water body where instruments are installed to automatically monitor the water. Measurements such as stage, discharge, water temperature and pH are automatically taken and transmitted to hydrologists via satellite, radio, or telephone. Measurements from these stations are useful for a wide variety of  flood prediction, water management, recreation, and navigation purposes.', '/a/gaging-station.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gaining Stream', 'Also known as an effluent stream. A stream that gains water from groundwater flow. These streams are typical of humid climates where water tables are high. The discharge of an effluent stream can be sustained by groundwater flow for long periods of time between runoff-producing rainfall or snowmelt. Effluent streams generally increase in discharge downstream and contain water throughout the year. The opposite is an influent stream.', '/a/effluent-stream.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Garnet', 'Garnet is the name of a group of silicate minerals that share a common crystal structure, but they vary in composition. Most garnets are red in color, but the mineral also occurs in orange, yellow, purple, green, pink, black, and other colors. Shown in the photo, clockwise from top left, are the gem garnets: spessartine, almandine, tsavorite, rhodolite, and mali (center).   In addition to being used as a gemstone, garnet is used as an abrasive, filter medium, sand-blasting granule, and waterjet cutting granule.', '/gemstones/gems/garnet.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gas Field', 'The geographic area that is directly above an underground accumulation of natural gas which is commercially viable. The image shows the geographic extent of the Barnett, Haynesville, and Eagle Ford gas fields.', '/a/gas-field.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gathering System', 'A network of small pipelines that connect producing wells to the main transmission system.', '/a/gathering-system.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gemstone', 'There is no universally agreed-upon definition for the word gemstone. The word usually triggers an image of  attractive mineral materials that have been fashioned into  gems to  be worn for  personal adornment. Some people believe that gemstones should also be durable, rare, valuable, and skillfully cut - but some items formally called gemstones lack all of these features. Many gemstones are rocks, organic materials, mineraloids, or even objects from space that lack durability, rarity, intrinsic value, and are used in their natural state. As an example, consider a small pearl  used in an inexpensive necklace sold at Walmart. Hundreds of materials have been used as gemstones see photos of over 100 here.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Geode', 'A geode is a rock structure that has an internal cavity lined with mineral materials. The mineral lining is often a scintillating druze of tiny quartz crystals underlain by multiple bands of translucent gray and white agate. Many are lined with more spectacular treasures, such as rich purple amethyst, perfect white calcite crystals, or colorful banded agate.', '/a/gems.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Geologic Column', 'A diagram that shows the vertical sequence of rock units present beneath a\r\ngiven location, with the oldest at the bottom and youngest at the top.  They\r\nare typically drawn to approximate scale with proportional rock unit\r\nthicknesses.  Colors and standardized symbols are usually added to\r\ngraphically communicate rock types and some of their more important\r\nfeatures.  Geologic columns prepared for regions will have generalized\r\nthicknesses and rock unit features that show relationships which change over\r\ndistance.', '/a/geode.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Geology', 'Geology is the study of the Earth, the materials of which it is made, the structure of those materials, and the processes acting upon them. It includes the study of organisms that have inhabited our planet. An important part of geology is the study of how Earths materials, structures, processes, and organisms have changed over time.', '/a/geologic-column.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Geomorphology', 'The study of Earths surface, including the origin, description, and classification of landforms such as mountains, valleys, drainage systems, coastlines, and ocean basins.  It includes the processes that form them and how they are influenced by the underlying bedrock. \n', '/a/what-is-geology.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Geotechnical', 'Refers to the use of geology as a science when applied to an engineering problem such as landfill design, highway construction, landslide repair, tunnel construction, sewage system design, and much more.\n', '/a/geomorphology.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Geothermal Gradient', 'The progressive increase of temperature with depth into the Earth. Often displayed graphically as a chart similar to the image at left, which shows the geothermal gradient in the Carson Sink area of Nevada from a USGS report.', '/a/landfill.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Geyser', 'A hot spring that intermittently erupts a spray of steam and hot water.  Caused by the heating of groundwater within a confined opening in hot rock.', '/a/geothermal-gradient.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Glacial Rebound', 'A very gradual uplift of Earths crust that occurs after the weight of a thick continental ice sheet (which produced subsidence) has melted away.', '/a/geysers.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Glacial Striations', 'Grooves and scratches on a bedrock surface that were produced by the movement of a glacier.  The orientation of the striations gives evidence to the direction of glacial movement.', '/a/glacial-rebound.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Glacial Valley', 'A valley with a U-shaped cross section that was cut by an alpine glacier.', '/a/glacial-striations.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Glacier', 'A thick mass of ice that forms on land, from an accumulation and recrystallization of snow significant enough to persist through the summer and grow year by year.  There are two basic types of glaciers:   1) valley (or alpine) glaciers that creep downslope under the influence of gravity, and 2) continental glaciers that flow outward from a thick central area under their own weight.', '/a/hanging-valley.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Glass', ' In geology, an amorphous (without crystal structure) igneous rock that forms from very rapid cooling of magma.   The rapid cooling does not provide enough time for crystal growth. Shown in the image is a piece of obsidian.', '/a/glaciers.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gneiss', 'A coarse-grained, foliated rock produced by regional metamorphism.  The mineral grains within  gneiss are elongated due to pressure, and the rock has a compositional banding due to chemical activity.', '/a/obsidian.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gold Dust', 'Fine particles of native gold that have been weathered out of their host rock. They can be flake,  nugget, or wire-shaped particles of gold. They can be mined from a placer deposit or milled from the rock of a lode. Image copyright iStockphoto / Gilles_Paire.', '/a180/gneiss.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gold Nugget', 'A piece of native gold that has been weathered out of its host rock. Nuggets are found in placer deposits downslope from a lode. They might be found in soils, stream sediments, or beach sediments. Nuggets are  often smoothed and rounded, which is evidence of transport. They sometimes   still contain pieces of host rock. They are generally not pure gold, instead being natural alloys with silver or copper that are 80% to 95% gold. Image copyright iStockphoto / Goruppa.', '/a/gold-dust.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gold Pan', 'A broad, shallow pan made of metal or rigid plastic that is used to separate the lighter fraction of a sediment from heavier grains. A shovel of stream sediment or soil is placed in the pan, the rocks are picked out and clinging soil or sediment scraped off, then the pan and sediment are immersed in the stream and moved in a manner that allows lighter grains to be removed by the current or sloshed over the rim of the pan. Considerable practice is required, but an experienced person can separate sand, silt, and mud from particles of gold or heavy mineral that are so small, they can barely be seen. View a gold panning demonstration. View gold panning supplies in the Geology.com Store.', '/a/gold-nuggets.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Graben', 'An elongated, downthrown block bounded by two normal faults that dip\r\nsteeply in opposite directions.  Produced in an area of crustal extension.\r\nThis is the dominant structural style of the Basin and Range province of\r\nthe southwestern United States.  Death Valley, Salt Lake Valley, and Owens\r\nValley are all grabens in that province.', '/c2/fee-mining-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Graded Bedding', 'A rock or sediment layer that has a progressive change in particle size from top to bottom.  Most common is a sequence with coarse grains at the bottom and fining upwards, which is typically caused by a declining current velocity within the depositional environment.', '/a/graben-horst.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Granite', ' A coarse-grained, intrusive igneous rock composed primarily of light-colored minerals such as quartz, orthoclase, sodium plagioclase, and muscovite mica.  Granite is thought to be one of the main components of  continental crust. Granite is also used as a dimension stone for kitchen countertops, building stone, paving stone, tile, memorials, facing stone, curbing, and many other uses.', '/a/graded-bedding.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Granule', ' A term used for a sedimentary particle that is between 2 and 4 millimeters in size.  Granules are larger than sand but smaller than pebbles.  Granules have typically been rounded by abrasion during sedimentary transport.', '/a180/granite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gravel', 'Clastic sedimentary particles of any composition that are rounded and over 2 mm in diameter.  Includes granules, pebbles, cobbles, and boulders.  If lithified, an accumulation of gravel would produce the sedimentary rock known as conglomerate.  The image shows an accumulation of gravel on the surface of Mars discovered by Mars Rover Curiosity in 2012.  The largest particle in the photo is about one centimeter in length.', '/a/granules.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Gravity Anomaly', 'A geographic area where observed gravity values depart from those of the assumed Earth model. They are typically a response to lateral density differences within the Earth, caused by variations in  geologic structure or crustal composition. The image is a Bouguer gravity anomaly map of the state of Ohio.', '/a/gravel.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Greenhouse Effect', 'A warming of the atmosphere, caused by carbon dioxide and water vapor in the lower portions of the atmosphere capturing heat that is radiated from and reflected by Earths surface.', '/a/gravity-anomaly.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Greenstone', 'A low-grade metamorphic rock that frequently contains green minerals such as chlorite, epidote, and talc, often derived from the metamorphism of basalt, gabbro, or diabase.', '/a/greenhouse-effect.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ground Moraine', ' A blanket of till that is deposited during the retreat of a glacier, producing a rocky ground cover made up of material that ranges in size from clay to boulders. Much of this debris was carried beneath the glacier, but some was contained within the ice and released by melting.', '/a/greenstone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Groundwater or Ground Water ?\r\n      ', 'Water that exists below the water table in the zone of saturation.  Groundwater generally moves slowly in the same direction that the water table slopes. \n\r\n        \r\n        Today most geologists and hydrologists use groundwater in their writings.  The term ground water appears more frequently in writings that were published in the 1990s and earlier.  Geology.com uses groundwater in almost every situation because we believe that it is the preferred term today.\r\n        \r\nWe will use ground water when we quote from the work of another organization or when those words appear in the title of a  publication in one of our citations.', '/a/ground-moraine.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Groundwater Recharge Area', 'A location where surface water or precipitation can infiltrate into the ground and replenish the water supply of an aquifer.', '/a/zone-of-saturation.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Guyot', ' A seamount with a flat top. They are usually shield volcanoes that have a flat top produced by wave erosion. Shown in the image is the Bear Seamount of the North Atlantic Ocean, about 200 miles east of Woods Hole, Massachusetts.', '/a/recharge-area.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Habit', 'An external shape displayed by an individual crystal or an aggregate of crystals. A few examples of crystal habits are shown in the photo. Clockwise from top left:  prismatic habit geodic habit banded habit pisolitic habit.', 'https://geology.com/a/crystal-habit.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Haboob', 'A haboob is an intense dust storm caused by a downburst of air that mobilizes loose silt and clay and carries them across the landscape as a wall of dust. Haboobs usually occur in arid areas where the surface is covered with fine-grained materials that are easily mobilized. They can occur without warning and travel at speeds of up to 60 miles per hour. The wall of dust can be up to 60 miles wide and up to 2 miles in height. The image shows a haboob that hit Phoenix, Arizona on August 22, 2003. Public domain image by Wikipedian Junebug172.', '/a/haboob.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Half-Life', 'The amount of time  required for 1/2 of a radioactive isotope to decay into its daughter isotope.', '/a/radioactive-decay.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Halite', 'The mineral name for rock salt. A chemical sedimentary rock that forms from the evaporation of ocean or saline lake waters. It is rarely found at Earths surface, except in areas of very arid climate. It is often mined for use in the chemical industry or for use as a winter highway treatment. Some halite is processed for use as a seasoning for food.', '/a/halite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hand Lens', 'A small magnifying glass of about 10x power that is used in the field, office and laboratory by geologists to examine rock, mineral, fossil and other specimens. It is usually a folding device with a metal cover that, when closed, protects the lens from scratches and impact. Also known as a hand magnifier, pocket magnifier or a pocket lens. See this item in the Geology.com Store. ', '/a/hand-lens.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hanging Valley', 'A tributary to a U-shaped glacial valley which, instead of entering the valley at the same level as the main stream, enters at a higher elevation, frequently with a waterfall. These different stream levels are a result of the rapid downcutting of the larger glacier being much faster than the slower downcutting of the tributary stream. The photo shows a hanging valley in Tongass National Forest, Alaska. The valley walls are about 1000 feet high and the valley is nearly 2000 feet wide.', '/a/hanging-valley.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hard Water', 'Water that has a significant amount of dissolved calcium and magnesium ions.  This water performs poorly with most soaps and detergents and leaves a scaly deposit in containers where it is heated or evaporates.   It can frequently be improved through the use of home-based water treatment systems.', '/a/hard-water.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hardness', 'The resistance of a mineral to being scratched.  Typically measured using the Mohs Hardness Scale.', '/c2/mohs-hardness-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hardpan', 'Hardpan, also known as caliche, is a surface or shallow layer in a soil or sediment in which the grains have been cemented together.  Depending upon the degree of cementation, the layer might be thin and easily broken with a hammer, or it could be two or more meters thick and completely cemented.  Hardpan is usually found in arid to semiarid areas where evaporation facilitates the precipitation of dissolved minerals in shallow sediments or soils.  A hardpan layer can extend over hundreds of square kilometers and cause problems with drainage, agriculture, and construction.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Head\r\n      ', 'The upper part of a landslides moving mass. It is located immediately below the scarp. Often when the scarp of a landslide becomes visible people will place soil on the head area to reestablish a smooth slope. This can be a mistake because it adds weight to the head and drives the slide.', '/a/caliche.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Headwater(s)', 'The upper portions of a drainage basin where the tributaries of a stream first begin flow.', '/a/landslide-anatomy.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Heat Flow', 'The movement of heat energy from the core of the Earth towards the surface.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Heliodor', 'Heliodor is the name given to yellow to yellow-green gems of the beryl mineral group. They can be attractive, durable, high-clarity stones with a relatively low price. Surprisingly, they are infrequently seen in jewelry.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hematite', 'An iron oxide mineral with a chemical composition of Fe2O3.  It is the worlds most important ore of iron.  When crushed it forms a red powder that has been used as a pigment for thousands of years.', '/gemstones/gems/heliodor.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hemimorphite', 'Hemimorphite is a zinc silicate mineral that occurs in white, blue and greenish blue colors. It is a minor ore of zinc. It is sometimes cut as a gemstone. These  lack durability and are used as a collectors gem or in jewelry that will be subject to light wear.', '/a/iron-ore.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hessonite Garnet', 'Hessonite is a variety of grossular garnet that is rich in iron and manganese. It has an orange to red-orange to reddish brown color and is sometimes called cinnamon stone. It is occasionally cut into faceted stones and used  in jewelry. ', '/gemstones/gems/hemimorphite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hogback', 'A narrow ridge with steeply inclined sides of nearly equal slopes.  Formed by differential erosion of steeply dipping rock units.', '/gemstones/gems/hessonite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hoodoo', 'An unusual pillar of rock that remains after the differential weathering or erosion of horizontal rock layers of varying physical properties. These structures can be caused by weathering along joints, less resistant rock units being selectively weathered, remnants from stream erosion and other processes. The name has an African origin where people imagined hoodoos being evil spirits or creatures in the form of stone.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hornfels', ' A nonfoliated metamorphic rock that is typically formed by contact metamorphism around igneous intrusions.', '/a/hoodoos.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hornito', 'A small spatter cone that forms on the solidified surface of a lava flow where hot lava is still flowing below. An opening in the roof of the flow and pressure within can force a spattering of lava out of the opening. This lava can build up into a structure with a very unusual shape.', '/a/hornfels.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Horst', 'An elongated block of high topographic relief that is bounded on two sides\r\nby steeply-dipping normal faults. Produced in an area of crustal extension\r\nsuch as the Basin and Range Province of the southwestern United States.', '/a/hornito.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Host Rock', ' The barren rock that surrounds a mineral deposit. It is a term that is more specific and less geographically extensive than country rock.  Shown in the photo is gold in a quartz vein (right side) enclosed in basalt (left side).', '/a/graben-horst.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hot Spot', 'A volcanic center located within a lithospheric plate that is thought to be caused by a plume of hot mantle material rising from depth and located above a hot spot on the outer core.', '/c2/gold-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hot Spring', 'A natural spring that delivers water to the surface that is of higher temperature than the human body. Hot springs form in areas where there is warm rock at shallow depth or where deep circulation brings hot waters up from deep within the earth. The image is a photo of Emerald Spring, a hot spring with a pool in Yellowstone National Park.', '/a/hot-spot.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Humus', 'The dark portion of a soil that consists of organic material that is well enough decayed that the original source material cannot be identified.', '/a/hot-spring.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydraulic Conductivity', 'The ability of a porous material to transmit a fluid. Also known as permeability.', '/a/humus.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydraulic Mining', 'A mining method in which water is sprayed onto alluvium or unconsolidated sediment under high pressure for the purpose of disaggregating the particles and washing them through a sluice in the hope of recovering gold, gemstones or other heavy mineral particles.  The method often caused great environmental damage by disrupting the land and flushing enormous tonnages of sediment into drainage basins.  The photo from USGS shows hydraulic mining in Malakoff Diggings in the foothills of the Sierra Nevada in the 1870s.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydrocarbon', 'Any organic chemical compound (gaseous, liquid or solid) that is composed of carbon and hydrogen.  The term is frequently used in reference to fossil fuels, specifically crude oil and natural gas.', '/a/hydraulic-mining.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydroelectric power', 'The production of electrical energy through the use of flowing or falling water.', '/a/hydrocarbon.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydrograph', 'A graph that shows the change of a water-related variable over time. Example: A stream discharge hydrograph shows the change in discharge of a stream over time.', '/a/hydropower.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydrologic Cycle', 'The movement of water between the atmosphere, ground and surface water\r\nbodies through the processes of evaporation, precipitation, infiltration,\r\npercolation, transpiration and runoff. Also known as the water cycle.', '/a/hydrograph.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydrology', ' The science of Earths water, its movement, abundance, chemistry and distribution on, above and below Earths surface.', '/a/water-cycle.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydrolysis', 'A chemical reaction involving water that results in the breakdown of mineral material.', '/a/water-cycle.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydrothermal', 'Pertaining to hot water, the actions of hot water or the products produced by the actions of hot water.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydrothermal Deposits', 'Mineral deposits that are formed by the actions of hot water or gases associated with a magmatic source.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydrothermal Metamorphism', 'A local metamorphism that occurs when hot waters and gases move through\r\nsubsurface fractures and alter the minerals in the surrounding rocks.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydrothermal Vein', 'A deposit of minerals precipitated in a fracture by the actions of hot\r\nwater or gases associated with a magmatic source.  Many metallic ores and\r\ngemstone deposits form in hydrothermal veins.', '/a/hydrothermal-metamorphism.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hydrothermal Vent', 'A hot spring on the sea floor, usually near mid-ocean ridges,  that\r\ndischarges hot water laden with dissolved metals and dissolved gases.  When\r\nthese hot fluids contact the cold ocean water the dissolved materials\r\nprecipitate, producing a dark plume of suspended material.  The water\r\ndischarged from these springs is sea water that percolates down into the\r\nearth through fissures in the sea floor.  This water is heated and picks up\r\ndissolved gases and metals as it interacts with the hot rocks and magma at\r\ndepth.  Also known as a black smoker.', '/a/hydrothermal-metamorphism.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hypersaline', 'Extremely salty water which has a salinity much higher than average sea water is said to be hypersaline.  (Average sea water contains about 35 g/L of dissolved sodium chloride.)', '/a/hydrothermal-vent.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Hypocenter', 'A point beneath earths surface where the vibrations of an earthquake are thought to have originated. Also known as the focus.', '/a/hypersaline.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Igneous Rock', 'A rock formed by the crystallization or solidification of molten rock material. They can form underground, on the surface or as ejecta. The rock in the photo is a piece of diorite.', '/a/diorite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ignimbrite', 'The material deposited by a pyroclastic flow. These materials may have been indurated by heat as in the case of a welded tuff, or, they may be indurated by later crystallization as in the case of sillar. The rock in the photo is tuff.', '/a/tuff.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Impermeable Layer', 'A layer of rock, sediment or soil that does not allow water to pass through. This could be caused by a lack of pore space or pore spaces that are so small that water molecules have difficulty passing through. The illustration shows an anticline serving as an oil and natural gas reservoir. The oil and gas are trapped in a sandstone by an impermeable layer of shale above.', '/c/180-oil-gas-investments.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Impervious Surface', 'A land area that has been covered by pavement, buildings or other land cover that prevents the infiltration of water. In these areas precipitation and snow melt run off rapidly instead of infiltrating into the ground. When the percentage of impervious surfaces in an area becomes high,  flash flooding can occur and ground water recharge will be limited. To avoid these problems, developers are often required to include catchment basins and dedicated areas for infiltration in their development plans.', '/a/impervious.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Indurated', 'The process of solidifying or hardening a material into a rock through pressure, cementation or heat. The photo shows layers of stratified tuff near Mount St. Helens.', '/a/stratified-tuff.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Infiltration', 'The movement of surface water downwards into porous soil. The image shows the infiltration of water into the ground from the channel of a stream.', '/a/influent-stream.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Influent Stream', 'A stream, usually flowing in an arid area, that loses water into the ground through the bottom of its channel. This loss occurs because the water table is below the channel of the stream. Influent streams decrease in discharge in a downstream direction and often lose all of their water into the ground.', '/a/influent-stream.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Injection Well', 'A well that is used to force a liquid or gas into the ground. The injection could be done for waste disposal, for underground storage, for enhanced oil recovery, to fight underground fires, to fill subsurface voids, for geothermal heat recovery or a number of other reasons.', '/a/injection-well.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Interior Drainage', 'A system of streams that flow into a landlocked basin and evaporate or infiltrate, instead of flowing into an ocean. The image shows Great Salt Lake, the worlds fourth largest lake fed by interior drainage.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Intermediate Rock', 'An igneous rock that has an intermediate silica content.  Examples are syenite and diorite.  Also see entries for acidic, basic and ultrabasic rocks', '/a/great-salt-lake.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Intermittent Stream', 'A stream that goes dry at certain times of the year.  Intermittent streams flow during seasons of the year when runoff and/or groundwater contributions sustain the flow of the stream.  They stop flowing during dry seasons when precipitation is low and the water table drops below the bed of the stream.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Intrusion', 'An igneous rock body that formed when  magma  forced or melted its way into, through or between subsurface rock units. The illustration shows a dike cross-cutting sedimentary rock units and sills injected between bedding planes within those units.', '/a/influent-stream.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Intrusive', 'Igneous rocks that crystallize below Earths surface. They typically have mineral crystals that are large enough to easily see with the unaided eye. The rock in the photo is a piece of diorite about two inches across.', '/a/dike.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Iolite', 'Iolite is the name given to gem-quality specimens of the mineral cordierite. It is a strongly pleochroic gem material that, when properly oriented, can produce gemstones with a deep bluish color similar to sapphire and tanzanite.', '/a/diorite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ion', 'An atom that has either lost or gained one or more electrons and now carries a positive or negative charge. The charge will be  positive if there was a loss of electrons and negative if there was a gain of electrons. In the image a sodium ion has lost one electron and the chlorine has gained one electron.', '/gemstones/gems/iolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ionic Bond', 'A chemical bond formed by the electrostatic attraction between oppositely charged ions.', '/a/ions.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Iridescence', 'A rainbow-like display of colors in the shallow interior of a material that is produced when light is separated into bands of different wavelength by layers of different refractive index within the material. Mother of pearl is a material widely known for its iridescence. ', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Iris Agate', 'Iris agate is a finely banded agate with a spectacular display of color when it is cut into thin pieces and illuminated from a direction that sends light through its very thin bands. ', '/gemstones/gems/mother-of-pearl.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Iron Formation', 'A layered deposit of chemical sedimentary rocks containing at least 15 percent (by weight) iron in the form of sulfide, oxide, hydroxide, or carbonate minerals. The photo is a close-up view of banded iron ore.', '/c2/iris-agate-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Iron Ore', ' A chemical sedimentary rock that forms when iron and oxygen (and sometimes other substances) combine in solution and deposit as a sediment. Hematite is the most common sedimentary iron ore mineral.', '/a/banded-iron.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Irrigation Circles', ' A circular area that might be between a quarter mile and a mile in diameter that is planted with crops and supplied with water from a well in the center of the circle. The water from the well is distributed across the circle by a long beam the radius of the circle long that is covered with sprinkler heads and supported with wheels and one or more motors that drive the beam around the circle distributing water over the crops. Also called center pivot irrigation or crop circles. The photo is a satellite image of center pivot irrigation sites in Finney County, Kansas.', '/a/iron-ore.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Isograd', 'A line on a map that represents a specific degree of metamorphism.  Rocks on one side of the line have been subjected to a greater level of metamorphism and on the other side of the line a lower level of metamorphism.', '/a/irrigation-circles.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Isostasy', 'A condition of gravitational balance (similar to floating) in which a mass of lighter crustal rocks are buoyantly supported from below by denser mantle rocks.  The crustal rocks above subside into the mantle until they have displaced an adequate amount of mantle material to support them.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Isotope', 'One of several forms of an element.  These different forms have the same number of protons but varying numbers of neutrons.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Jade', 'Jade is a cultural term used for a translucent gem material  consisting of either  jadeite or nephrite. The typical color cut into gemstones and used in ornamental work is a bright to deep green. However, jade can be  white, pink, purple, gray, black, or other colors.  Jade is a  durable stone, well suited for use in jewelry.   During ancient human  history, jades durability made it the material of choice for tools and weapons that were used for cutting and impact. It could be fashioned into sharp tools and had a very high resistance to breakage (also known as toughness).', '/gemstones/gems/jade.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Jadeite', 'A high-pressure clinopyroxene that is frequently carved and polished as a gemstone. Jadeite, along with nephrite, are the two minerals that share the cultural term jade. Jadeite is the more desirable of the two minerals because it is more durable, works easier, and polishes to a higher luster. The photo shows a hand-made Mayan jadeite pectoral from the Mayan Classic period. It was taken by John Hill and distributed by a GNU Free Documentation License.', '/a/jadeite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Jaspagate', 'A variety of chalcedony that displays characteristics of both jasper and agate. It has both opaque areas and translucent areas.', '/a/jaspagate.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Jasper', 'Jasper is an opaque variety of chalcedony that often exhibits interesting patterns and colors caused by impurity inclusions. Jasper  differs from agate in that agate is typically translucent and banded, or translucent with visible inclusions that form plume-, moss-, or flame-shaped patterns. Jasper is typically red, brown, orange, yellow, gray, or green and is often  associated with iron ores.  High-quality specimens of jasper can be polished to a very high luster and are often cut into cabochons or beads for use in jewelry. Jasper is also used to produce tumbled stones and a variety of lapidary products. Shown in the photo are two cabochons of Wild Horse Jasper, one of the many gemstones found in Oregon.', '/a/jasper.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Jaspilite', 'A sedimentary rock that is made up of alternating bands of red jasper and hematite. It is sometimes rich enough in iron to serve as an iron ore and is occasionally cut into  gemstones or used as an ornamental stone.', '/a/banded-iron.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Jet', 'Jet is a rock similar to coal with a uniform texture that can be cut into attractive gems. It was popular in Victorian England, where it was used in mourning jewelry. It has a very low specific gravity, which makes a strand of beads, a pair of earrings, or a brooch much lighter than expected. Jet  is very soft, so it must be used in jewelry that is not subject to impact or abuse. ', '/gemstones/gems/jet.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Jetty', 'A human-made structure built at right angles to a coastline and extending into the body of water. Jetties are built to protect an area of shoreline from the effects of currents, erosion, or deposition. Two jetties in the photo protect the entrance to a navigational channel. Note the sediment accumulated behind the jetty on the left side of the channel. Without the jetty, that sediment would have  blocked the opening to the channel.', '/a/jetty.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Joint', 'A planar fracture in rock along which there has been no displacement. Most rock units exposed at Earths surface have sets of near-vertical, parallel joints that formed in response to unloading or tectonic activity. The photo shows a set of parallel joints in dolomite of the Silurian Sugar Run Formation near Chicago, Illinois.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Joint Set', 'A group of joints that are parallel or nearly parallel. They are frequently formed at the same time interval from a local or regional unloading event or tectonic activity. The photo shows a set of parallel joints in dolomite of the Silurian Sugar Run Formation near Chicago, Illinois. ', '/a/joints.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Jolly Balance', 'A spring balance used in a mineralogy lab for the determination of specific gravity. It consists of long delicate spring with two pans suspended at the bottom. The bottom pan is suspended in a beaker of water. \r\n        The object to be tested is placed on the top pan and the linear distance that the spring lengthens is measured. The object is then placed on the bottom pan,  completely under water. The amount of spring lengthening is measured again. The lengthening in water is less than the lengthening in air because of the buoyancy provided by the water.  \r\n        Specific gravity is determined by comparing the lengthening of the spring when the object is on the air pan to the lengthening that occurs when the object is on the water pan, by the following formula.\n\nSG = La / (La - Lw)\nFor example: the specific gravity of gold is 19.3 and the specific gravity of quartz is 2.65.', '/a/joints.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Junkite', 'Ugly rocks  that some people try to make pretty by processing them in a rock tumbler. Unfortunately, if you want pretty rocks out of a rock tumbler, you have to start by putting pretty rocks in.  Junkite in = Junkite out.', '/a/jolly-balance.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Juvenile Water', 'Water that is new to the hydrologic cycle. Brought to Earths surface through volcanic eruptions.', '/a/junkite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Kame', 'Surface deposits in the form of mounds, hummocks or ridges that are composed of stratified glacial sediments. These were deposited on, under or within glacial ice and then were left behind as positive relief features when the ice melted.', '/a/kame.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Kaolinite', 'A common clay mineral with a chemical composition of Al2Si2O5(OH)4.  Unlike many other clays it does not change dimensions under different moisture conditions and does not exchange ions with adjacent liquids.  It is used as a whitening agent, antistick agent, extender and filler in many manufactured products including paper, paint, ceramics, toothpaste, cosmetics, rubber, and many other products.', '/a/kaolinite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Karat', 'A measure of the fineness of gold. It is used to represent the proportion of gold in an alloy. Pure gold is 24 carat gold. An alloy that consists of  50% gold and 50% other metals is  12 carat gold or 12/24 gold. Image copyright iStockphoto / marylooo.', '/a/karat.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Karst', 'A landscape that is characterized by the features of solution weathering and erosion in the subsurface. These features include caves, sinkholes, disappearing streams and subsurface drainage. The image is a Landsat view of the area around Winter Haven, Florida. The round black features are lakes that have developed in sinkholes formed in the limestone bedrock. The width of this view is approximately six miles.', '/a/karst.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Kerogen', 'Solid organic substances frequently found in shales that can yield gases and liquids through heating.  The organic component of an oil shale. The photo is a microscopic view of an organic black shale in reflected light the brown resinous material is kerogen.', '/a/kerogen.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Kettle', 'A depression formed in glacial deposits when a buried block of ice, left behind by a retreating glacier and buried by sediments, melts to form a depression.  These depressions are often filled with water to form a kettle lake.  The images shows a number of kettles and kettle lakes formed in the Bering Glaciers piedmont lobe.  The largest kettle in the view is about 150 feet in diameter.', '/a/kettle-lakes.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('K-feldspar', 'A potassium feldspar such as orthoclase, microcline, sanidine or adularia.  Also referred to as potash feldspar. The two pink specimens in the photo are orthoclase.', '/a/k-feldspar.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Kilobar', 'A unit of pressure equal to 1000 bars or 14,500 pounds per square inch. ', '/a/kilobar.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Kimberlite', ' A variety of peridotite that is found in volcanic pipes which are thought to be intrusions from the upper mantle.  Many diamond deposits are found in kimberlite pipes.', '/a/kimberlite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Kimberlite Pipe', 'A vertical structure beneath the site of a volcanic eruption, which was formed when rock material and magma from a mantle-source eruption  passed  upwards through the crust and erupted through the surface. It is often filled with brecciated volcanic rock which might include kimberlite or lamproite', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Knickpoint', 'An abrupt change in slope.  A point on a stream profile where a change in gradient occurs.  This could be caused by a change in underlying bedrock or bedrock structure. The photo shows a subtle knickpoint in eastern Nebraska.', '/c/180-crater-of-diamonds.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Knob', ' A small hilltop that is round in shape.', '/a/knickpoint.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Kyanite', 'A metamorphic mineral that occurs in beautiful hues of blue and green. It has perfect cleavage and has a hardness of 4.5 in one direction, 5.5 in another, making it best used in items that will not be subjected to wear.', '/a/knob.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Labradorescence', ' A display of spectral colors caused when light enters a material, strikes twinning or other planar surfaces within the stone and then reflects from them.  Different twinning surfaces within the stone can reflect different colors of light to produce the visual effect of a stone with different color domains.  This phenomenon is best known in the mineral labradorite, for which it is named.  Highly labradorescent specimens of labradorite are given the trade name of spectrolite for their bold spectral colors.', '/gemstones/gems/spectrolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Labradorite', 'A gemstone variety of plagioclase feldspar that produces flashes of iridescent blue, green, yellow, orange, or red when moved under incident light. This luster is known as labradorescence.', '/c2/labradorite-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Laccolith', ' An igneous intrusion that has been forced between two layered sedimentary rock units.  The pressure of the injecting magma was high enough to deform the overlying strata.  The roof of the intrusion is convex upwards and the floor of the intrusion is nearly flat.', '/a/laccolith.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lacustrine', 'The word lacustrine means of a lake. In geology the word is used for the depositional environment or a habitat that is found in lakes. Lacustrine environments are  usually, but not always, fresh water. They are also  usually, but not always  low energy. The USGS image shows scientists sampling glacial lake clays associated with landslide problems at Tulley Valley, New York.', '/a/lacustrine.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lahar', 'A mudflow composed of water and volcanic ash.  Lahars can be triggered by the flash melting of the snow cap of a volcanic mountain or by heavy rain.  Lahars are very dangerous because they can occur suddenly and travel at great speeds. They can travel faster than the streams in the valleys that they pass through, sweeping up stream water, sediment and other debris, and growing in mass as they flow. The photo shows a lahar exiting the crater of Mount St. Helens in 1982. The lahar flowed down the mountain, entered the North Fork Toutle River valley and eventually entered the Cowlitz River about 50 miles downstream.', '/a/lahar.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Laminar Flow', 'A state of uniform flow within a fluid in which the moving particles travel along parallel paths (compare with Turbulent Flow).', '/a/turbulent-flow.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Landslide', 'The movement of rock, soil, volcanic ash or other material, downslope under the influence of gravity.  There are many types of landslides that include: slumps, creep, earthflows, debris flows, debris avalanches, topples, rock falls, mudflows, and debris slides are examples. Landslides are often triggered by rain fall, snow melt, overloading or earthquakes.', '/c/180-landslide.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lapilli', 'Volcanic rock materials which are formed when magma is ejected by a volcano.  Typically used for tephra that ranges between 2 and 64 millimeters in diameter.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Larimar', 'Larimar is a rare blue variety of pectolite found only in the Dominican Republic. It is popular because of its delicate blue color. It must be used with care because it is fragile and will fade with long exposure to bright light.', '/a/lapilli.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lateral Moraine', 'An accumulation of rock debris along the sides of a glacier in contact with the valley walls. It is mainly weathering debris that fell from the valley wall rather than material moved by and deposited by ice.', '/gemstones/gems/larimar.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lava', 'Molten rock that has erupted onto Earths surface. The word is also used for the solidified flows and fragments after they have cooled. The image shows a pahoehoe flow on Kilauea Volcano, Hawaii. Not to be confused with magma, which is the same material while it is beneath Earths surface.', '/a/lateral-moraine.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lava Channel', 'Pathways of lava movement across the surface of a volcano. They can be straight or meandering depending upon the steepness of slope and the obstacles. The photo is a lava channel on the surface of Kilauea Volcano, Hawaii in 1990.', '/a/lava.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lava Dome', 'A round, steep-sided extrusion of very viscous lava that is squeezed from a volcanic vent without major eruption.  The lava is too viscous to flow and is composed of rhyolite or dacite. The dome shown in the photo is the vent of the Novarupta eruption of 1912, the largest volcanic eruption of the 20th century. The small dome was overlooked when the source of the eruption was originally determined and the wrong volcano was blamed. Also called volcanic domes.', '/a/lava-channel.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lava Flow', 'An outpouring of molten rock onto Earths surface, either from a volcanic cone or from a volcanic fissure.  The name lava flow is used for the erupted material in either the molten state or in the solid state after the molten lava cools and solidifies.', '/a/volcanic-dome.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lava Tube', ' When the surface of a lava flow solidifies but the lava keeps flowing below, a tunnel can remain after all of the lava drains away.  The photo shows an opening into a lava tube at the Lava Beds National Monument in California.', '/a/lava-flow.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Leaching', 'The removal of soluble constituents from a rock or soil by moving groundwater or hydrothermal fluids.', '/a/lava-tube.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lease Bonus', 'Money paid to a mineral rights owner in exchange for granting a lease.  This payment may be in addition to any rental or royalty payments.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Left-Lateral Fault', 'A fault with horizontal movement.  If you are standing on one side of the fault and look across it the block on the opposite side of the fault has moved to the left.  (Also see Right-Lateral Fault.)', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lepidolite', 'A lithium-rich mica with a rose to lilac color and an aventurescent luster that is sometimes used to make cabochons, tumbled stones and other lapidary projects.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Levee', 'A long continuous ridge built by people along the banks of a stream to contain the water during times of high flow.', '/gemstones/gems/lepidolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Limb', 'One side of a fold. The dipping rock units between the crest of an anticline and the trough of a syncline.', '/a/levee.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Limestone', 'A sedimentary rock consisting of at least 50% calcium carbonate (CaCO2) by weight. Picture of Limestone.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lineament', 'A straight topographic feature of regional extent which is thought to represent crustal structure.  A fault, line of sinkholes, straight stream stretch or a line of volcanoes can be considered linear features.', '/a/limestone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Liquefaction', 'Liquefaction occurs in unconsolidated sediments that often have pore spaces filled with water.  A sudden shock or vibration, produced by an event such as an earthquake, can mobilize the sediment with a loss of grain-to-grain frictional contacts.  This causes the sediment to lose strength and fail by compaction, subsidence, or downslope flow.  On a subaqueous slope, the failure can result in a subaqueous slump or in severe situations a turbidity current.  In the photo, a loss of foundation strength caused by liquefaction caused the buildings foundations to settle.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Liquefied Natural Gas (LNG)', 'Natural gas that has been converted to the liquid state by reducing its temperature. (At standard surface temperature and pressure, the liquification temperature is about -260 degrees Fahrenheit.)  Liquification will reduce 610 cubic feet of natural gas into a single cubic foot of LNG.  LNG provides a convenient and efficient way to transport natural gas from one port to another where pipelines are not available.  Image copyright iStockphoto / Mayumi Terao.', 'https://geology.com/c2/liquefaction-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lithification', 'The processes through which sediments are converted into sedimentary rock, including compaction and cementation.', 'https://geology.com/c2/lng-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lithology', 'The study and description of rocks, including their mineral composition and texture.  Also used in reference to the compositional and textural characteristics of a rock.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lithosphere', 'The rigid outer shell of the earth which includes the crust and a portion of the upper mantle.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lithospheric Plate', 'A large slab of the lithosphere that can be moved by convection current motion within the mantle.', '/a/asthenosphere.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Load', 'The total amount of sediment being carried by a stream or a glacier.  Includes suspended materials, dissolved materials and materials moved along Earths surface.  (Also see:  bed load, dissolved load, suspended load.)', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lode', 'A rich accumulation of minerals in solid rock.  Frequently in the form of a vein, layer or an area with a large concentration of disseminated particles.  (See placer deposit for contrast.)', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Longitudinal Dune', 'A long, narrow sand dune that has its long dimension oriented parallel to the direction of the wind. It moves in the same direction as the wind.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Longitudinal Profile', 'A cross section of a stream or valley beginning at the source and continuing to the mouth.  These profiles are drawn to illustrate the gradient of the stream.', '/a/longitudinal-dunes.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Longshore Current', 'A flow of water parallel to a coastline that is caused by waves striking the coast at an oblique angle.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Longshore Drift', 'The movement of sediment along a coastline caused by waves striking the coast at an oblique angle.  The waves wash sediment particles up the beach at an oblique angle and the swash back to the sea carries the particles down the gradient of the beach.  This produces a zig-zag path of particle movement along the beach.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lopolith', ' An igneous intrusion that has been forced between two layered rock units.  The floor of the intrusion is convex downwards and the roof of the intrusion is nearly flat.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Losing Stream', 'Also known as an influent stream. A stream, usually flowing in an arid area, that loses water into the ground through the bottom of its channel. This loss occurs because the water table is below the channel of the stream. Influent streams decrease in discharge in a downstream direction and often lose all of their water into the ground.', '/a/lopolith.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Lowland', 'A relatively flat area in the lower levels of regional elevation.', '/a/influent-stream.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Low-Velocity Zone', 'A zone within the upper mantle where seismic wave velocities are relatively low.  This zone is located about 35 to 155 miles below the surface.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Luster', 'The manner in which light reflects from the surface of a mineral.  Metallic, submetallic and non-metallic are the basic types of luster. Other types of luster include: vitreous, dull, resinous, adamantine, earthy, pearly, greasy, silky, and waxy. The intensity of luster is often described in simple terms such as bright or dull. In the photo are specimens of tumble-polished hematite with a bright metallic luster.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Maar', ' A maar is a small, shallow volcanic crater with steep sides that forms in an explosive volcanic eruption that is triggered when rapidly ascending magma contacts groundwater at a shallow depth and a steam explosion occurs. Maars are usually surrounded by tephra deposits that are thickest near the maar and thin with distance. Most maars are only a few hundred to several thousand feet across and are at most a few hundred feet deep. After cinder cones, they are the second most common volcanic landform.', '/a/maar.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mafic', ' A term used to describe an igneous rock that has a large percentage of dark-colored minerals such as amphibole, pyroxene, and olivine.  Also used in reference to the magmas from which these rocks crystallize.  Mafic rocks are generally rich in magnesium and iron (think MAgnesium and FerrIC).  Basalt and gabbro are examples of mafic rocks.  (See felsic to contrast.)', '/a/basalt.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Magma', 'Molten rock material that occurs below Earths surface. When it erupts onto the surface, it is known as lava.', '/a/magma-chamber.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Magma Chamber', 'A subsurface reservoir of magma at a shallow depth in Earths crust. It can serve as a source of magma and gases for volcanic eruptions if it connects to the surface through a pipe or connects to another magma chamber through a dike or a sill. Some magma chambers never produce a volcano and slowly cool to produce a differentiated mass of igneous rock.', '/a/magma-chamber.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Magmatic Water', 'Water that is dissolved in a magma or water that is released from a magma.  Some magmas can contain up to several percent dissolved water by weight. The presence of water can lower the melting temperature of a rock. ', '/a/magmatic-water.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Magnetic Anomaly', 'An increase or decrease in the local magnetic field compared to the normally expected value. The image is a section of the United States Geological Surveys full spectrum magnetic anomaly grid of the United States with improved long wavelengths for studying continental dynamics.', '/a/magnetic-anomaly.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Magnetic Declination', 'The horizontal angular difference between Geographic North and Magnetic North. This angular difference varies, depending upon your location on the face of the Earth. ', '/a/magnetic-declination.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Magnetic Inclination', 'The vertical angular difference between a horizontal plane and the orientation of Earths magnetic field. Near the magnetic equator the magnetic inclination will be approximately zero. As the pole is approached the magnetic inclination will increase, and at the magnetic pole the magnetic inclination will be 90 degrees.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Magnetic North', 'The direction that a compass points.  The location where Earths magnetic field dips vertically into the Earth.', '/a/magnetic-field.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Magnetic Reversal', 'A change in the polarity of Earths magnetic field in which the north magnetic pole becomes the south magnetic pole and vice versa.  Also known as geomagnetic reversal or polarity reversal.  Earths magnetic field has reversed many times in the past, and the time intervals between these changes are known as polarity epochs.', '/a/magnetic-north.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Magnetic Stratigraphy', 'The correlation of rock units and the study of Earths history using magnetic events and magnetic epochs as a time reference. ', '/a/magnetic-reversal.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Magnetometer', 'An instrument designed to measure the strength and character of Earths magnetic field or the magnetic properties of the underlying rocks. There are many types of magnetometers for different scales of measurement and for different methods of surveying. Some are  carried by hand or in vehicles. Others are  towed behind ships or aircraft.', '/a/magnetic-stratigraphy.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Magnitude', 'A measure of earthquake strength based upon the amount of ground motion experienced and corrected for the distance between the observation point and the epicenter.  There are several magnitude scales in use.', '/a/magnetometer.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Malachite', 'Malachite is a copper carbonate mineral that has served as a minor ore of copper. It has a bright green color, often with  beautiful banding, swirl, and eye patterns. This makes it an attractive gemstone. Because it is  soft and cleaves easily, malachite is  best used in items that will not be subjected to abrasion or impact.', '/a/richter-magnitude.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Malaya Garnet', 'Malaya is a pink to pinkish brown or reddish variety of garnet. Compositionally, it is a mixture of pyrope, almandine, and spessartine. It is occasionally seen in jewelry.', '/c2/malachite-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mali Garnet', 'Mali is a yellow to yellowish green variety of garnet, named after the African country of Mali. It is a mixture of grossular and andradite that is occasionally seen in jewelry. It has great dispersion (fire) as seen in this photo.', '/gemstones/gems/malaya.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Manganese nodule', ' A rounded concretion, rich in manganese minerals with minor concentrations of cobalt, copper, nickel, and other metals. These nodules are  abundant on some parts of the deep ocean floor and have been considered as a potential source of manganese. The photo shows iron-manganese nodules on the seafloor north of the Puerto Rico Trench at a depth of about 5339 meters. The nodules are about two to four centimeters in diameter.', '/gemstones/gems/mali.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mantle', 'A major subdivision of Earths internal structure.  Located between the base of the crust and  the top of the core. It is approximately 1800 miles thick and has a composition that is distinctly different from the crust above and the metallic core below. The mantle makes up about 84% of Earths volume.', '/a/manganese-nodules.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mantle Plume', ' A rising mass of hot mantle material that can create an area of volcanic activity in the center of a lithospheric plate. The illustration shown here is a simplified representation of the mantle plume that produced the Hawaiian Islands.', '/a/earth-structure.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Marble', 'A non-foliated metamorphic rock that is produced from the metamorphism of limestone. It is composed primarily of calcium carbonate. It is often used as a building stone in prestige architecture. The photo shows part of the West Building of the National Gallery of Art, which has extensive use of marble in both the exterior and interior.', '/a/mantle-plume.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mariposite', '\x80\x9cMariposite\x80\x9d is an informal name that is most often used for green micas that are thought to be colored by small amounts of chromium. The \x80\x9cmariposite\x80\x9d name has also been used for a group of green and white metamorphic rocks that contain significant amounts of green mica. During the California Gold Rush mariposite was the  source of much placer gold and was also mined as an ore. Because of this  mariposite became an indicator of potential gold and served as a tool for gold prospecting.', '/a/marble.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mary Ellen Jasper', 'Mary Ellen is a rock that consists of red jasper and  hematite with a submetallic luster. The jasper is a fossil stromatolite, a layered structure built up by sediment-trapping algae that lived on Earth about two billion years ago - long before land plants.', '/a/mariposite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Massive', 'A term used in reference to a rock unit that is homogeneous in texture, fabric, and appearance.', '/gemstones/gems/mary-ellen.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mass Wasting (also Mass Movement)', ' A general term used for any downslope movement of rock, soil, snow, or ice under the influence of gravity. Includes: landslides, creep, rock falls, and avalanches.', '/a/massive-sandstone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Matrix Opal', 'Matrix opal is a material in which precious opal is in an intimate mixture with the host rock, instead of being confined to seams and patches. The specimen in the photo is from Andamooka, Australia, and is a sedimentary rock with opal filling the voids between sedimentary grains.', '/c/180-landslide.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Maw Sit Sit', 'Maw sit sit is a rock composed of jadeite, albite, and kosmochlor (a mineral related to jadeite). It is attractive, has a bright chrome green color and accepts a bright polish, and for those reasons it is used as a gemstone.', '/gemstones/gems/matrix-opal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mcf', 'One thousand cubic feet - a standard production and sales volume for natural gas. (The M represents the Roman numeral for one thousand.)', '/gemstones/gems/maw-sit-sit.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('MMcf', 'One million cubic feet - a standard production and sales  volume for natural gas. (The M represents the Roman numeral for one thousand. Two Ms represent one thousand-thousands.)', '/a/mcf.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Meandering Stream', 'A stream that has many bends (meanders). This type of drainage pattern usually develops on a nearly level landscape and where the banks of the stream are easily eroded.', '/a/mmcf.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mechanical Weathering', 'A general term applied to a variety of weathering processes that result in the particle size reduction of rock materials with no change in composition.  Abrasion, frost action, salt crystal growth, and pressure relief fracturing are examples.  Also known as physical weathering. The photo shows granite pebbles and boulders on the flood plain of a wash, where flash floods pick up, carry, and abrade the sediment particles. In the winter, the forces of freezing and thawing slowly damage the rocks.', '/a/meandering-stream.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Medial Moraine', 'A streak of till in the center of a glacier.  These are found downslope from the junction of two glaciers and are a merging of their lateral moraine deposits. The image is an aerial photo showing the confluence of the Gilkey and Bucher Glaciers, showing numerous medial moraines. Image from the Juneau Icefield, Tongass National Forest, Alaska.', '/a/physical-weathering.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Medical Geology', 'The study of human health related to geology.  Examples would include the correlation of disease or vitality with residences over specific types of bedrock, or health problems associated with exposure to specific mineral materials. In the photo, a hydrologist measures the quality of irrigation water at a farm. ', '/a/medial-moraine.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Melanite Garnet', 'Melanite is a lustrous, black, opaque variety of garnet that is not often seen in jewelry. It is a titanium garnet of the Andradite group and is sometimes called titanian andradite.', '/a/medical-geology.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Metamorphism', 'Alteration of the minerals, textures, and composition of a rock that is caused by exposure to severe heat, pressure, and chemical actions. Metamorphism occurs to rocks at convergent plate boundaries, rocks that have been deeply buried, and rocks that have been contacted by migrating magma or hydrothermal fluids.', '/gemstones/gems/melanite-garnet.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Meteor', 'A streak of light momentarily visible in the night sky when a  meteoroid  penetrates Earths atmosphere. Meteoroids can be travelling at  speeds of  20 kilometers per second or more. That great speed causes it to impact air molecules with force that is sufficient to heat it to a glowing temperature and   vaporize particles from its surface.  A trail of these  hot particles is left behind the meteoroid. Because of their high temperature they glow momentarily, producing a streak of light. This streak of light is known as a shooting star or a meteor. ', '/a/metamorphism.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Meteoric Water', 'Water from the atmosphere, such as rain, snow, hail, or sleet.', '/cover/meteor.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Meteorite', ' A particle of iron or rock that has fallen to Earths surface from interplanetary space. They sometimes have concave pits in their surface caused by ablation as they fall through the atmosphere. Meteorites are also found on the Moon and other bodies in our solar system. In fact, the NASA Mars Rovers have found many Martian meteorites.', '/a/meteoric-water.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Meteoroid', 'A particle of iron or rock found in interplanetary space. Distinguished from planets or asteroids by its much smaller size.', '/c/180-iron-meteorite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Methane Hydrate', 'Methane hydrate is a crystalline solid that consists of a methane molecule\r\nsurrounded by a cage of interlocking water molecules (see image at left).\r\nMethane hydrate is an ice that forms in sediments on the continental\r\nslope at a depth where cold temperatures occur.  It has the potential to be\r\ntapped as a source of methane.  There is more fuel value contained within\r\nEarths methane hydrate than in all of the remaining oil and natural gas\r\ndeposits combined.', '/a/meteoroid.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mica', 'Mica is the name used for  a group of sheet silicate minerals with a generalized chemical composition of (K,Na,Ca)(Mg,Fe,Li,Al)2-3(OH,F)2[(Si,Al)4O10]. These minerals have basal cleavage which is so well developed that specimens have the ability to split into very thin sheets. Shown in the photo are the two most common mica minerals, biotite and muscovite.', '/c2/methane-hydrate-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Microseism', 'A vibration of the Earth that is unrelated to earthquake activity - instead it is caused by wind, moving trees, ocean waves, or human activity.', '/a/mica.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Milling', 'The activities of preparing an ore for market.  These activities can include crushing, grinding, concentration, separation of impurities, and conversion into a transportable  state. The image shows a ball mill, a large revolving drum into which ore is placed with large steel balls. The drum is rotated and the balls are tossed around inside, repeatedly impacting the ore and crushing it into a fine powder over time. This small particle size allows impurities to be separated from the target material.', '/a/richter-magnitude.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Milling Capacity', 'The maximum amount of material that a mill can process in a unit of time. Tons per hour is a typical unit for milling capacity.', '/a/milling.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mineral', 'A naturally occurring, inorganic solid with a definite chemical composition and an ordered internal structure. If it isnt grown, it is probably a mineral that is produced from a mine.', '/a/milling.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mineral Interest', 'An ownership, lease, concession, or other contractual interest that gives a party the right to explore and extract mineral resources on a property. The photo shows test drilling of a mineral property.', '/c2/what-are-minerals-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mineral Lease', 'A contract in which a mineral interest owner conveys to another party  a right to explore for, develop, and produce mineral resources.  The lessee acquires a working interest and the lessor retains a royalty interest of a specified percentage. The photo shows test drilling of a mineral property.', '/a/mineral-interest.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mineralogy', 'The study of minerals - their composition, structure, formation, uses, properties, occurrence, and geographic distribution.', '/a/mineral-interest.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mineraloid', 'A mineraloid is an amorphous, naturally occurring inorganic solid that does not exhibit crystallinity. It may have the outward appearance of a mineral, but it does not have the ordered atomic structure required to meet the definition of a mineral. The photo shows a piece of obsidian, which is a mineraloid because as a glass it does not possess a crystalline structure. Other well-known mineraloids are pumice, opal, and limonite.', '/c2/what-are-minerals-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mineral Pigments', 'Pigments that are made by crushing minerals to a fine powder. Most of the pigments that have been used across history have been made from minerals.   People have been collecting minerals and using them as pigments for about 40,000 years. Hematite is used to produce a wide range of red to reddish-brown pigments. Limonite (a mineraloid) has been used to produce yellow to brown pigments as shown in the photo. Glauconite is used to create green, lazurite for blue, psilomelane for black, cinnabar for red, orpiment for orange, malachite for green, and barite for white. These are just a few examples of minerals used as pigments. The pigment minerals can be mixed with oil, water, and other liquids for use as a paint. They can also be used to give color to plaster, stucco, cosmetics, chalk, and similar material.', '/a/obsidian.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mineral Rights', 'The ownership of rocks, minerals, and fluids beneath an area of land.   The owner  has the freedom to sell, lease, gift, or bequest these rights individually or entirely to others.', '/a/pigment-minerals.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mohorovicic Discontinuity', 'The boundary between the crust and the mantle.  Frequently referred to as the Moho. In the image, the Moho is the thin red line at the base of the crust.', '/cover/mineral-rights.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mohs Hardness Scale', 'A collection of minerals ranging from very soft to very hard.  Use as a comparison scale during mineral identification.  From softest to hardest, the ten minerals are:  talc 1, gypsum 2, calcite 3, fluorite 4, apatite 5, orthoclase 6, quartz 7, topaz 8, corundum 9, and diamond 10.  Developed by Friedrich Mohs, a German mineralogist, in the early 1800s.', '/c/180-moho.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Moldavite', 'Moldavite is a glassy material that is thought to have formed when a large asteroid impacted a location in eastern Europe about 15 million years ago. The target rock and impactor melted and solidified into an olive green glass. ', '/c2/mohs-hardness-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Molecule', 'A group of two or more atoms held together by chemical bonds. The group of atoms does not have an electrical charge and is the smallest possible unit of that substance that is possible. The image shows a sodium atom and a chlorine atom combined to produce a salt molecule. ', '/gemstones/gems/moldavite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Monocline', 'An area of increased dip in otherwise gently dipping strata. The image shows a monocline over a reverse fault.', '/a/molecule.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mookaite', 'A colorful gem material mined in Australia. It forms from the deposition and lithification of a sediment composed of the silica tests of radiolarians. The resulting rock is  known as a radiolarite. It is a popular gem material for making cabochons and beads.', '/a/monocline.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Moonstone', 'Moonstone is a name given to translucent orthoclase feldspar that exhibits adularescence (a white-to-bluish light that floats just under the surface of the stone when it is turned under a source of light). It is a very popular gemstone.', '/gemstones/gems/mookaite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Moraine', 'A mound, ridge, or ground covering of unstratified and unsorted till, deposited by ice action or by melting away of a glacier. Many different types of moraines are distinguished: terminal, ground, lateral, ablation, medial, push, and recessional. The photo shows a push moraine formed by the Harriman Glacier of Alaska.', '/gemstones/gems/moonstone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Morganite', 'Morganite, also called pink beryl, is the pink- to salmon-colored gemstone member of the beryl mineral group.', '/a/moraine.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Moss Agate', 'Moss agate is a transparent-to-translucent chalcedony that contains mineral inclusions which are shaped like moss, trees, leaves, or other vegetation. ', '/gemstones/gems/morganite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mother of Pearl', 'Mother of pearl, also known as MOP, is the thin inner nacreous layer of a mollusk shell. It can be white, cream, or gray in color with a beautiful iridescent play-of-color. It is cut and shaped for use in  jewelry, buttons, musical instruments, and more.', '/gemstones/gems/moss-agate.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mountain', 'A general term used in reference to an area that is at a conspicuously higher elevation than surrounding lands.  Mountains are larger than hills and are significant enough in relief that they are given names by local residents. Shown in the photo is Mount Everest, the mountain with the highest altitude (8,850 meters / 29,035 feet).', '/gemstones/gems/mother-of-pearl.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mud Cracks', ' A network of polygonal shrinkage cracks that open in mud as the water within is slowly evaporated. They can harden, and if buried, can be lithified as a preserved sediment surface that is evidence of submersion followed by subaerial exposure. They can indicate a sedimentary environment of a lake shore, river bank, or low-energy beach. Also known as desiccation cracks.', '/a/world-records.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mudflow', ' A downslope movement of wet soil and rock debris that is mostly composed of clay-size particles and water.  At the base of the slope, the flow spreads out over the runout area in the form of a lobe. The internal particle motion is that of a flow rather than of a rotating or translating mass.  Many mudflows move at a rate of a few feet per year or less, but some reach speeds in excess of 60 miles per hour. Movement is usually  triggered during times of heavy rainfall or rapid snow melt.', '/a/mud-cracks.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mud Logger', 'A worker at a drilling site who does the work of mud logging.', '/a/earthflow.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mudstone', 'A sedimentary rock composed of clay-size particles but lacking the stratified structure that is characteristic of a shale. The image shows a hole in mudstone on Mars that was drilled by NASAs Curiosity Rover in May 2013. The hole is about 0.6 inch across.', '/a/mud-logging.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mud Volcano', 'A mud volcano is a vent in Earths surface from which liquid mud erupts. They occur in at least three geologic situations: 1) in volcanic areas where hydrothermal activity produces steam and gas pressure that mobilizes mud and forces it to the surface 2) where tectonic activity forces fluidized sediments to the surface and, 3) where fluidized sediments pressurized by hydrocarbons are driven to the surface.', '/a/mudstone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Multiple Completion Well', 'A well equipped to produce oil and/or gas from more than one subsurface rock unit. This is done by isolating the producing zones within the well with plugs. The production casing will be perforated  between the plugs. These perforations  will allow fluids that  flow from the formation into the well bore to enter the production casing and be evacuated to the surface.', '/a/mud-volcano.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('M.Y.', 'Million years - abbreviation.', '/a/multiple-completion-well.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('M.Y.A.', 'Million years ago - abbreviation.', '/a/m-y.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Mylonite', 'A fine-grained foliated metamorphic rock found in zones of ductile deformation as might occur  near the shear zone of a fault. ', '/a/m-y-a.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Nannofossils', 'A generic term used in reference to very small fossils that are at the limit of resolution by a light microscope. They are therefore studied with electron microscopes. Discoasters and coccoliths are frequently called nannofossils.', '/a/nannofossils.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Nappe', 'A large slab of Earths surface that has been moved in a horizontal or near horizontal direction through thrust faulting or recumbent folding.  The term is generally used for very large slabs which are many square kilometers or miles in surface area. ', '/a/nappe.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Native Metal', 'A specimen of an element, found naturally occurring in nature. Examples include  gold, silver,  copper, mercury, lead, palladium and platinum.', '/a/gold.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Natural Bridge', 'Any arch-shaped rock formation produced by weathering and/or erosion that spans a small valley. Some natural bridges are formed when the bend of a meandering stream erodes through a meander neck. In limestone areas, they can form when cavern collapse leaves a small area of roof spanning a passage. The photo shows Sipapu Bridge at Natural Bridges National Monument in Utah.', '/a/natural-bridge.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Natural Gas', 'Naturally occurring hydrocarbons that exist in subsurface rock units in the gaseous state. Methane is the most abundant, but ethane, propane, and others also occur. Natural gas is flammable and is burned as a fuel. Natural gas has many uses beyond being burned as a fuel. These include making a  wide variety of chemical, plastic, and fertilizer products.', '/c/180-oil-gas-investments.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Natural Gas Flaring', 'The practice of burning natural gas at a well site where oil is being\r\nproduced but there is no opportunity to collect the associated natural gas\r\nfor profitable use.  This is a waste of a natural resource, a pollution\r\nwithout benefits, and a loss of landowner royalties.  Flaring occurs\r\nextensively over the Bakken Formation of North Dakota, where enormous\r\namounts of oil are being produced but there are no pipelines for natural\r\ngas.  Offshore oil fields often flare natural gas for the same reason.  The\r\nphoto shows natural gas flaring at a Marcellus Shale well site in\r\nPennsylvania. Flaring in many gas fields is so common that it can be seen from space.', '/a/natural-gas-flaring.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Natural Gas Liquids', 'Components of natural gas other than methane that are in the gaseous state under the high temperatures and pressures of the subsurface reservoir, but when they are produced at the lower temperatures and pressures of the surface condense into a liquid.  These condensates vary in composition and abundance from one well to another and even from one formation to another in the same well.  They can include hydrocarbons such as pentane, butane, propane, hexane and others.  These liquids are separated from the raw gas and have commercial value.  In some areas they are more valuable than the methane that is produced.  Raw natural gas that contains natural gas liquids is known as wet gas.', '/a/butane.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Natural Levee', 'A mound of sediment that parallels a stream channel, forming a levee-like deposit. When flood waters leave the normal stream  channel and enter the flood plain, there is a rapid reduction of velocity that causes suspended sediments to fall to the bottom immediately after leaving the channel. This deposition is what produces the levee. ', '/a/natural-levee.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Natural Reservoir Pressure', 'The pressure within an oil or gas reservoir that forces oil or gas up the well bore when the reservoir is penetrated by drilling. ', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Neap tide', 'A daily tidal range of minimal amplitude that occurs when the moon and sun are positioned at 90 degrees to one another.  In this moon-earth-sun configuration, the gravitational attraction of the moon and sun compete for Earths water.  Neap tide occurs at the first and third quarters of the moon.  See spring tide for contrast.', '/c/180-oil-gas-investments.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Nebula', 'A cloud of interstellar dust and gas in outer space that is faintly visible in the night sky from Earth. Shown in the photo is the Helix Nebula.', '/a/neap-tide.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Nephrite', 'Nephrite and jadeite are two very similar minerals that are both known as jade and used as a gemstone. Nephrite is the more abundant and less valuable mineral of the pair - but it can still have great beauty and appeal.', '/a/nebula.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Neutron', 'A subatomic particle contained in the nucleus of an atom.  It has no electrical charge and a mass similar to that of a proton.', '/gemstones/gems/nephrite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Nodule', 'A mineral mass that has a different composition or is more resistant to weathering than its surrounding rock. These are normally rounded in shape. Examples include chert masses in a limestone rock unit, pyrite masses in a coal seam, or carbonate masses in a shale. In most cases, these nodules have formed within the rock unit or its former sediment mass. One of the most widely known types of nodules are Oregon Thundereggs, agate nodules with concentric banding that might have horizontal banding and drusy quartz in the center. The term is also applied to rounded masses of manganese minerals that occur on some parts of the ocean floor. The photo shows iron-manganese nodules on the seafloor north of the Puerto Rico Trench at a depth of about 5339 meters. The nodules are about two to four centimeters in diameter.', '/a/atom.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Non-Operating Interest', 'A mineral lease interest that does not involve the rights and responsibilities of exploration, development, or production.  A royalty interest is a non-operating interest.', '/a/manganese-nodules.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Non-Point Source Pollution', 'Pollution that does not originate at a single location. In an urban area, runoff water can be polluted while flowing toward a  stream by gasoline, antifreeze, road salt, or other contaminants. In rural areas, runoff can be contaminated by insecticides, manure, or fertilizer. This contamination can be significant but cannot be traced back to a specific source. The photo shows flooding in Wayne County, North Carolina. Flooding in a rural area can mobilize fertilizer, animal waste, and many other pollutants.', '/c/180-oil-gas-investments.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Non-Producing', 'A term that refers to a property, a well, or a mine from which commercial amounts of a mineral resource have not yet been produced.', '/a/pollution.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Normal Fault', 'A fault with vertical movement and an inclined fault plane.  The block above the fault has moved down relative to the block below the fault. The dip angle of the fault plane is between 45 and 90 degrees. Normal faults are the typical structural style of divergent plate boundaries and portions of the crust under extensional stress such as the East Africa Rift.', '/cover/mineral-rights.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Nuclear Electric Power (Nuclear Power)', 'The generation of electricity using the heat released from a nuclear fuel. Shown in the photo is the Bellefonte Nuclear Generating Station, located near Hollywood, Alabama.', '/a/normal-fault.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Nuclear Fuel', 'Fissionable materials that are rich enough to sustain a fission chain reaction.', '/a/nuclear-power-plant.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Nuclear Reactor', 'A facility where a nuclear fission chain reaction can be initiated, controlled, and sustained. Shown in the photo is the Bellefonte Nuclear Generating Station, located near Hollywood, Alabama. The reactors are located in the two cylindrical structures on the left side of the photo. The two hourglass-shaped structures are cooling towers.', '/a/nuclear-power.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Oblique-Slip Fault', 'A fault that has both horizontal and vertical elements of displacement.', '/a/oblique-slip.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Obsidian', 'A glassy igneous rock with a composition similar to granite.  The glassy texture is a result of cooling so fast that mineral lattices were not developed.', '/a/obsidian.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ocean Jasper', 'A gem material named because it is found below the high tide line of a Madagascar ocean beach. It is patterned with beautiful eyes and bands in a wide variety of colors. It also can grade from agate to jasper in a single stone.', '/gemstones/gems/ocean-jasper.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Offshore', 'The geographic area that is seaward of a coastline. The photo shows an offshore drilling platform.', '/a/offshore.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Oil Field', 'The geographic area above an underground accumulation of oil and natural gas.', '/a/oil-field.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Oil Sand', ' Also known as tar sand. A porous sand or sandstone that contains asphalt or bitumen within its pore spaces. Sometimes the name oil sand is used for a deposit in which the hydrocarbon is in a liquid form and the name tar sand is reserved for those deposits in which the hydrocarbon is in the form of solid asphalt or bitumen.', '/c2/oil-sand-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Oil Shale', 'A dark-colored shale containing an unusual amount of solid organic material known as kerogen.  This shale can be crushed and heated to liberate gaseous and liquid hydrocarbons.  At present the expenditure required to process oil shale into a fuel makes this effort marginally profitable or unprofitable.', '/c/180-oil-shale.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Old Age', 'A stage in the development of a landscape when streams have a low gradient and meander back and forth across broad floodplains.  The landscape is marked by meander scars and oxbow lakes.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Onyx', 'Onyx is the name given to a black chalcedony with parallel white banding or a red chalcedony with white banding. High-quality pieces are sometimes used to carve cameos.', '/a/meandering-stream.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Oolite', 'A small sphere of calcium carbonate no more than a few millimeters in diameter and with a concentric internal structure.  These spheres are thought to have formed by inorganic precipitation of calcium carbonate in very thin layers around a grain of sand or a particle of shell or coral. A rock composed primarily of oolites.', '/gemstones/gems/onyx-cabochon.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Oolitic', 'A limestone texture that is characterized by spherical grains of calcium carbonate with a concentric internal structure.  These grains are thought to form by inorganic precipitation of calcium carbonate around a sand grain or shell particle nucleus.', '/a/oolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Opal', 'A hydrous silicon dioxide mineraloid that is used as a gemstone. Opals that display an iridescent play-of-color (like the cabochons in the photo) are called precious opal. Opals that do not show play-of-color are called common opal.', '/a/oolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Opalized Wood', 'A type of petrified wood that is composed of opal, usually common opal, rather than chalcedony or another mineral material.', 'https://geology.com/gemstones/gems/white-opal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Opaque', 'An adjective used in reference to a substance that does not allow light of visible wavelength to enter or pass through.  Minerals with a metallic or submetallic luster are normally opaque. The image shows soil spherules from the moon in transmitted light. The black spherules are opaque and do not allow the passage of light.', 'https://geology.com/a/opalized-wood.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ophiolite Suite', 'The typical sequence of rocks in the oceanic crust: from bottom to top:  ultrabasic rocks, gabbro, sheeted dikes, pillow basalts, and sea-floor sediments.  Igneous rocks and deep-sea sediments  associated with divergence zones and the sea-floor environment.', '/a/opaque.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Orbit', 'An elliptical or hyperbolic path traveled by a satellite object around a more massive body.  For example, the Earth orbits the Sun.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ore Deposit', 'A natural accumulation of a metal, gemstone or other valuable mineral substance, which is rich enough in concentration that it can be mined and processed at a profit.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ore Mineral', 'A mineral that contains a high enough concentration of a useful element or compound that the element or compound can be extracted at a profit.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Original Horizontality', 'One of the principles of relative dating.  Based upon the good assumption that sedimentary rocks are deposited in horizontal or nearly horizontal layers then if sedimentary layers are found in an inclined orientation the force that moved them to that orientation must have been applied at some time after their deposition.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Orogenic Belt', 'A linear or arcuate region of folded and uplifted rocks.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Orogeny', 'A compressive tectonic process that results in intense folding, reverse faulting, crustal thickening, uplift  and deep plutonic activity.  A mountain-building episode.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Oscillation Ripple Marks', 'Symmetrical ridges in sand or other sediment that are caused by a back-and-forth wave action.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Outcrop', 'An exposure of bedrock.  Outcrops can be formed naturally or by human action.  Stream erosion and highway construction can produce outcrops.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Outfall', 'A location where water is discharged. Normally used in reference to where a water treatment facility releases treated water into the environment.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Outgassing', 'The release of juvenile gases and water to the surface from a magma source.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Outwash', 'Sorted and stratified sediment deposited in front of a glacier by meltwater streams.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Overturned Fold', 'A fold that has both limbs dipping in the same direction, resulting from one of those limbs being rotated through an angle of at least 90 degrees.  Overturned folds are found in areas of intense deformation.  The name overturned is given because the strata on one limb of the fold are overturned or upside down.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Oxbow Lake', 'A crescent-shaped lake that forms when a meandering stream changes course. Such changes in course frequently occur during flood events when overbank waters erode a new channel.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Oxidation', 'A chemical reaction in which substances combine with oxygen.  For example, the combination of iron with oxygen to form an iron oxide.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pahoehoe', 'A Hawaiian term for a lava flow that has a surface flow structure that looks like coiled rope or cord. Lavas with a relatively low viscosity can form a ropy surface. The term is also used for the rock materials after the flow has cooled.', '/a/pahoehoe.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Paleoclimate', 'The climate of a given area at a specific time in the past.  Paleoclimates of an area can be determined by examining the characteristics of sedimentary rocks such as their fossils, minerals, sedimentary structures. Paleoclimates can also be determined from ice cores. The photo shows pollen grains that can be used to determine climatic conditions in their source area.', '/a/pollen.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Paleocurrent Map', 'A map that shows the directions of currents at the time of sediment deposition.  These directions can be determined through the study of cross bedding, ripple marks, tool marks and other sedimentary structures. The image is a field-note representation of the rock types present at a given location and the paleocurrent directions inferred from sedimentary structures.', '/a/paleocurrent.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Paleogeographic Map', 'A map that shows the distribution of sedimentary environments at a specific time in the past. These maps are made by studying the rock record to correlate rock units that were deposited at the same time, then relating rock characteristics to specific sedimentary environments. They can also show the relative positions of landmasses on the face of the Earth at specific times in the past. The map at left shows the relative position of Earths landmasses and seas approximately 210 million years ago.', '/a/paleogeographic-map.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Paleomagnetism', ' The study of Earths magnetic field over time.  When rocks that contain magnetic minerals are deposited, the character (vertical and horizontal orientation along with polarity) of Earths magnetic field is locked within the rocks.  This information can be used to study changes in Earths magnetic field as well as the movement of plates over time. The image shows the current configuration of Earths magnetic field.', '/a/magnetic-field.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Paleontology', 'The study of the changes in Earths life over space and time through the study of rock units and the fossils contained within them.', '/a/fossil-fish.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pangaea', 'A large continental landmass that existed from about 300 million years ago through about 200 million years ago.  It included most of the continental lithosphere present at that time.  It has since broken up and the fragments have drifted to become the configuration of Earths present day continents.', '/c/180-pangea.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Panthalassa', 'The ancient ocean that surrounded the Pangaea landmass.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Parabolic Dunes', 'Sand dunes with a U-shaped outline. They have a convex nose and two trailing horns that point upwind. Parabolic dunes form  in areas with a single dominant wind direction that blows up the gentle slope on the trailing side of the dune and drops the sand on the steep side of the dune. The dunes move slowly down wind and are common in coastal areas.', '/c/180-pangea.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Parent Isotope', 'A radioactive isotope that spontaneously decays into a new substance along with a release of heat.  The product of this decay is known as a daughter isotope.', '/a/parabolic-dunes.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pay or Pay Zone', 'The portion of an oil or gas reservoir that contains hydrocarbon and is capable of yielding profitable amounts of oil or gas. The term is usually used in reference to the rocks at a particular depth or a laterally traceable rock unit. In the image the portion of the sandstone rock unit that contains natural gas and oil is a  pay zone.', '/a/radioactive-decay.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Peak Flow', 'The maximum instantaneous discharge of a stream at a specific location. Corresponds to the highest stage of a flood. The hydrograph at left shows a peak flow of a little over 200 cubic feet per second.', '/c/180-oil-gas-investments.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Peanut Wood', 'A variety of petrified wood from Australia. Some pieces have white markings that remind people of peanuts. It is a fossil driftwood that has been bored by marine clams.', '/a/hydrograph.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pearls', 'Pearls are a very popular gem material. They are produced by shellfish, and people have used them for personal adornment for thousands of years. These are cultured freshwater pearls produced in Tennessee.', '/gemstones/gems/peanut-wood.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Peat', ' An accumulation of unconsolidated plant debris that if buried and preserved could become coal.  Special conditions are required to accumulate and preserve plant materials.  These conditions are most often found in a marsh or swamp where water cover prevents oxidation and attack by most organisms.', '/c2/tennessee-pearls-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pebble', ' A term used for a sedimentary particle that is between 4 and 64 millimeters in size.  Pebbles are larger than granules but smaller than cobbles.  Pebbles have typically been rounded by abrasion during sedimentary transport.  The photo shows a deposit of pebble-sized sedimentary particles found on the surface of Mars discovered by Mars Rover Curiosity in 2012.  The largest particle in the photo is about one centimeter across.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pediment', 'A broad, gently sloping erosional surface of low local relief adjacent to an eroding cliff or mountain range.  The area is likely covered with sediments.', '/a/gravel.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pegmatite', 'A very coarse-grained igneous rock, normally of granitic composition.  Typically forms during the final states of magma chamber crystallization when the high water content solutions allow rapid crystal growth.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pelagic Sediment', 'An ocean sediment that accumulates far enough from land that detrital materials are a minor component.  These sediments are largely composed of the tiny shell debris of radiolarians and foraminifera.', '/a180/pegmatite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Peles Hair', 'Peles Hair is the name used for hair-like strands of volcanic glass that sometimes form in areas where lava fountaining, lava cascades and vigorous lava activity occur. They are less than 1/2 millimeter in width, but can be up to two meters in length.  They resemble golden-brown human hair in their size, shape and color.  They are a mineraloid formed from basaltic lava. Creative Commons photograph by Cm3826.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Peles Tears', 'Peles Tears are teardrop-shaped pieces of volcanic glass that can form in areas where lava fountaining, lava cascades and vigorous lava activity occur.  They are particles of basaltic lava that erupted into the air and solidifed during their fall back to Earth.  They are often found in association with Peles Hair.', 'https://geology.com/a/peles-hair.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Perched Water Table', 'A water table that is isolated from and higher than the regional water table.  This can occur when a hilltop is underlain by an impermeable rock unit.  Infiltrating waters stack up on the impermeable unit, creating an isolated water table that is higher than the water table of the surrounding land.', 'https://geology.com/a/peles-tears.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Peridot', 'Peridot is a popular green gemstone from the olivine mineral series. It is widely used in commercial jewelry and is a birthstone for the month of August.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Peridotite', 'A dark-colored, coarse-grained igneous rock that is made up mainly of olivine and pyroxene, with very little quartz or feldspar.', '/gemstones/gems/peridot.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Period', 'A unit of geologic time that is longer than an epoch but shorter than an era. From oldest to youngest, Cambrian, Ordovician, Silurian, Devonian, Mississippian, Pennsylvanian, Permian, Triassic, Jurassic, Cretaceous, Tertiary and Quaternary are periods of the geologic time scale,', '/a180/peridotite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Permeability', 'A measure of how well a material can transmit water. Materials such as gravel, that transmit water quickly, have high values of permeability. Materials such as shale, that transmit water poorly, have low values. Permeability is primarily determined by the size of the pore spaces and their degree of interconnection. Permeability measures are expressed in units of velocity, such as centimeters per second, and assume a gradient of one vertical foot of drop per linear foot.', '/a/period.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Petrified Palm', 'Louisiana has been the bayou state for over 100 million years. During that history, many palms have been fossilized. Today they are called petrified palm wood (but they really are not wood) and polished into beautiful gems. ', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Petrified Wood', 'A fossil that is formed when woody material is buried, then dissolved materials in groundwater precipitate to replace and infill the wood structure with silica, opal, or other mineral material. ', '/c2/petrified-palm-wood.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Petrochemicals', 'Organic and inorganic compounds and mixtures that are derived from petroleum.  These include:  organic chemicals, cyclic intermediates, plastics, resins, synthetic fibers, elastomers, organic dyes, organic pigments, detergents, surface active agents, carbon black, and ammonia. ', '/gemstones/gems/petrified-wood.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Petroleum', 'A group of liquid hydrocarbons that includes:  crude oil, lease condensate, unfinished oils, refined products obtained from the processing of crude oil, and natural gas liquids.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('pH', 'A relative measure of the acidity or alkalinity of a water based upon a scale that ranges between 0 and 14 with 7 being neutral. Values of pH below 7 indicate acid solutions and values of pH above 7 indicate basic solutions.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Photomicrograph', 'A thin slice of rock prepared for microscopic examination. It is prepared by gluing a  small cube of rock to a microscope slide and cutting/grinding it to such a thinness that light  will pass through the non-opaque minerals. Then, when observed in reflected and transmitted light using various filters, the mineral and other components of the rock can be identified by a skilled observer. Quantifying the relative abundances of the minerals will  allow the rock to be more specifically named and its history understood. The image here is a photomicrograph of basalt in  polarized light with visible plagioclase (shades of gray) and olivine (orange-yellow-green) crystals visible.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Phreatomagmatic', 'An explosive volcanic eruption initiated by the interaction of magma and water (usually either meteoric or groundwater).', '/a/photomicrograph.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Phyllite', 'A foliate metamorphic rock that is made up mainly of very fine-grained mica. The surface of phyllite is typically lustrous and sometimes wrinkled. It is intermediate in grade between slate and schist.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Physical Weathering', 'A general term applied to a variety of weathering processes that result in the particle size reduction of rock materials with no change in composition.  Frost action, salt crystal growth and pressure relief fracturing, abrasion, are examples.  Also known as mechanical weathering. The photo shows granite pebbles and boulders on the flood plain of a wash where flash floods pick up, carry, and abrade the sediment particles. In the winter the forces of freezing and thawing slowly damage the rocks.', '/a/phyllite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Phytoplankton', 'Microscopic organisms that grow in surface waters and serve as the base of the oceans food chain. Types of phytoplankton include diatoms (pictured), coccolithophores, cyanobacteria, dinoflagellates, green algae, and others.', '/a/physical-weathering.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Phytoplankton Bloom', 'An explosive growth in the number of phytoplankton on the surface waters of an ocean, lake, or other body of water. Phytoplankton are normally present at the waters surface, but when the temperature, sunlight, and water composition are just right, the phytoplankton can multiply exponentially, creating a noticeable blue-green bloom on the water.', 'https://geology.com/a/phytoplankton.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Piedmont Glacier', 'An ice sheet found on the relatively flat land at the base of a mountain range where one or more valley glaciers emerge from the mountain range and spread out over the relatively flat area. The NASA image at left is an enhanced Landsat view of a portion of the Malaspina Glacier of Alaska.', 'https://geology.com/a/phytoplankton-bloom.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pigment Minerals', 'Pigment minerals are  mineral materials   that are mined or collected because they can be used as a pigment. People have been collecting minerals and using them as pigments for about 40,000 years. Hematite is used to produce a wide range of red to reddish-brown pigments. Limonite (a mineraloid) has been used to produce yellow to brown pigments as shown in the photo. Glauconite is used to create green, lazurite for blue, psilomelane for black, cinnabar for red, orpiment for orange, malachite for green, and, barite for white. These are just a few examples of minerals used as pigments. The pigment minerals can be mixed with oil, water and other liquids for use as a paint. They can also be used to give color to plaster, stucco, cosmetics, chalk and similar material.', '/a/piedmont-glacier.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pinfire Opal', 'An opal that exhibits pin points of fire instead of a broad flash is known as pinfire opal.', '/a/pigment-minerals.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Placer Deposit', 'A mass of stream sediment that contains an economically significant concentration of mineral particles.  This concentration of  mineral particles usually occurs when the particles have  a high specific gravity and/or are resistant to weathering.  Gold, cassiterite, magnetite, diamonds, ruby, sapphire, garnet, and many other gemstones can be found in placer deposits.', '/gemstones/gems/pinfire-opal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Plateau Basalt', 'A sequence of  laterally extensive basalt flows, formed over a brief period of geologic time, that now, when eroded, can produce a landscape of terraces and plateaus.  They often form plateaus such as the one seen in the distance in the photo, a view of the Columbia River basalts of Washington.', '/a/placer-deposit.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Play-of-Color', 'A display of spectral colors produced with light passing through a gemstone encounters a regular pattern of tiny spheres, layers or other structures that diffract the light into its component colors.  Opal is especially well-known for its play-of-color in which an observer can move the stone under a source of light and see the colorful flashes as the angle of light in the stone is changed.  The colors will also change if the observers eye moves or if the source of the light is moved.  It is this play-of-color that defines precious opal.  Without that display of color the opal is common.', '/a/basalt-flows.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pleochroism', 'A change of a gems body color when it is viewed from different crystallographic directions.  As an example, if you have a crystal of transparent iolite, hold it between your eye and a source of light and rotate the stone through 360 degrees, the color of the stone will change with every 90 degrees of rotation.  The color of the specimen depends upon the angle of observation.  When pleochroic stones are faceted or cut en cabochon, the cutter must be knowledgeable of the pleochroic characteristics of the stone so it can be oriented in a way that shows optimal color to the observer.', '/c/180-opal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Plinian Eruption', 'An explosive eruption where large volumes of rock, ash and gas are blasted at high velocity from a vent. These eruptions produce huge clouds that can rise tens of kilometers into the atmosphere.', '/gemstones/gems/iolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Point-Source Pollution', 'Water contamination that can be traced to a single point. A toxic material spill and a sewage discharge pipe are examples of point sources.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Polarity Epoch', 'An interval of time between reversals of Earths magnetic field.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Polarity Event', 'A specific event in the history of Earths magnetic field.  Usually used in reference to a specific polarity reversal.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Polarity Reversal', 'A change in the polarity of Earths magnetic field in which the north magnetic pole becomes the south magnetic pole and vice versa.  Also known as geomagnetic reversal or magnetic reversal.  Earths magnetic field has reversed many times in the past and the time intervals between these changes are known as polarity epochs.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Porosity', 'The volume of pore space in a rock, sediment or soil. Usually expressed as a percentage. This pore space can include openings between grains, fracture openings and caverns.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Potable Water', 'Water that is of adequate quality for drinking.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pothole', 'A cylindrical or hemispherical hold in the bedrock of a stream that is formed from the continual swirling motion of sand and gravel by swirling currents.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('PPM', 'An abbreviation for parts per million.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Precious Opal', 'An opal that produces flashes of iridescent color when moved under incident light. The color display is known as play-of-color. Some examples of precious opal: black opal, boulder opal, crystal opal, pinfire opal, and white opal.Opals that do not show play-of-color are called common opal.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Precious Stones', 'Precious stones is a name that is usually used in reference to four types of gems: diamonds, rubies, sapphires, and emeralds. Some people have included opal, jade, or pearls in the precious stones class, but these have not received persistent and widespread use. Gems that are outside of the precious stones class are referred to as semiprecious stones.  These classifications of gemstones became popular in the 1800s, and most members of the gems and jewelry industry have used them.  Today many people believe that the use of the term semiprecious is derogatory because any material worthy for use as a gemstone should be considered as precious.', '/c/180-opal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Precipitation', 'Movement of water from the atmosphere to the land or to a surface water body. Rain, hail, snow, dew, and sleet are all examples of precipitation.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Prehnite', 'Prehnite is a calcium aluminum silicate mineral. Specimens with nice color and clarity are often cut as gems. This gemmy yellow prehnite cabochon was cut from material mined in Australia.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Primary Recovery', 'Any crude oil or natural gas that is recovered from a well as a result of the natural pressure within the reservoir.', '/gemstones/gems/prehnite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Primary Seismic Waves', 'The fastest set of earthquake vibrations - also known as P-waves.  They move through the Earth in  compression and expansion motions (much like sound waves move through air).  Called primary because they are the first recorded at a seismograph. Primary waves are able to travel through both solids and liquids.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Prospecting', 'The activities associated with the search for an area of probable mineralization.  It can include: topographical, geological, geochemical and geophysical studies. Prospecting is usually done prior to the acquisition of mineral rights.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Proton', 'A subatomic particle, contained in the nucleus of an atom.  It has a positive electrical charge and a mass similar to that of a neutron.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Proto-Sun', 'An intermediate stage in the development of a star in which a large cloud of dust and gases gradually condenses through gravitational actions.', '/a/atom.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Proven Reserves', 'Mineral deposits that have been explored thoroughly enough to be quantified but which are still in the ground.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pumice', 'A vesicular volcanic glass of granitic composition.  It has so many vesicles that it has a very low specific gravity - sometimes low enough to float on water.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pumpjack', 'A pump  used on an oil well when there is not enough bottom hole pressure to push the oil to Earths surface. The pumpjack is a mechanical device that converts the rotary action of a motor to a lifting action needed for a reciprocating piston pump. They can be powered by electricity but where that is not available, gasoline, diesel, propane and natural gas are used.  ', '/a180/pumice.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Purpurite', 'Purpurite is a manganese phosphate mineral with a bold purple color that is often cut into cabochons. It has a low hardness (4 to 5) so is best used in jewelry that is not expected to receive rough wear. ', '/a/pumpjack.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('P-wave', 'Primary seismic waves.  The fastest set of earthquake vibrations.  They move through the Earth in  compression and expansion motions (much like sound waves move through air).  Called primary because they are the first recorded at a seismograph. Primary waves are able to travel through both solids and liquids.', '/gemstones/gems/purpurite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pyroclastic', 'The word pyroclastic is an adjective used for volcanic clasts that are  blown from a volcanic vent. Rocks and rock materials of a volcanic origin are also called pyroclastics.', '/a/earthquake-waves.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pyroclastic Flow', 'A hot, high-velocity mixture of ash, gas and fragmented rock that flows like a liquid down slopes and over terrain.', '/a/pyroclastic.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pyrope', 'Pyrope is a magnesium aluminum garnet that is usually red in color. It is often formed in the mantle and transported to the surface in deep-source volcanic eruptions that form diamond deposits.', '/a/blank.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Pyroxene', 'Pyroxenes are members of a group of rock-forming minerals found in igneous and metamorphic rocks throughout the world.  They are single-chain silicate minerals with a generalized chemical composition of XYSi2O6, where X can be Ca, Na, Fe++, Mg, Zn, Mn, or Li and Y can be Mg, Fe+++, Fe++, Cr, Al, Co, Mn, Sc, Ti, or Vn.  They are important constituents of dark-colored igneous rocks such as gabbro, basalt, and peridotite.  Some of the best-known pyroxene minerals include augite, diopside, jadeite and spodumene.', '/gemstones/gems/pyrope.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Quadrangle (Quad)', 'In geometry: a four-sided plane figure such as a square or a rectangle. In geology: an area shown on a standard topographic map sheet published by the United States Geological Survey. The boundaries of the maps are usually lines of longitude and latitude.', '/a/quadrangle.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Quake', 'A slang term used in place of the word earthquake. The word quake is normally used for small earthquakes that do not cause damage.', '/a/quake.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Quarry', 'A surface mine usually operated to produce  crushed stone for the construction industry, such as limestone, granite, sandstone, or trap rock.', '/a/quarry.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Quartz', 'One of the most abundant minerals in the Earths crust. Has a chemical composition of SiO2. Quartz is the index mineral for a hardness of seven on the  Mohs hardness scale.  Occurs in sedimentary, metamorphic, and igneous rocks. Several gemstones are composed of quartz. These include rose quartz, smoky quartz, amethyst, and others.', '/gemstones/gems/quartz.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Quartz Arenite', 'A sandstone consisting of at least 95% quartz. They are thought to attain this very high quartz content because they have been recycled. During the first depositional cycle, they were deposited as impure sands containing quartz, feldspars, micas, and other minerals. Then, in the second cycle, the additional transport and weathering destroyed what remained of the less durable, non-quartz fraction, leaving a nearly pure quartz sand as the residual.', '/a/quartz-sandstone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Quartzite', 'A metamorphic rock formed by the alteration of sandstone by heat, pressure, and chemical activity. The metamorphism often exerts enough pressure to weld the original quartz sand  into a polycrystalline mass.', '/a180/quartzite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Quartzose', 'An adjective used in reference to a sedimentary rock that is composed primarily of quartz.', '/a/quartz-sandstone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Quaternary Period', 'The most recent  period of geologic time that begins about 2.588 million years ago and extends to the present. It follows the Neogene Period and is divided into the Pleistocene (2.588 million years ago to 11.7 thousand years ago) and the Holocene (11.7 thousand years ago to present).', '/a/quaternary.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Quick Clay', 'Clay-sized particles, often of quartz and feldspar, but sometimes of  clay, that lose their strength, collapse, and behave like a fluid when  disturbed by vibrations or placed under load. They are mostly found in glaciated areas of the northern hemisphere. Quick clays are often involved with landslides, and they are often the material of failure in landslides that flow over very gentle slopes.', '/a/quick-clay.png');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Quicksand', 'A bed of sand that has a high water content.  The water within the sand is often flowing through the spaces between the sand grains.  This creates a soft, fluid-like material that yields easily to pressure and in which heavy objects will sink. People and animals have been known to perish in quicksand. Creative commons photo by Ralf Schulze.', '/a/quicksand.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Quicksilver', 'A nickname for the element mercury.', '/a/mercury-liquid.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Radial Drainage', 'A drainage pattern in which stream channels run away from a central high point such as a volcano or dome. The image show radial drainage on Cerro Culiacan, a volcano in west central Mexico.', '/a/radial-drainage.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Radioactive Decay', 'The process through which a radioactive isotope spontaneously transforms into a new substance (the daughter isotope) along with a release of heat.', '/a/radioactive-decay.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Radiolarians', 'Microscopic (0.1 to 0.2 millimeter) single-celled marine animals with  siliceous skeletons that live in  shallow portions of the oceanic water column.  Radiolarians have a range from Cambrian to present. They are found as zooplankton in many parts of the worlds oceans.  When carbon dioxide concentrations are high their siliceous skeletons are soluble', '/a/radiolarians.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Radiolarian Ooze', 'A deep-sea pelagic sediment that contains at least 30% siliceous radiolarian remains. The radiolarians live in shallow portions of the oceanic water column, when they die their siliceous skeleton sinks. Where the abundance of radiolarian debris is high enough a radiolarion ooze is found on the seafloor below.', '/a/radiolarians.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Radiolarite', 'Radiolarite is a sedimentary rock that forms from the accumulation of microscopic radiolarian tests and is thus of organic origin. Some geologists also consider it to be a mineraloid. The specimen in the photo is from the Windalia Radiolarite, a rock unit that formed on a marine shelf in an area that is now part of the Kennedy Ranges of Western Australia. It can be cut and polished to a high luster and used as a gemstone. It is  known in the gem trade as mookaite.', '/a/radiolarite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rating Curve', ' A plot that shows the relationship between the stage and discharge (streamflow) of a specific stream at a specific location. It is customary to plot stream stage on the y-axis of the plot and discharge on the x-axis.  The resulting relationship is normally a curve.   Rating curves can be used to estimate discharge (which is time consuming and expensive to measure) using a single stage measurement (which  can be collected with automatic equipment). The principle of a rating curve enables hydrologists to monitor the discharge of many streams simultaneously once gages have been placed to collect and report the stage of the stream.', '/a/rating-curve.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Reaction Series', 'A series of interactions between a melt and mineral crystals in contact with the melt.  In a reaction series the first formed crystals (highest temperature minerals) react with the melt to produce a new mineral.', '/a/reaction-series.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Recharge', 'The addition of water to an aquifer or other water body. An aquifer  is recharged by precipitation in an area where the aquifer has a  porous connection to the surface. Precipitation, snow melt and stream infiltration are common methods of recharge.', '/a/recharge.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Recharge Area', 'The geographic area where water infiltrates into the ground and enters an aquifer.', '/a/recharge-area.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Recrystallization', 'A solid state reaction in which the atoms of existing crystals within a rock are reorganized in response to heat and/or pressure.  The recrystallized mineral grains are typically larger in size than the original crystals. The photomicrograph is of a metamorphic rock in which feldspar grains have been recrystallized, as evidenced by their straight grain contacts.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rectangular Drainage', 'A drainage pattern in which stream channels develop within a large-scale network of intersecting joints. This drainage pattern is characterized by right-angle bends in the channels of streams and streams that intersect at right angles.', '/a/recrystallization.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Recumbent Fold', 'A recumbent fold  has an axial surface that is nearly horizontal. One of the limbs will have strata that is overturned.', '/a/rectangular-drainage.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Redrilled Well', 'A previously drilled hole that is reentered and deepened by additional drilling. In some shale formations a contractor arrives and drills a vertical well to the kickoff point. Later, another contractor arrives to drill the horizontal leg of the well and frack the well.', '/a/recumbent-fold.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Refraction', 'The bending of a seismic wave as it enters a material of different density, or, the  bending of a beam of light as it enters a material of different refractive index.  In the image, a beam of light travelling through air strikes a piece of glass, as the light enters the piece of glass it bends (refracts) towards the denser medium (the glass). As the light exits the glass, it again bends towards the denser medium (the glass). This bending of light is known as refraction.', '/a/well-drilling.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Regional Metamorphism', 'Metamorphism across a broad geographic area caused by the elevated temperatures and pressures of plate collision or deep burial. This type of metamorphism usually occurs at continental margins.', '/a/refraction.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Regolith', 'A general term used in reference to unconsolidated rock, alluvium or soil material on top of the bedrock. Regolith may be formed in place or transported in from adjacent lands. The term is used for the surface material of Earth, Moon, Mars and other planets. Shown in the photo is a footprint in lunar regolith from the Apollo 11 mission.', '/a/regional-metamorphism.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Regression', 'A retreat of the sea from land areas.  Possible causes include a drop in sea level or uplift. In response, the shoreline moves seaward, exposing the coastal plain to erosion. ', '/a/regolith.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Relief', 'Variations in the height and slope of Earths surface. Also used in reference to the vertical difference between the highest and lowest elevations of an area.  The image is a small relief map of the Appalachian, Blue Ridge and coastal plain portions of Virginia, West Virginia, Maryland and Delaware.', '/a/regression.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Remote Sensing', 'The collection of information about an object or area from a distance, frequently using data obtained from satellites, aircraft or underwater vehicles.  Some of the many methods employed include: photography, radar, spectroscopy and magnetism.', '/a/relief.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Replacement', 'The dissolving or disintegration of one material followed by precipitation of a new material in its place.  Often an important step in the fossilization process. The photo shows logs of petrified wood from the Chinle Formation of Arizona. The cell walls in the wood were replaced and infilled by chalcedony.', '/a/remote-sensing.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Reservoir', 'A subsurface rock unit that is porous and permeable, and that contains an accumulation of oil and/or natural gas. The image shows an anticline serving as a reservoir structure for oil and natural gas.', '/a/replacement.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Retrograde Metamorphism', 'Mineral changes within a rock that are caused by adjustments to conditions of reduced temperature and pressure.', '/c/180-oil-gas-investments.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Reverse Fault', 'A fault with vertical movement and an inclined fault plane. The block above the fault has moved upwards relative to the block below the fault. Reverse faults are the typical structural style of convergent plate boundaries and portions of the crust that are under compression. Also known as a thrust fault.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rhodolite Garnet', 'Rhodolite is a purplish red to violet-red variety of garnet that is a combination of pyrope and almandine. It often has wonderful color and clarity at a relatively low cost - and that is helping it become popular in jewelry.', '/a/reverse-fault.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rhodochrosite', 'Rhodochrosite is a manganese carbonate mineral that is popular because of its beautiful pink color. It is typically has lacy or concentric bands. Its softness limits its use to earrings, pendants, pins and other low-abrasion items.', '/gemstones/gems/rhodolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rhodonite', 'Rhodonite is a manganese mineral that sometimes occurs in a very attractive pink color. Usually translucent-to-opaque, it is a popular gem material. Rarely, it is transparent and used for faceting.', '/gemstones/gems/rhodochrosite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rhyolite', 'The fine-grained volcanic or extrusive rocks that are equivalent in composition to granite.  Normally white, pink or gray in color.', '/gemstones/gems/rhodonite-cabochon.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Richter Magnitude Scale', 'A scale that is used to compare the strength of earthquakes based upon the amount of energy released.  The scale is logarithmic and an arbitrary earthquake was used as a starting point for creating the scale.  As a result it is a continuous scale with no upper limit and negative numbers possible for very small earthquakes.  An upper limit of approximately 9.0 is suspected as Earth materials will most likely fail before storing enough energy for a larger magnitude earthquake.', '/a/rhyolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ridge (Mid-Ocean)', 'An elevated area of the sea floor in the center of an ocean basin with rugged topography, a central rift-valley and recurring seismic activity.  Ridges generally stand about 1000 meters to 3000 meters above the adjacent ocean floor and are about 1500 kilometers in width.', '/a/richter-magnitude.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rift Valley ', 'A valley bounded by normal faults that has formed in an area of crustal extension such as a divergent plate boundary. The East Africa Rift is the worlds most famous example of an area with rift valleys.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Right-Lateral Fault', 'A fault with horizontal movement.  If you are standing on one side of the fault and look across it, the block on the opposite side of the fault has moved to the right.  (Also see Left-Lateral Fault.)', '/a/rift-valley.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rip Current', 'A strong, narrow current of high velocity and short duration that flows seaward through the breaker zone.  Caused when a buildup of water pushed onto the beach by winds and waves returns seaward.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ripple Marks', 'A series of parallel or sub-parallel  ridges in sand or sediment that is caused by the rhythmic or directional movement of  wind or water.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rock Cycle', 'All rock at or near Earths surface is being modified by the processes of metamorphism, melting, crystallization, lithification and weathering.  These processes move rock material through the states of metamorphic rock, igneous rock, sedimentary rock, melts and sediment.  The natural and continuous cycling of rock materials through these states is known as the rock cycle.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rockfall', 'A sudden downward movement of rock from a steep slope or cliff. The falling rock might have separated from the outcrop along fractures, joints or bedding planes. Movement occurs by free-fall, bouncing or rolling. Falls are often triggered by interstitial ice or water. Shown in the photo is a large rockfall in Yosemite National Park photographed by Herb Dunn.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rock Flour', 'Finely pulverized rock material of silt or smaller size produced by abrasion at the base of a glacier.', '/c/180-yosemite-rockfall.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rock Glacier', 'A mass of rock material, cemented together by ice, that flows down a slope under the force of gravity much like the motion of an ice glacier. Rock glaciers often head in a cirque and may have no visible ice at the surface. Most often seen in the same parts of the world where ice glaciers are abundant. The image is a view of a rock glacier near McCarthy, Alaska by the National Park Service, Wrangell-St. Elias National Park and Preserve.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rock Salt', 'A chemical sedimentary rock that forms from the evaporation of ocean or saline lake waters. It is also known by the mineral name halite. It is rarely found at Earths surface, except in areas of very arid climate. It is often mined for use in the chemical industry or for use as a winter highway treatment. Some halite is processed for use as a seasoning for food.', '/a/rock-glacier.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rock Tumbler', 'A machine used to smooth and polish rocks. They are a popular tool used by jewelry, craft and lapidary hobbyists in the production of tumble-polished stones.', '/a/halite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rockslide', 'A type of mass wasting in which  rock debris detaches and slides down a slope under the influence of gravity. The movement usually occurs over a planar surface such as a bedding plane, joint surface or fault plane. The moving mass can break apart during transport or remain in a large mass.', '/a/rock-tumbler.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Roiled\r\n      ', 'Water that has been disturbed and is carrying suspended material, reducing its clarity. The word is often used in reference to lake water that has been muddied by a stream carrying in a load of suspended sediment. Also known as turbid. The photo shows a heavy plume of suspected sediment entering Lake Tuscaloosa in Alabama.', '/a/rockslide.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rose Quartz', 'Rose quartz is a translucent-to-transparent variety of quartz with a light to deep pink color. It is a gem material that is very common in nature. It is usually cut into cabs and occasionally faceted.', '/a/turbid.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rotational Slide', 'Also known as a slump. A slide in which the surface of rupture, or slip plane, is curved concave upward and   the slide movement is roughly rotational instead of translational.  ', '/gemstones/gems/rose-quartz.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Roughneck', 'Roughneck is a slang term for an oil field worker who does hard manual labor on the floor of a drilling rig. Much of their work is the repetitive manipulation of drill pipe as the well is being drilled and when all of the pipe must be pulled to change the bit. They do any other work as required to keep the drilling progress moving. They must be strong, physically fit enough to work long hours, willing to get extremely greasy and dirty, and work outdoors in all types of weather throughout the year. ', '/a/rotational-slide.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Roustabout', 'Roustabout is  oil field slang for a person who does any low-skill job needed at a drilling site. This work might include equipment maintenance, mowing, painting, errands, cleaning, and whatever is needed to keep the rig operating and the drilling moving forward. All of this is done outdoors, in all types of weather, throughout the year. The roustabout might occasionally work on the drilling floor with the roughnecks and move up to the position of roughneck if skill and physical abilities allow. ', '/a/roughneck.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ruby', 'Ruby is the most popular colored stone. When the mineral known as corundum is of gem quality and a vivid red color, it is called ruby. Historically mined in Asia, many rubies such as these are now being found in Africa.', '/a/roustabout.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ruby in Fuchsite', 'Fuchsite is a metamorphic mica with a green color that often contains bright red corundum crystals or rubies. It is often carved and cut into cabochons. Frequently confused with ruby in zoisite.', '/gemstones/gems/ruby.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ruby in Zoisite', 'Ruby in zoisite is an interesting material. Massive green zoisite often contains bright red ruby crystals. The color combination makes an attractive and unique gem material. It is often cut and carved into small sculptures.', '/gemstones/gems/ruby-in-fuchsite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Runoff', 'Liquid water moving over the land surface as a sheet or channelized flow. The portion of precipitation that moves over the ground instead of evaporating or infiltrating.', '/gemstones/gems/ruby-in-zoisite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rupture Strength', 'The maximum amount of stress that a brittle material can sustain without failure.', '/a/runoff.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Rutilated Quartz', 'Rare specimens of clear quartz have needle-shaped inclusions of rutile. These can be used to cut interesting and attractive cabochons and faceted stones.', '/a/rupture-strength.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Saline Lake, Salt Lake', 'An inland lake in an arid area that is fed by local run off and has no discharge point.  It loses water by evaporation and thus, dissolved solids carried into the lake do not escape the basin and become highly concentrated. Examples include Great Salt Lake and the Dead Sea. The photo shows Mono Lake of California. The white concentric rings around the lake are salt deposits left when water levels were higher. ', '/a/saline-lake.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Saltation', 'The transport of sediment in short jumps and bounces above the stream bed or ground by a current that is not strong enough to hold the sediment in continuous suspension.  (See suspension and traction for comparison.)', '/a/saltation.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Salt Glacier', 'A mass of salt on land that deforms and flows down slope under its own weight - similar to the movement of an ice glacier. This movement is  possible because of the plastic properties of salt - salt is able to deform and flow. Because salt is soluble, salt glaciers are only found in arid areas. The salt glacier in the image is located in the Zagros fold belt of Iran where a  salt dome  has broken through Earths surface. The salt dome penetrated at the crest of a ridge and the salt is flowing down both flanks of the ridge. ', '/c2/salt-glacier-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Salt Marsh', 'A marsh along a coastline that receives an inflow of ocean water during high tide and is populated by salt-tolerant vegetation. Also known as a tidal marsh. The photo is of a marsh in the Plum Island Estuary that researchers believe will be submerged this century as sea levels rise.', '/a/tidal-marsh.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Salt Water or Saltwater ?', 'These words refer to water that is not fresh water. Salt water contains a high concentration of dissolved sodium chloride.\r\nWhen written as 2 words, the word salt is an adjective used to describe the noun water. For example, The Earths oceans and seas contain salt water.\r\nWhen written as a single word, saltwater is an adjective used to describe a noun that follows it, as in saltwater crocodile.', '/a/salt-water.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sand Dollar', 'Sand dollars found on beaches today are remains of a group of animals that has lived in the oceans for millions of years. Their bodies are often agatized by nature and then found by people who polish them into gems.', '/gemstones/gems/sand-dollar.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sandstone', 'A sedimentary rock composed of sand-sized particles (1/16 to 2 millimeters in diameter).', '/a/sandstone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sapphire', 'Sapphire is a gem variety of the mineral corundum. When it is reddish blue to violet-blue, it is known simply as sapphire. Corundums of any other color (except red, which is ruby) are known as fancy sapphires.', '/gemstones/gems/sapphire.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sardonyx', 'Sardonyx is a member of the chalcedony family. It is a banded agate that contains bands of bright red alternating with agate of other colors.', '/gemstones/gems/sardonyx.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Scapolite', 'Scapolite is a metamorphic mineral that sometimes occurs in transparent gem-quality crystals that make beautiful faceted gems. Some specimens contain a silk that can produce a strong cats eye.', '/gemstones/gems/scapolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Scarp', 'An exposed face of soil above the head of a landslide. It is also an exposure of the slip plane or surface of rupture. Scarps are one of the first obvious and easy-to-recognize signs that a slide is in progress.', '/a/landslide-anatomy.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Schist', 'A metamorphic rock containing abundant particles of mica, characterized by strong foliation, and originating from a metamorphism in which directed pressure plays a significant role.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Schistosity', 'The parallel arrangement of platy or prismatic minerals in a rock that is caused by metamorphism in which directed pressure plays a significant role.', '/a180/schist.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Scoria', 'An igneous rock of basaltic composition and containing numerous vesicles caused by trapped gases.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sea-Floor Spreading', 'The process that occurs at mid-ocean ridges in which convection currents below pull the plates apart and create new sea floor.', '/a180/scoria.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Seamount', 'A mountain on the sea floor that has at least 1000 meters of local relief.  Most seamounts are shield volcanoes. Seamounts with a flat top produced by wave erosion are known as guyots. Shown in the image is the Bear Seamount of the North Atlantic Ocean about 200 miles east of Woods Hole, Massachusetts.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sediment', 'A loose, unconsolidated deposit of  weathering debris, chemical precipitates or biological debris that accumulates on Earths surface.', '/a/guyot.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sedimentary Rock', 'A rock formed from the accumulation and consolidation of sediment, usually in layered deposits.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sedimentary Structure', 'A structure in a sedimentary rock that forms at or near the time of deposition and reveals information about the depositional environment.  Examples include: ripple marks, cross-bedding, mud cracks, and graded bedding.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sedimentation', 'The process of sediment deposition from out of a suspension or solution.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Seepage', 'The slow movement of water through the pore spaces of a solid material. This term is also applied to a loss of water by infiltration through the bottom of a stream, canal, irrigation ditch, reservoir or other body of water.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Seif Dune', 'A large sand dune that forms parallel to the direction of a strong wind that blows in a consistent direction throughout the year.  Also called a longitudinal dune.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Seismic Discontinuity', 'A surface separating rocks that transmit seismic waves at different velocities.', '/a/dune.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Seismicity', 'The study of the worldwide distribution of earthquakes and crustal movement over time and the probability of an earthquake occurring in a specific location.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Seismic Wave', 'A generic term for the numerous types of waves that are produced by an earthquake and travel through the earth. Depending upon the intensity, depth and location of the earthquake these vibrations might or might not be felt at the surface by people. ', '/a/seismicity.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Seismogram', 'A paper, film or digital recording of an earthquakes vibrations that is produced by a seismograph.', '/a/richter-magnitude.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Seismograph', 'The study of the worldwide distribution of earthquakes over time and the probability of an earthquake occurring in a specific location.', '/a/richter-magnitude.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Semiprecious Stones', 'Semiprecious stones is a name used for all varieties of gemstones that are not categorized as precious.  Semiprecious stones are any gemstones other than diamond, ruby, sapphire, or emerald that are suitable for being used in personal adornment. These classifications of gemstones became popular in the 1800s, and most members of the gems and jewelry industry have used them.  Today many people believe that the use of the term semiprecious is derogatory because any material worthy for use as a gemstone should be considered as precious.', '/a/seismograph.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Septarian', 'Septarian is a name used for round concretions with internal mineral-filled fractures found in sedimentary rocks. They are often cut into cabochons that display the interesting geometry of the fracture network.', '/a/semiprecious-stones.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Seraphinite', 'Seraphinite is a trade name used for a gem material composed of the mineral clinochlore. It is usually greenish in color and marked with fibrous or feather-like patterns. Its hardness is only 3 to 4 and is reserved for delicate use.', '/gemstones/gems/septarian.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Serpentine', 'A silicate mineral, that occurs in a wide range of green and greenish colors with interesting patterns that is often cut into cabochons or used as an ornamental stone.', '/gemstones/gems/seraphinite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Service Well', 'A well drilled to support production from other wells.  Some reasons for support wells are:  gas injection, water injection, steam injection, salt water disposal, water supply, observation, or combustion air injection.', '/gemstones/gems/serpentine.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Settling Pond', 'An open pond where runoff, waste or process water is allowed to stand while suspended materials settle out. Settling ponds are common at surface mines, drilling sites, landfills, construction sites, industrial facilities and many other locations.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Shale', ' A clastic sedimentary rock that is made up of clay-size (less than 1/256 millimeter in diameter) weathering debris. It typically breaks into thin flat pieces.', '/a/settling-pond.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Shield Volcano', ' A broad volcano with a very gentle slope that has been built up by many successive flows of low viscosity lava, usually of basaltic composition. The Hawaiian Islands are the best-know example of shield volcanoes.', '/a180/shale.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Short Ton', 'A unit of weight that equals 2,000 pounds.', '/a/shield-volcano.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Shut In', 'An oil or gas well that is capable of production but which is temporarily closed. The most common reason for a well to be shut-in is a lack of pipeline capacity or lack of access to markets. In some cases a lessee might drill a well to fulfill a lease commitment and then shut the well in until pipeline capacity or a favorable sales contract is available. This is often a strategy to lock-in the lease without additional cost. Shut-in wells can also be closed for maintenance. The image shows the map symbols for shut in oil wells (left) and gas wells (right). ', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Siderite', 'Siderite is an iron carbonate mineral with a very high dispersion. Transparent crystals of siderite with great clarity can be cut into attractive gemstones with a strong fire. It is too soft for most jewelry and is a collectors stone.', '/a/shut-in-wells.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Signing Bonus', 'Money paid to a mineral rights owner in exchange for granting a lease.  This payment may be in addition to rental or royalty payments.', '/gemstones/gems/siderite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sill', 'A subsurface igneous rock body that is tabular in shape and has intruded between layers of the sedimentary or metamorphic country rock. A sill might branch off of a dike, a volcanic pipe, or any other intrusive rock unit.', '/a/dollar.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sillimanite', 'Sillimanite is a metamorphic mineral that often has a fine fibrous silk. When properly cut, cabochons of the material can reflect a sharp cats eye.', '/a/sill.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Siltstone', 'A clastic sedimentary rock that forms from silt-size (between 1/256 and 1/16 millimeter diameter) weathering debris.', '/gemstones/gems/cats-eye-sillimanite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Silver', 'Silver is a precious metal that is often present as visible crystals in its ore. Some people enjoy seeing the bright metal reflecting from the surface of a cabochon. It is a novelty gem.', '/a/siltstone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sinkhole', 'A depression in the land surface that results from the collapse or slow settlement of underground voids produced by solution weathering. The rock being dissolved is normally limestone but can also be salt, gypsum or dolostone. The photo shows a sinkhole that formed near Frederick, Maryland.', '/gemstones/gems/silver-ore.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Skarn', 'Skarn is rock that has been metamorphosed by contact with hot, chemically-active fluids released from a nearby magma source.  It is usually rich in calc-silicate minerals and members of the garnet and pyroxene groups.', '/a/sinkhole.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Slate', 'A foliated metamorphic rock that is formed through the metamorphism of shale. It is a low grade metamorphic rock that splits into thin pieces.', '/a/skarn.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Slip Plane\r\n      ', 'The surface of failure below a landslide (often called the surface of rupture). The moving mass of the slide travels over the slip plane.', '/a180/slate.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Slump', 'Also known as a rotational slide. A slide in which the surface of rupture, or slip plane, is curved concave upward and   the slide movement is roughly rotational instead of translational.  ', '/a/landslide-anatomy.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Smithsonite', 'Smithsonite is a zinc carbonate mineral that serves as a minor ore of zinc and as a minor gem mineral. It is relatively soft and used as a collectors gem and in jewelry that is unlikely to receive abrasion or impact.', '/a/rotational-slide.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Smoky Quartz', 'Smoky quartz is a grayish brown to nearly black variety of transparent quartz. It is often cut as a faceted stone or cabochon. Upon heating, it will sometimes change in color to yellow or yellowish brown citrine.', '/gemstones/gems/smithsonite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sodalite', 'A feldspathoid mineral that ranges in color from white to blue to violet blue. It is often used to make cabochons, tumbled stones and other lapidary projects.', '/gemstones/gems/smokey-quartz.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Soft Water', 'Water that does not contain significant amounts of  dissolved calcium and magnesium ions that can interfere with the performance of many  soaps and detergents. These dissolved substances are also not present to  leave a scaly deposit in containers where it is heated or evaporates (although other dissolved substances might leave such deposits).', '/gemstones/gems/sodalite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Solution', 'A chemical weathering process in which a material is dissolved.  Also, the transport of dissolved ions by the water of a stream.', '/a/soft-water.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Spectrolite', 'Some specimens of gem-quality labradorite have exceptional color and labradorescence. These unusual gems are given the name spectrolite because of the spectrum of colors that they reflect', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Spessartine Garnet', 'Spessartine is also known as spessartite or as mandarin garnet because of its yellow-orange to orange-red color. It is a popular variety of garnet used in jewelry.', '/gemstones/gems/spectrolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sphene', 'Sphene, also known as titanite, is a gem with a dispersion higher than diamond. Specimens of high clarity can be cut into gems with a brilliant fire. Its softness limits its use to earrings, pins, pendants, and low-abrasion jewelry pieces.', '/gemstones/gems/spessartite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Spinel', 'A mineral of many colors that has been treasured as a gem for thousands of years. It was often confused with ruby and sapphire. Many of these errors were not discovered until the 20th century.', '/gemstones/gems/sphene.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Spring', 'A geographic location where groundwater naturally discharges onto Earths surface or into a body of surface water such as a swamp, river,  lake, sea or ocean.', '/c2/spinel-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Spring Tide', 'A daily tidal range of maximum amplitude that occurs when the earth, moon and sun are in alignment with one another.  In this moon-earth-sun configuration, the gravitational attraction of the moon and sun work together to pull  Earths water into two bulges on opposite sides of the Earth.  Occurs at the second and fourth quarters of the moon.  See neap tide for contrast.', '/a/spring.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Stage', 'A measured height of water above an arbitrary reference datum. Frequently used to describe the height of water in a stream, lake, well, canal or other water body. Stage and gage height are equivalent words, with stage being more commonly used by the public. Gage height is usually measured at a gaging station.', '/a/spring-tide.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Star Dunes', 'Radial shaped sand dunes with three or more arms. They form in areas where there is no dominant wind direction and wind blows from many different directions. They tend to accumulate upwards instead of moving laterally. This enables them to become some of the tallest dunes in the world.', '/a/gage-height.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Stock', 'A relatively small igneous intrusion that forms when magma crystallizes underground. Although uplift and/or erosion can later unearth part of a stock, this feature is defined as having less than 40 square miles (100 square kilometers) exposed at the surface.', '/a/star-dunes.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Storage Well', 'A well where natural gas, crude oil, helium or another fluid is injected into temporary underground storage. In some areas the winter demand for natural gas for space heating is enormous but the pipeline capacity into that area is limited. So, all summer, natural gas will flow in from the producing area, injected underground and then withdrawn during the winter heating system. The image is the map symbol for a natural gas storage well.', '/a/stock.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Storm Sewer', 'A sewer system that collects surface runoff instead of waste water. These two types of water are kept separate because they require different processing before release to the environment.', '/a/gas-storage-well.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Storm Surge', 'The piling up of water along a shoreline cause by the sustained winds of a strong storm - usually a hurricane.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Strain', 'A change in the volume or shape of a rock mass in response to stress.', '/cover/storm-surge.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Strata', 'A generalized term used in reference to a group of rock layers. Strata when plural, stratum when singular. These layers can be distinguished from layers above them and below them by differences in mineral composition, grain size, color, fossil content, grain orientation or other characteristic. The image is from William Smiths 1815 Geological Map of England and Wales and Part of Scotland.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Stratification', 'A layered structure of sedimentary and other types of rocks  in which the individual layers can be recognized and traced laterally because they differ in  composition, color, grain size, fossil content, grain orientation or other observable characteristic.', '/a/strata.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Stratified', 'A material that has been deposited in layers. Many types of processes can produce stratified deposits. These include: clastic sedimentation, chemical sedimentation, biological sedimentation, ashfalls, lava flows, pyroclastic flows, landslides, asteroid impacts and others. Shown in the image is a sequence of stratified tuff accumulated near the Mount St. Helens eruption.', '/a/stratified-tuff.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Stratigraphic Column', 'A diagram that shows the vertical sequence of rock units present beneath a given location with the oldest at the bottom and youngest at the top.  They are typically drawn to approximate scale with proportional rock unit thicknesses.  Colors and standardized symbols are usually added to graphically communicate rock types and some of their more important features.  Geologic columns prepared for regions will have generalized thicknesses and rock unit features that show relationships that change over distance.', '/a/stratified-tuff.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Stratigraphic Sequence', 'The sequence of sedimentary rock layers found in a specific geographic area, arranged in the order of their deposition.', '/a/geologic-column.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Stratigraphy', 'The study of sedimentary rock units, including their geographic extent, age, classification, characteristics and formation.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Stratovolcano', 'A volcanic cone made up of alternating layers of lava flows and pyroclastics. Also known as a composite cone. Most of the volcanoes in the Cascades Range are stratovolcanoes.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Streak', 'The color of a mineral in powdered form.  Streak is normally determined by scraping a specimen across a surface of unglazed porcelain known as a streak plate.', '/a/composite-cone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Streak Plate', 'A piece of unglazed porcelain that is used for determining the streak of a mineral specimen.', '/a/streak-plate.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Stream Order', 'A classification system that represents the relative position of streams in a drainage basin.  The highest tributaries in the basin are first order streams.  These converge to form second order streams, which have only first order streams as their tributaries.  Third order streams form by the confluence of two second order streams.  The numbering system continues downstream resulting in higher stream orders.', '/a/streak-plate.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Stress', 'A force acting upon or within a mass or rock, expressed in terms of unit weight per surface area such as tons per square inch.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Striations', 'Scratches or grooves on a rock or sediment surface caused by abrasive action of objects being transported above it by ice, water or wind.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Strike', 'The geographic direction of a line created by the intersection of a plane and the horizontal.  Often used to describe the geographic trend of a fold or fault.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Strike-Slip Fault', 'A fault with horizontal displacement. Strike-slip faults are typically vertical or near vertical and are typically caused by shear stress. They are the typical fault of transform plate boundaries. The San Andreas Fault is the worlds most famous  example of a strike-slip fault.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Stromatolite', 'A mound-shaped fossil that forms from the repetitious layering of algal mat covered by trapped sediment particles.', '/a/strike-slip-fault.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Strombolian Eruption', 'A type of volcanic eruption characterized by fountains of lava jetting from a lava-filled central crater.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Subduction Zone', 'An area at a convergent plate boundary where an oceanic plate is being forced down into the mantle beneath another plate.  These can be identified by a zone of progressively deeper earthquakes.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sublimation', 'The process by which a solid is deposited directly from a gas without going through a liquid phase. Sublimation frequently occurs around volcanic vents where minerals such as sulfur, orpiment, realgar, and cinnabar are deposited. Even minerals like beryl can be deposited directly from hot gases in hydrothermal veins. These specimens are often of great purity because the crystals grew by the direct deposition of atoms. ', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Submarine Canyon', 'An underwater canyon, carved into the continental shelf.  These can be carved by turbidity currents or  carved subaerially during a time when sea level was lower.', '/a/fumarole.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Subsidence', 'A lowering of the land surface in response to subsurface weathering, collapse or slow settlement of underground mines, or the production of subsurface fluids such as groundwater or oil. The photo shows a sinkhole that formed near Frederick, Maryland.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sugilite', 'Sugilite is a rare silicate mineral only discovered in 1944. It occurs in yellow, brown, pink and purple and is often combined with quartz. The purple color has become very popular in the lapidary trade. Its high price limits its popularity.', '/a/sinkhole.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Sunstone', 'A plagioclase feldspar that can be a colorful transparent gem. It can also contain plate-shaped copper inclusions that produce an aventurescent flash when moved under incident light. These specimens are from Oregon.', '/gemstones/gems/sugilite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Supercontinent', 'A large landmass that forms from the convergence of multiple continents.  ', '/gemstones/gems/sunstones.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Superposed Stream', 'A stream that cuts across resistant bedrock units.  This can occur when the streams course was determined at a previous time and on a previous landscape.', '/c/180-pangea.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Superposition', 'The concept that the oldest rock layers are at the bottom of a sequence with younger rock layers deposited on top of them.  This can be considered a rule that applies in all situations, except where the rocks are extremely deformed.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Supersaturated Solution', 'A solution that contains more solute than its solubility allows.  Such a solution is unstable and precipitation can be triggered by a variety of events.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Surf', 'The breaking of waves as they enter shallow water.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Surf Zone', 'An area of breaking waves bounded by the point of first breakers, then landward to the maximum uprush of waves on the beach.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Surface Rupture', 'The location where the displacement of a fault cuts the Earths surface. Because the surface is usually covered with soil or other loose material, the rupture may be an area of disturbance rather than a clean break.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Surface Wave', 'A type of seismic wave that travels along Earths surface. These are the waves that cause the most damage during an earthquake.', '/a/surface-rupture.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Suspended Load', 'Small particles being carried by a stream and held in suspension by the movement of the water. The blizzard of tiny particles in the image represent the suspended load of a stream. They contrast with the larger particles of bedload on the bottom of the stream and the dissolved load of ions represented as the + and - symbols in the enlargement. Many streams only have a suspended load during times of high flow. Most of the time the water in the stream is clear and moving at such a slow rate that particles are not held in suspension. ', '/a/earthquake-waves.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Suspension', 'Transport of sediment by wind or water currents that are strong enough to keep the sediment particles continuously above the stream bottom or ground.', '/a/suspended-load.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Swash', 'The rush of a breaking wave up the slope of a beach.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('S-wave', 'Secondary seismic waves.  A seismic wave with a direction of vibration that is perpendicular to the direction of travel.  S-waves are slower than P-waves and travel only through solids.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Symbiosis', 'A relationship between two species who live in close association but do not compete with each other or prey on one another.  At least one of the species derives benefit from this association.', '/a/earthquake-waves.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Syncline', 'A trough-shaped fold with youngest strata in the center. Sketch by Sir Charles Lyell.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('System', 'A stratigraphic unit of major significance which was deposited during a specific time period, and which can be correlated worldwide on the basis of its fossil content.', '/a/folds.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Talus', 'An accumulation of angular rock debris at the base of a cliff or steep slope that was produced by physical weathering. The image shows a portion of the talus apron that surrounds Fajada Butte in Chaco Valley, New Mexico.', '/a/talus.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tanzanite', 'Tanzanite is a rare and popular blue variety of zoisite produced from a small location in the African country of Tanzania. It is a birthstone for the month of December and is an alternative gemstone for blue sapphire.', '/gemstones/gems/tanzanite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tar Sand', ' Also known as oil sand. A porous sand or sandstone that contains asphalt or bitumen within its pore spaces. Sometimes the name oil sand is used for a deposit in which the hydrocarbon is in a liquid form, and the name tar sand is reserved for those deposits in which the hydrocarbon is in the form of solid asphalt or bitumen.', '/c2/oil-sand-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tectonics', 'The study of the outermost portion of the Earth, from the surface down to the base of the lithosphere, along with the processes that produce large-scale movement and deformation within this zone.', '/c/180-plate-tectonics.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tektite', 'Tektites are fragments of ejecta, produced when an asteroid struck Earth about 800,000 years ago. The impact melted the target rock and scattered a black glass in a strewn field across Southeast Asia.', '/gemstones/gems/tektite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tephra', 'A general term used for fragments of igneous rock and lava of any size that have been blown into the air by the force of a volcanic eruption.  Tephra can include large blocks and bombs and particle sizes down to volcanic dust.  Larger materials generally fall near the vent, but dust-size particles can be carried for thousands of miles by wind.', '/a/tephra.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Terminal Moraine', 'A mound of unsorted glacial till that usually crosses a valley and marks the furthest advance of a glacier. Also called an end moraine. The photo shows the terminal moraine of the Nellie Juan Glacier near Prince William Sound, Alaska. The two-mile-long lagoon between the terminal moraine and the glaciers terminus is filled with seawater.', '/a/terminal-moraine.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Terminus', 'The lower end of a glacier, often called the snout. The photo shows the terminus of the Pedersen Glacier, located in Kenai Fjords National Park, Alaska.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Terrestrial Planet', 'One of the four rocky planets closest to the sun, which include Mars, Venus, Earth, and Mercury.', '/a/terminus.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Terrigenous Sediment', 'Sediment that is derived from the weathering of rocks that are exposed above sea level. These sediments typically consist of clay, silt, sand, and gravel and are deposited above sea level or carried by rivers, glaciers, or wind into the ocean.  The image shows terrigenous sediment deposited on the  Badwater alluvial fan of Death Valley.', '/a/terrestrial-planet.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Texture', 'The visible characteristics of a rock which include its grain size, grain orientation, rounding, angularity, porosity, foliation, crystallinity,  presence of vesicles, and other physical attributes of the mineral grains and matrix that make up the rock. The image shows the texture of a hand-specimen of conglomerate that can be seen at the top of our article on conglomerate.', '/a/alluvial-fan.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Thermal Pollution', 'Water quality is not defined by chemistry alone. If natural  waters are withdrawn for use, they should be returned to the environment  at approximately the same temperature. An increase or decrease in temperature can have an adverse effect upon plants, animals, and chemical balances. Returning water to a stream at a different temperature than the current temperature of the water is known as thermal pollution. For example, coal-fired  power plants   use water in the production of  steam that turns turbines. That water is  then cooled in  large  cooling towers  before it is returned to the environment. The image shows a steam electric power plant where thermal release must be monitored and controlled.', '/a/texture.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Three-Phase Inclusion', 'A void within a mineral that contains three different states of matter: a liquid, a vapor, and a solid.  The photo shows an inclusion in quartz that contains a liquid (L), a vapor bubble (V), and a crystal of halite (H).', '/a/thermal-pollution.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Thrust Fault', ' A reverse fault that has a dip of less than 45 degrees. A reverse fault is a fault with vertical movement and an inclined fault plane. The block above the fault has moved upwards relative to the block below the fault. Thrust and reverse faults are the typical structural style of convergent plate boundaries and portions of the crust that are under compression.', '/a/three-phase-inclusion.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Thulite', 'Thulite is a rare, pink, gem-quality variety of zoisite. It can be cut into beautiful cabochons, beads, small sculptures, and other lapidary items.', '/a/thrust-faults.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tidal Current', 'Currents of water that are produced in response to a rising or falling tide.  These currents can flow into or out of a bay, delivering the rising water as high tide approaches, or removing the falling water after high tide has passed. (See ebb current and flood current.)', '/gemstones/gems/thulite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tidal Flat', 'A broad flat area, very close to sea level, that is flooded and drained with each rise and fall of the tide.', '/a/flood-current.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tidal Marsh', 'A marsh along a coastline that receives an inflow of ocean water during high tide and is populated by salt-tolerant vegetation. Also known as a salt marsh. The photo is of a marsh in the Plum Island Estuary that researchers believe will be submerged this century as sea levels rise.', '../a/tidal-flat.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tidal Wave', 'A term that is incorrectly used in reference to a tsunami or a storm surge. Tsunamis have nothing to do with the tides. Storm surges may sometimes combine with a tide, but the word tidal wave is inappropriate in any usage.', '/a/tidal-marsh.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tidewater Glacier', 'A glacier with a terminus that ends in a body of water that is influenced by tides. These glaciers may calve and produce icebergs that are carried away at ebb tide.', '../a/tidal-wave.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tiffany Stone', 'Also known as bertrandite, Tiffany stone is a beautiful material that is thought to be an opalized fluorite. Found at one beryllium mine site in Utah.', '/a/tidewater-glacier.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tiger iron', 'Tiger iron is a rock composed of alternating bands of silver hematite, gold tigers-eye, and red jasper. It is cut into attractive and interesting cabochons, beads, spheres, and other lapidary items.', '/gemstones/gems/tiffany-stone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tigers-eye', 'Tigers-eye is a material that forms when quartz replaces crocidolite. When it is cut into a cabochon with its fibrous structure parallel to the bottom of the stone, a chatoyance, or cats-eye effect, is produced.', '/gemstones/gems/tiger-iron.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Till', 'An unsorted sediment deposited directly by a glacier as it melts in retreat and not reworked by meltwater.', '/gemstones/gems/tiger-eye-cabs.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Toe', 'A bulge of soil that develops at the base of a landslide. It occurs where the moving mass overruns the surface exposure of the slip plane. Often people see a mound of soil develop on a slope and grade it level or remove it. Removing the toe of a slide can cause the slide to accelerate because the toe provides support.', '/a/till.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Topaz', 'Topaz is a popular gem. It is usually clear to amber in color when mined. It can be heated, coated, or irradiated to produce other colors that include Swiss blue, London blue, bright pink, and soft pink.', '/a/landslide-anatomy.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Topographic Map', 'A map that shows the change in elevation over a geographic area through the use of contour lines.  The contour lines trace points of equal elevation across the map.  See also: contour line and contour map.', '/c2/topaz-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Topography', 'The shape of Earths surface or the geometry of landforms in a geographic area.', '/a/topographic-map.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tourmaline', 'Tourmaline is a silicate mineral that occurs in a wide range of attractive colors. It is a very durable gemstone that is popular with jewelry makers.', '/a/topographic-map.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Trace Element', 'An element that is present in very small quantities. Trace elements in a mineral or a gemstone are elements that are not  essential components of that minerals chemical composition. For example, trace amounts of chromium can produce a green color in beryl, and when enough chromium is present to produce a rich green color, the material can be called emerald.', '/gemstones/gems/tourmaline.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Trachyte', 'A fine-grained extrusive igneous rock that contains large amounts of potassium feldspar and minor amounts of mafic minerals, often as phenocrysts. The extrusive equivalent of syenite.', '/a/emerald.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Traction', 'Transport of sediment by wind or water in which the sediment remains in contact with the ground or bed of the stream, moving by rolling or sliding.', '/a/trachyte.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Transform Fault', 'A strike-slip fault that connects offsets in a mid-ocean ridge, or links sections of two other faults. ', '/a/bed-load.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Transgression', 'An advance of the sea over land areas.  Possible causes include a rise in sea level or subsidence.', '/a/transform-fault.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Translational Slide', 'A slope failure in which the moving mass travels along a roughly planar surface with little rotation or backward tilting.', '/a/transgression.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Transmission Pipeline', 'A pipeline that carries natural gas from a region where it is produced to a region where it is stored or consumed.', '/a/translational-slide.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Transpiration', 'A process of plants removing water from the soil and releasing it into the atmosphere through their leaves.', '/a/transmission-pipeline.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Transverse Dunes', 'Sand dunes that are oriented at right angles to the direction of the prevailing wind.  These form where vegetation is sparse and the sand supply is abundant.', '/a/transpiration.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Trap', 'A sedimentary or tectonic structure where oil and/or natural gas has accumulated.  These are structural highs where a porous rock unit is capped by an impermeable rock unit.  Oil and gas trapped within the porous rock unit migrate to a high point in the structure because of their low density.', '/a/dune.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Trap Rock', 'Trap rock is a construction industry term used for any dark-colored igneous rock that is used to make crushed stone. The name comes from the Swedish word trappa which means stair steps, a reference to the terraced landscape that is found in geologic areas like the Columbia River Plateau or the Hawaiian Islands, which are underlain by layered basalt flows or layered intrusions such as sills.', '/c/180-oil-gas-investments.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Travertine', 'Calcium carbonate deposits that form in caves and around hot springs where carbonate-bearing waters are exposed to the air.  The water evaporates, leaving a small deposit of calcium carbonate.', '/a/trap-rock.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Trellis Drainage', 'A drainage pattern in which streams intersect at right angles.  This forms in areas of long parallel valleys such as in folded mountain belts.  Rivers occupy the valleys, and tributary streams join them at right angles.', '/a/travertine.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Trench', 'A long, narrow, deep depression in the ocean floor that parallels a convergent plate boundary involving at least one oceanic plate.', '/a/rectangular-drainage.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Triple Junction', 'A point where three lithospheric plates meet.  Triple junctions can be areas of unusual tectonic activity due to the differential motions of the three intersecting plates.', '/a/trench.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tripping', 'Tripping is the work of pulling, removing, and replacing all of the pipe down the hole of an oil or gas well when the  bit or other piece of the drill string must be changed. Tripping out is the process of removing the pipe, and tripping in is the process of replacing it. ', '/a/triple-junction.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Troglobites', 'Small creatures that have adapted to a permanent life in a cave. They are so well adapted to life in a cave that they would be unable to survive in the surface environment. To survive in the darkness, troglobites have highly developed senses of hearing, touch, and smell. Many troglobites have lost their sight and their pigments. ', '/a/tripping.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tsavorite Garnet ', 'Tsavorite is a calcium-rich garnet known for its brilliant green color. It sometimes serves as an alternative stone to emerald. It is the most important green garnet and one of the rarest and most valuable colored stones.', '/c2/troglobites-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tsunami', 'A large gravity wave produced by a sudden displacement of a large volume of water.   The displacement is usually caused by an earthquake, but it can be caused by submarine landslides, subaerial landslides that enter water, explosive volcanic eruptions, caldera collapses, iceberg calving, and asteroid impacts.  These events suddenly depress or elevate a large volume of water, then gravity causes the energy of that displacement to propagate away from the source at a high rate of speed, often as fast as 500 miles per hour and often travelling across entire ocean basins.  The waves have a very long wavelength of up to 100 miles, but their amplitude is typically so low that they can travel beneath ships without being noticed.  Most tsunamis originate in the ocean, but they can be produced in lakes, bays, and rivers.   When they enter shallow water, the energy of the wave begins to drag on the bottom and that slows the front of the wave, while the back of the wave piles up behind it, reaching heights of up to 100 feet. ', '/gemstones/gems/tsavorite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Tuff', ' An igneous rock composed of pyroclastic materials that have been ejected from a volcano, often during the formation of a maar. In many instances these fragments are still hot when they land, producing a welded rock mass or a welded tuff.', '/a/tsunami-source.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Turbid', 'Water that has been disturbed and is carrying suspended material, reducing its clarity. The word is often used in reference to lake water that has been muddied by a stream carrying in a load of suspended sediment. Also known as roiled. The photo shows a heavy plume of suspended sediment entering Lake Tuscaloosa in Alabama.', '/a/tuff.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Turbidite', 'A seafloor sediment  sequence deposited by a turbidity current.  The turbidity current flows down a continental slope, eroding surface sediment as it travels. Then, as it begins to slow, the coarsest grains are dropped followed by grains of increasingly finer size. This produces a graded sequence of sediment with the coarsest grain sizes at the bottom and finer grain sizes going upwards. The image is a photo of part of the Ross Sandstone Formation of Western Ireland that formed as turbidites flowed down a delta front.', '/a/turbid.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Turbidity Current', 'A mixture of sediment particles and water that flows down the continental slope.  These high-density currents can reach great speeds and generally erode loose sediments from the seafloor beneath them. The image is a map of submarine landslides on the east coast of the United States that probably produced turbidity currents.', '/a/turbidite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Turbulent Flow', 'An irregular state of fluid flow in which the particle paths cross one another and may even travel in opposing directions.  (Compare with Laminar Flow.)', '/a/turbidity-current.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Turquoise', 'A copper mineral with a bright blue to blue-green color. The color is so familiar and liked that the word turquoise is used in the English language as the name of a color. Only a few gemstones have a color this familiar.', '/a/turbulent-flow.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Turritella Agate', 'Decades ago, this agate was named Turritella after the fossil snails that it contains. That name is incorrect because the snails were misidentified. The proper name should be Elimia agate after the snail Elimia tenera. Because the name turritella is so engrained in common usage, most people do not realize that it is incorrect.', '/gemstones/gems/turquoise.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Two-Phase Inclusion', 'A void within a mineral that contains:  A) a liquid and a gas bubble, B) a liquid and a mineral grain, or, C) gas and a mineral grain.  The photo shows an inclusion in quartz that contains a liquid and a vapor bubble.  The letter L indicates the liquid, and the V indicates the vapor bubble.', '/gemstones/gems/turitella.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ubiquitous', 'Found everywhere, constantly encountered. Some geologists say that the minerals quartz, calcite, and pyrite are ubiquitous.', '/a/ubiquitous.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ultrabasic Rock', 'An igneous rock with a very low silica content and rich in minerals such as hypersthene, augite, and olivine.  These rocks are also known as ultramafic rocks. Examples include: peridotite, kimberlite, lamprophyre, lamproite, dunite, and komatiite. Shown in the photo is a specimen of peridotite.', '/a/peridotite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ultramafic Rock', 'An igneous rock with a very low silica content and rich in minerals such as hypersthene, augite, and olivine.  These rocks are also known as ultrabasic rocks. Examples include: peridotite, kimberlite, lamprophyre, lamproite, dunite, and komatiite. Shown in the photo is a specimen of peridotite.', '/a/peridotite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Unakite', 'A granite that contains significant amounts of epidote. It typically has a green-and-pink appearance, revealing the epidote and orthoclase feldspar in its composition. Named after the Unaka Mountains of eastern Tennessee.', '/gemstones/gems/unakite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Unassociated Gas', 'Natural gas that is found in a reservoir that does not also contain an accumulation of crude oil. Contrast with associated gas.', '/a/unassociated-gas.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Unconfined Aquifer', 'An aquifer that is not overlain by an impermeable confining unit and has a  porous connection to the atmosphere through which it can receive recharge. In the image at left, the well on the right penetrates an unconfined aquifer. The water level in the well is the same as the water level in the surrounding aquifer. ', '/a/aquifers.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Unconformity', 'A contact between two rock units of significantly different  ages. An unconformity is a gap in the time record for that location. Shown in the photo is a section of The Great Unconformity of the Grand Canyon.', '/a/angular-unconformity.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Unconsolidated', 'A term used when referring to sediment that has not been compacted, cemented, and lithified into a rock. The photo shows layers of sand and gravel in an unconsolidated alluvial deposit in North Dakota.', '/a/unconsolidated.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Unconventional Oil and Gas', 'Crude oil and natural gas that do not readily flow into a drilled well because the rock units in which they are contained either lack the porosity and permeability to allow the oil and gas to flow, or, the oil and gas are adsorbed onto or bound within the grains of the rock.\r\n\n\r\nUnconventional oil and gas are produced from shale, tight sands, and coal beds, where liberating the oil and gas from the rock and moving it to the well are the challenges.  These rock units must be stimulated by techniques such as hydraulic fracturing, horizontal drilling, steam flooding, injection of water, injection of carbon dioxide, or pressure reduction.  \r\n\n\r\nUnconventional oil and gas and conventional oil and gas do not differ in their chemical composition. They differ in the type of rock unit from which they are produced. Compare to conventional oil and gas.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Underclay', 'A name used for a layer of shale or claystone that underlies a coal seam. Seat rock and seat earth are also used. In some instances, an underclay with a high kaolinite content will be a refractory material, or a fire clay, that can be used in the manufacture of ceramic products. ', '/a/unconventional-natural-gas.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Uniformitarianism', ' A basic geologic principle.  Processes that act upon the Earth today are the same processes that have acted upon it in the past.  The present is the key to the past. Shown in the photo is James Huttons unconformity at Jedburgh, which he used as an example of the principle of uniformitarianism.', '/a/underclay.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Unit Cell', 'The smallest sample of a substance that has a complete representation of its atomic structure.  A crystal structure is formed by repetition of the unit cell in three dimensions. The image shows a unit cell of the mineral halite (NaCl).', '/a/uniformitarianism.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Uplift', 'A structurally high area of Earths crust.  Formed by movements that bend the crust into a structure such as a dome or an arch. A structurally high area can also be caused by subsidence of adjacent lands. Shown in the image is the Black Hills Uplift which is bounded on one side by the Powder River Basin and on the other by the Williston Basin.', '/a/unit-cell.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Upwelling', 'Movement of cold water from the floor of a lake or ocean up into a shallow area.', '/a/uplift.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('U-Shaped Valley', 'A deep valley with a flat floor and very steep walls.  Shaped in cross section like the letter U.  Valleys with this geometry are frequently cut by a glacier. In the photo is McDonald Valley, cut by a glacier and located in Glacier National Park, Montana.', '/a/upwelling.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Vadose Water', 'Water that exists in the pore spaces of a rock or soil within the vadose zone (between the ground surface and the water table).', '/a/vadose.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Valence Electrons', ' Electrons in the outermost shell of an atom.  The electrons that are typically involved in making chemical bonds. Shown in the image is one sodium atom and one chlorine atom. A loss or gain of electrons in the outermost shell would produce an ion with a valence.', '/a/atoms.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Valley Glacier', 'A glacier that occurs in a mountainous region and occupies a valley.  Also known as an Alpine Glacier.', '/a/valley-glacier.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Van der Waals Bond', 'A weak chemical bond in which atoms are held together by weak electrostatic attraction.', '/a/van-der-waals.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Variscite', 'A mineral that is similar to turquoise in mode of formation and composition. It even looks like turquoise but in a blue-green to yellowish green color. Cut into cabochons, but its use is limited because it is soft (H: 4.5).', '/gemstones/gems/variscite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Varve', ' A thin layer of fine-grained sediment deposited in the still waters of a lake.  Varves are frequently associated with glaciation and represent a yearly sedimentation cycle - a silty, light-colored layer deposited in summer and a darker, organic-rich clay layer deposited during winter.', '/a/varve.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Vein', 'A fracture that has been filled with mineral material. The photo shows a passage in an underground mine that was developed by removing the rock within a vein that followed a fault. The exposed footwall surface of fault is on the left side of the photo. From the Standard Mine in Gunnison County, Colorado.', '/a/vein.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Ventifact', ' A rock that has been shaped or polished by the sandblasting effect of wind-blown sand. The photo shows a well-known ventifact called The Falcon, a feature located at the top of Mt. Falconer in the Dry Valleys area of Antarctica.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Vertical Exaggeration', 'In making sketches of landscapes and cross sections, the vertical dimension is frequently exaggerated to show topographic detail.  Vertical exaggeration is a number that represents the magnitude of this exaggeration.  It is a proportion between the vertical scale and the horizontal scale.  For example, a cross section with a vertical exaggeration of 4 has a vertical scale that is four times the horizontal scale (in this example the vertical scale could be 1:25 while the horizontal scale is 1:100). The image shows a cross section through a mud volcano created using  high-resolution seismic reflection with a vertical exaggeration of 16.5. ', '/a/ventifact.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Vesicle', 'Spherical or elongated cavities in an igneous rock that are created when a melt crystallizes with bubbles of gas trapped inside. The image is a piece of pumice, a rock with abundant vesicles.', '/a/vertical-exaggeration.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Vesuvianite', 'Vesuvianite is a mineral formed by the contact metamorphism of limestone. It is often an attractive translucent green color that reminds people of jade. For that reason, it is often cut into gemstones.  Named after Mt. Vesuvius.', '/c2/pumice-180.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Viscosity', 'The resistance of a fluid to flow. Fluids with a high viscosity resist flow. Fluids with a low viscosity flow freely. The photo shows a low-viscosity basaltic lava flow which is so hot that the lava is incandescent.', '/gemstones/gems/vesuvianite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Volcanic Arc', 'A chain of volcanoes that forms on the surface of a continental plate when an oceanic plate collides with it  and subducts beneath it.   Also, a chain of volcanoes that forms on an oceanic plate in a similar collision with another oceanic plate.  The image shows the Cascades Volcanic Arc of the northwestern United States.', '/a/viscosity.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Volcanic Ash', 'Small particles, less than two millimeters, of igneous rock that form when a spray of liquid magma is blown from a volcanic vent by escaping gas. These cool quickly, usually into tiny glassy particles similar to pumice, which are lifted out of the vent by escaping gas and carried away from the volcano by wind. These particles can be carried in the atmosphere for hundreds to thousands of miles and  present a hazard to aircraft. The smallest and most mobile particles are known as volcanic dust.', '/a/volcanic-arc.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Volcanic Ashfall', 'An accumulation of volcanic ash produced by an eruption.  These can be very thick near the vent and decrease to a light dusting in a downwind direction. An ashfall presents a breathing hazard to people and animals. It can also cover crops and ruin harvest. When a significant accumulation occurs, it can collapse buildings, fill storm drains, and turn into a natural concrete if it becomes wet. It can be like a snowfall that does not melt and thus creates a disposal problem.', '/c/180-volcanic-ash.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Volcanic Block', 'A rock greater than 64 millimeters in diameter that was ejected from a volcano during an explosive eruption. They are typically pieces of the volcanic cone that were torn loose during the eruption rather than a mass of molten ejecta that solidified in flight. The block in the photo was found on Kilauea Volcano, Hawaii.', '/c/180-volcanic-ash.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Volcanic Bomb', 'Fragments of lava that are ejected while molten or partially molten from a volcano, some developing aerodynamic shapes while flying through the air, and landing with a size over 64 millimeters in diameter. The image shows basaltic volcanic bombs erupted by Mauna Kea Volcano in Hawaii.', '/a/block.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Volcanic Breccia', 'An igneous rock made up of pyroclastic fragments that are at least 64 millimeters in diameter. The photo shows a specimen of mineralized tuff collected near Spore Mountain, Utah.', '/a/bomb.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Volcanic Cone', 'A cone-shaped hill or mountain composed of pyroclastic debris and/or lava that has accumulated around a volcanic vent during eruptions.', '/a/volcanic-breccia.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Volcanic Dome', 'A round, steep-sided extrusion of very viscous lava that is squeezed from a volcanic vent without major eruption.  The lava is too viscous to flow and is composed of rhyolite or dacite. The dome shown in the photo is the vent of the Novarupta eruption of 1912, the largest volcanic eruption of the 20th century. The small dome was overlooked when the source of the eruption was originally determined, and the wrong volcano was blamed. Also called lava domes.', '/a/volcanic-cone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Volcanic Explosivity Index', 'A method of comparing the severity of explosive volcanic eruptions using the volume of material ejected as a scale. The scale is logarithmic and begins at 0 for an eruption that produces less than 0.001 cubic kilometer of ejecta. Each step in the scale is a 10X increase in the volume of ejecta. About fifty eruptions have been rated a value of 8 on this scale.', '/a/volcanic-dome.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Volcanic Neck', 'A vertical intrusion with the geometry of a volcanic pipe an erosional remnant of a volcanic pipe. The image is a photo of Ship Rock, one of the worlds best-known volcanic necks, located in San Juan County, New Mexico.', '/a/vei.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Volcanic Pipe', 'A vertical or nearly vertical conduit that connects a magma reservoir to the surface. Magma and gas travel upwards through this conduit to produce a volcanic eruption.  After the eruption, the pipe can be filled with cooling magma that preserves its shape as an intrusive body, or it can be filled with volcanic breccia and serve as a passageway for liquids, gases, and their entrained solids.', '/a/volcanic-neck.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Volcano', 'A vent in Earths surface through which molten rock and gases escape.  The term also refers to deposits of ash and lava that accumulate around this vent.', '/a/volcanic-pipe.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('V-shaped valley', 'A valley with a narrow bottom and a cross section shaped like the letter V.  Valleys of this shape are almost always cut by stream erosion. The photo shows a V-shaped valley cut into the Orange Mountain Basalt near Feltville, New Jersey.', '/c2/volcanoes.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Wadi', 'A stream bed, often in a steep-sided valley, in an arid region that is dry except during the rainy season. The photo is from Wadi Degla in Northern Egypt.', '/a/wadi.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Warping', 'A slight bend, uplift or subsidence of Earths crust on a regional scale.', '/a/monocline.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Wasting Natural Resources', 'Mineral resources that can be extracted by people but which can not be\r\nreadily replaced by the actions of people or nature. Oil, gas, coal, iron\r\nore, gold, stone, sand and gravel are examples.', '/a/natural-gas-flaring.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Water Cycle', 'The movement of water between the atmosphere, ground and surface water\r\nbodies through the processes of evaporation, precipitation, infiltration, percolation, transpiration and runoff. Also known as the hydrologic cycle.', '/a/water-cycle.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Water Quality', 'An assessment of the physical, chemical and biological characteristics of water, especially how they relate to the suitability of that water for a particular use. In the photo a National Park Service employee conducts water quality monitoring using, hand-held meters, of a stream at Russell Cave National Monument.', '/a/water-quality.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Watershed', 'The geographic area that contributes runoff to a stream. It can be outlined on a topographic map by tracing the points of highest  elevation (usually ridge crests) between two adjacent stream valleys. The watershed of a large river usually contains the watersheds of  many smaller streams. Also referred to as a drainage basin.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Water Table', 'A level beneath the Earths surface, below which all pore spaces are filled with water and above which the pore spaces are filled with air. The top of the zone of saturation in a subsurface rock, soil or sediment unit.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Water Witching', 'The practice of locating groundwater by walking the surface of a property holding a forked stick, a pair of L-shaped rods, a pendulum or another tool that responds when the person moves above a location that will yield an adequate flow of water to a drilled well. Although many people believe in this practice, including a few geologists, it is almost unanimously rejected by geologists and hydrologists. The  National Ground Water Association has issued a position statement that rejects the practice. Also known as dowsing, divining and doodlebugging. \xa0Image copyright iStockphoto / Monika Wisniewska.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Wave-Cut Terrace', 'A long, level surface formed by wave erosion during a time when sea level was higher.', '/a/dowsing.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Wavelength', 'An interval of repetition in a wave-like disturbance. The distance between two successive crests or two successive troughs.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Wellhead Price', 'The value of natural gas at the mouth of the well.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Wet Gas', 'Natural gas that contains hydrocarbons other than methane that are in the gaseous state in the high temperatures and pressures of the subsurface, but that condense into liquids as they flow from a well.  These condensates include hydrocarbons such as pentane, butane, propane, hexane and others.  They have commercial value and must be refined from the methane to make it a suitable fuel.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('White Opal', 'Light opal or white opal are terms used for an opal material with a white, yellow, or cream-colored bodycolor. This is the most common bodycolor for precious opal.', '/a/butane.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Withdrawal', 'A removal of water from a surface or groundwater source for use.', '/gemstones/gems/white-opal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Worked Over Well', 'A previously drilled hole that is reentered and treated to improve or initiate a flow of oil and or natural gas, without drilling additional footage.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Working Interest', 'An interest in a mineral property that entitles a party to a share of the mineral production, often subject to a royalty.  The party is responsible for either carrying out or bearing the costs of exploration, development and production.', '/a/BLANK.JPG');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Xenoblast', 'A crystal that has grown in a rock during the process of metamorphism and which has not developed its characteristic crystal faces because of space limitations. These crystals typically have boundaries that are straight or that conform to the shape of adjacent crystals. The photo shows quartz and feldspar grains in a gneiss.', '/a/xenoblast.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Xenolith', 'A preexisting rock that has been incorporated into magma without melting. When the magma crystallizes, the preexisting rock fragment is known as a xenolith. Most diamonds found at or near Earths surface are in xenoliths ripped from the mantle during the deep-source volcanic eruption that delivered them up into the crust. ', '/c/180-crater-of-diamonds.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Xerophyte', 'A plant that can survive in a very dry location or climate because it has a well-developed means of storing and conserving water. The image shows a group of cacti living on a desert floor.', '/a/xerophyte.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('X-ray Diffraction (XRD)', 'A technique used to identify minerals and other crystalline materials by bombarding them with X-rays.  Planes of repetition within the atomic structure of the mineral diffract the X-rays.  The pattern of diffraction is unique for each mineral structure and can be used for mineral identification. This method of identification is much more reliable than hand-specimen identification and is used when hand-specimen identification is not possible, difficult, or has produced questionable results.', '/a/x-ray-diffraction.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('X-ray Diffractogram', 'A printed or digital record of an x-ray diffraction analysis. It shows the angle of diffraction on the horizontal axis and the intensity of diffraction on the vertical axis. Peaks on the diffractogram are characteristic of the material being examined and can be compared with reference diffractograms to identify minerals and other crystalline compounds.', '/a/x-ray-diffractogram.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('X-ray Fluorescence (XRF)', 'A technique used to determine the elemental composition of a specimen by bombarding the material with x-rays. The x-rays excite the atoms in the specimen, causing them to emit x-rays of a longer wavelength. These are detected by the analytical equipment, and on the basis of comparison with known standards, the elemental composition of the specimen is determined. X-ray fluorescence can be especially valuable because it can be used as an aid in identifying materials that are not crystalline and thus cannot be identified by x-ray diffraction.', '/a/x-ray-fluorescence.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Xyloid Coal', 'A type of lignite coal that displays the fibrous structure of the wood. Also known as xyloid lignite.', '/a/xyloid-coal.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Xylopal', 'An opalized wood. Forms when opal (usually common opal) infills the cavities and replaces the organic material of a piece of wood. Sometimes the wood grain or cellular details of the original wood can be seen.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Yazoo Stream', 'A tributary that parallels the main channel of a stream for a considerable distance. Joining of these streams is normally blocked by a natural levee along the larger stream. Shown in the image is  Wakenda Creek paralleling the Missouri River before joining it near Miami Station, Missouri. This image is a portion of the USGS Marshall 30x30 minute quadrangle map of 1901.', '/a/yazoo-stream.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Yellow Ground', 'Oxidized kimberlite (a variety of the rock type known as  peridotite). A yellow soil that is characteristic of the area above a kimberlite pipe. Yellow ground is used by geologists looking for diamonds. Yellow soils are unusual. When you encounter one, you might be over a kimberlite pipe.', '/c/180-crater-of-diamonds.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Yellow Ocher', 'A variety of limonite that is ground into a yellow-brown powder for use as  a pigment. People have used it for thousands of years as a powder, as an ingredient in paint, and as an additive to materials where the color is desired.', '/a/yellow-ocher.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Yield', 'The quantity of copper, coal, gold, or other resource that can be produced from a deposit.', '/a/mine.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Yogo Sapphires', 'A variety of blue sapphire found in the Yogo Gulch area of Judith Basin County, Montana. People panning for gold in the mid-1800s noticed the blue pebbles and disregarded them because they were not recognized as sapphires, and there was no market for  gem rough  in Montana at that time. Their value was realized after a  local rancher sent a small box of them to an assay office, who forwarded them to Tiffanys in New York, who sent the rancher a  surprising check. Some early mining efforts in the area were profitable, and this triggered the discovery and sporadic production of sapphires in other parts of Montana. Today, most sapphires found in Montana are through the efforts of hobby miners working placer deposits.', '/a/montana-sapphire.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Youth', 'The earliest stage in the development of a landscape.  During this stage, streams are actively downcutting and flowing straight for long distances with frequent waterfalls and rapids.  The valleys are typically steep sided and V-shaped.', '/a/youth.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Yowah', 'A variety of boulder opal found in the Yowah area of Queensland, Australia.  Photo by J.J. Harrison and used here under a Creative Commons License.', '/a/yowah.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Zeolite', 'A group of hydrous aluminosilicates that are similar to the feldspars. They easily lose and regain their water of hydration, and they fuse and swell when heated. Zeolites are frequently used as catalysts,  water softeners, and sorbents. Many zeolites are natural minerals, but synthetic zeolites are widely produced to control properties, control costs, and establish a reliable supply. The image shows the shape of a zeolite crystal. The openings in the crystal increase its surface area for catalyst functions and increase its ability to serve as a sorbent and filter.', '/a/zeolite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Zinc Blende', 'An older term used instead of sphalerite, a zinc sulfide (Zn,Fe)S mineral. It is the primary ore of zinc. Sphalerite is often rich in  cadmium - so much that sphalerite mining is the primary source of cadmium. Sphalerite is usually found in rocks altered by hydrothermal and contact metamorphism and is commonly associated with galena and dolomite.', '/a/sphalerite.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Zincite', 'A red-to-yellow oxide of zinc with a chemical composition of ZnO. It is a rare mineral that has served as an ore of zinc at locations where it is abundant. Also known by miners as ruby zinc and red zinc ore.', '/a/zincite.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Zircon', 'Zircon is a zirconium silicate mineral (ZrSiO4) that is found in igneous, metamorphic, and sedimentary rocks.  It often contains unstable elements such as hafnium, uranium, and thorium.  The presence of uranium and thorium sometimes makes crystals of zircon useful for determining the age of the rocks in which they crystallized, such as granite.  Zircon is harder, more resistant to weathering, and has a higher specific gravity than most other minerals.  This enables it to be concentrated in placer deposits, where it is sometimes recovered for use as a gemstone.  Colorless zircon was once a common substitute for diamond.', '/gemstones/gems/zircon.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Zoisite', 'A calcium aluminum silicate mineral Ca2Al3(SiO4)(Si2O7)O(OH) that forms during regional and hydrothermal metamorphism. Zoisite is the parent mineral for several gemstones. Tanzanite, a transparent blue zoisite that is often heat-treated to produce the blue color, is the most widely known and popular.  Thulite is a pink, opaque zoisite often used for cabochons and small sculptures. Anyolite is a green zoisite with red corundum crystals (rubies), often referred to as ruby in zoisite.', '/gemstones/gems/tanzanite.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Zone', 'A limited area, on or below Earths surface, where the soil, rocks, or other materials present exhibit a structure, composition, or characteristic that is distinctly different than what is seen in adjacent areas. Examples include: fault zone, flood zone, subduction zone, zone of saturation, zoned crystal, zone of weathering.', '/a/fault-zone.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Zoned Crystal', 'A crystal that does not have uniform color or composition. This can be caused by a change in the composition or temperature of the fluid from which the crystal was  growing  twinning or, variations in exposure to heat or radiation. Minerals such as olivine or plagioclase which have a solid solution series are frequently zoned. Shown in the image are two faceted tourmalines cut from zoned crystals produced by growth. The one on the right is known as watermelon for obvious reasons. Also, consider ametrine, a bicolor quartz that is a combination of AMEthyst and ciTRINE believed to be caused by twinning.', '/gemstones/gems/bi-color-tourmaline.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Zone of Aeration', 'A zone below the land surface but above the water table, where pore spaces are filled mainly with air. Water that exists in the pore space in this zone is referred to as soil moisture. The capillary fringe, where capillary action draws moisture from the water table upwards, is considered to be part of the zone of aeration. Also known as the unsaturated zone.', '/a/dictionary-of-geological-terms.jpg');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Zone of Saturation', 'The zone below the water table, where all pore spaces are completely filled with water. Water that exists within this zone is known as groundwater. Also known as the saturated zone.', '/a/zone-of-saturation.gif');",
  "INSERT INTO dictionary (key, value, image_url) VALUES ('Zone of Weathering', 'A subsurface area, above the water table, where mineral and organic materials are subject to weathering. The materials in this area can be subjected to multiple types of weathering. Examples include: a) chemical weathering by exposure to oxygen or acid waters b) mechanical weathering by exposure to freezing and thawing c) biological weathering by exposure to roots and burrowing organisms. The photo shows a zone of spheroidal weathering in basalt. ', '/a/zone-of-saturation.gif');"
];